    ProfileText: "\ufeffMike\u2019s Date-Me Doc\r\n\r\n\r\n\r\n\r\nHi, thanks for checking out my date-me doc! My name's Mike, and I'm trying to meet the right person to settle down with. If you think we might be a good match, please send me an email at mikest@udel.edu.\r\n\r\n\r\n\r\n\r\n\r\n\r\nBasic Info\r\n* Age: 31\r\n* Height: 6'0 (183 cm)\r\n* Looking for: Monogamous relationship, interested in women.\r\n* Location: Philadelphia, PA. Open to moving anywhere within the US, but probably not internationally. Open to a long-distance relationship in the short-term, as long as the plan is to eventually settle down in the same location.\r\n* GIANT RED FLAG: I was previously married and it didn\u2019t work out, so we ended it on good terms. Completely understand if this is a dealbreaker for some people.\r\n\r\n\r\n\r\n\r\n\r\n\r\nCareer / Hobbies / Interests\r\n* I currently work as a computational biologist at a research lab at UPenn. Basically get paid to work on interesting problems all day, so it's pretty cool. But part of me kinda wants to be building something rather than doing purely academic research, so I may eventually try to switch over to biotech.\r\n* Outside of work, one of my favorite hobbies is teaching. For example:\r\n   * I have an educational Youtube channel with tutorial videos about computational biology and programming.\r\n   * I sometimes teach in-person classes at Fractal University, a cool community-based proto-university in NYC. (I\u2019m also trying to start something similar in the Philly area.) \r\n   * Also, sometimes people ask me to teach Python-for-Biologists workshops, and I'm happy to do this for free. For example, I recently taught a 6-hour virtual workshop for a university in Pakistan that invited me. \r\n   * I\u2019m partly doing this just for fun, but it\u2019s also part of a broader interest in alternative, non-traditional education. I basically agree with all the usual criticisms of the current education system, but I also have this Chesterton\u2019s-fence-esque belief that you shouldn't knock down an institution until you\u2019ve successfully built something better to replace it (which might be harder than it sounds).\r\n* Besides teaching for fun, I also like learning for fun. I especially like to learn how things work from scratch (like neural nets, statistical tests, market economies, compilers, or computers).\r\n* I like a lot of the usual ACX / LessWrong / rationalist stuff, for example:\r\n   * Some public thinkers I find interesting (though don't 100% agree with all the time): Scott Alexander, Eliezer Yudkowsky, Julia Galef, Aella, Dwarkesh Patel, Bryan Caplan, Tyler Cowen, Robin Hanson, Sam Harris\r\n   * Some topics I find interesting: prediction markets, forecasting, machine learning, decision theory, probability brain teasers, meta-science\r\n* Other hobbies: \r\n   * running / fitness\r\n   * watching movies (especially horror / thrillers / mysteries)\r\n   * walking around (could be a hike or exploring a city)\r\n   * weekend roadtrips\r\n   * playing guitar. I used to play saxophone too, and kinda want to get back into that.\r\n\r\n\r\n\r\n\r\n\r\n\r\nBeliefs and Values\r\n* Political views: Center-right. Classical liberalism, markets, civil liberties, freedom of speech, science, secularism, entrepreneurship, techno-optimism, etc. libertarian-ish, but closer to Tyler Cowen than Ron Paul. \r\n* Religious views: agnostic/atheist, but not hardcore about it. somewhat \"culturally Christian.\" open to raising kids in a religious tradition if it means a lot to you.\r\n* Vegetarian (it's fine if you're not though)\r\n* Things I agree with effective altruists about: malaria prevention, effective giving, animal welfare, etc.\r\n* Things I disagree with effective altruists about: AI risk/benefit\r\n* ^ I try not to be too preachy or argumentative about any of these things, and am certainly open to dating people who don't share these views.\r\n\r\n\r\n\r\n\r\n\r\n\r\nAbout You (Hopefully)\r\n* Someone who\u2019s interested in a serious, monogamous relationship and eventually settling down together. I\u2019m not really looking for casual dating or hookups.\r\n* Someone who\u2019s interested in having kids. Ideally I\u2019d like to have at least 2 kids (because it\u2019s nice to have a sibling), and am open to having more if you\u2019d like.\r\n* Someone who\u2019s kind, gentle, caring, honest.\r\n* ^ I almost wrote \u201cintelligent\u201d here but that\u2019s actually not the right word. Maybe \u201cthoughtful\u201d or \u201ccurious about the world.\u201d I don\u2019t really care how you score on an IQ test, but I\u2019m looking for someone who enjoys learning new things, exploring new ideas, and engaging with different viewpoints in good faith. \r\n* Other than that, I\u2019m not sure what else to write here. Part of me thinks it would be cool to find someone who shares the same interests as me so that we could nerd out together, maybe teach classes together, learn together, work on projects together. But another part of me thinks it would be cool to meet someone completely different from me, like an artist or poet, so that we could share our different worlds with each other.\r\n* If you think we might be a good match, please send me an email at mikest@udel.edu!\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nSome Pics\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\nDisclaimer: this pic is kinda old (2019?). It\u2019s from back when I used to be in the Coast Guard.\r\n\r\n\r\n\r\n\r\n\r\n\r\nIf you want to see more of what I look like, there are a bunch of videos of me on Youtube",
