    ProfileText: "\ufeffHello Internet!\r\n\r\n\r\nMy name is Julie. I\u2019m 39 years old (which honestly feels very old to type and not representative of how old I feel at all!). I moved to Sacramento a few years ago by way of Brooklyn and San Francisco before then. I have a 4 year old dog named Bailey (see pictures below). I work remotely for a startup in NYC where I am the Director of People Operations (like a more fun version of saying \u201cHR.\u201d) All of my immediate family lives here in Sac and I am really enjoying being close to them after years of living further away. This picture is of my sister (on the right) and I (in black on the left).  \r\n\r\n\r\nI am very happy and have a full life with deep relationships with my family members, long time friends, and colleagues, all who enrich my life. My friends and family would describe me as smart, funny, warm, deeply empathetic, and cheerful. I am very independent and am not creating this doc because I desperately need a man. I am here because I\u2019d like to find someone who will bring something to our relationship -- and I will do the same.\r\n\r\n\r\nI am a democrat. I would like to date someone who shares similar political views. I don\u2019t have children, and am not interested in having children, although I am more than fine dating someone who does have kids. I am a very proud auntie to several of my friend\u2019s children. I\u2019m godmother to my cousin\u2019s son. \r\n  \r\n\r\nI travel a fair amount for either work or fun. My most recent international travel has been: India, Switzerland, and Mexico. (Picture is me with my friends/coworkers at a wedding in Mexico)\r\n\r\n\r\nFor fun, I enjoy hanging out with my dog, going on walks in new areas, and taking her to training classes. She may be 4, but she is stubborn! I enjoy going to trivia nights, trying new restaurants, watching classic movies, long walks, exploring new places, exercise, baseball games, bowling, cooking/baking, etc.\r\n\r\n\r\nDeal Breakers for me and/or you:\r\n* I don\u2019t smoke, and wouldn\u2019t be compatible with a smoker.   \r\n* I drink occasionally, but not very much. \r\n* I work what I call \u201cLazy east coast hours\u201d meaning I start work between 6 and 7 am. As a result, I don\u2019t stay out late, and I'm in bed early. \r\n* I don\u2019t drink coffee, but love the bliss tea at Temple. \r\n* I am not active or addicted to social media. I have an instagram that I have not posted on since circa 2019. I don\u2019t have tiktok. I\u2019m not influencing anything. \r\n* I spend most of my day working in front of the computer and don\u2019t like to spend my time outside of work on my computer or phone. As a result, I am not the kind of person who texts back immediately. I get to it when I have time, unless of course it\u2019s urgent.\r\n\r\n\r\nWhat I\u2019m looking for:\r\n   * A man in a similar age range (probably 35-50) who\u2019s looking to meet another person and really get to know her - ie, you\u2019re dating with the intention of finding \u201cyour person.\u201d  \r\n   * A man who\u2019s passionate/enthusiastic about life.\r\n   * Someone who\u2019s career driven\r\n   * Doesn\u2019t smoke\r\n   * Not a heavy drinker\r\n   * Not a big partier (aren\u2019t those days behind us?)\r\n   * Someone who cares about family\r\n   * Low ego/humble\r\n   * Kind\r\n   * Patient\r\n\r\n\r\nSound like you? Email me: jlmccollo@gmail.com",
