    ProfileText: "\ufeffJanuary 2025\r\nAbout me\r\nI am 23, I live in Oxford, studied in my native Australia, and grew up mainly in India.[1] I feel moved by the plight of current people and non-human animals, but also find persuasive the basic longtermist argument that the future is big and important and changeable. So for now I am trying to help make the transition to AGI go well.\r\nYou can see some things about me on various places online, including the EA Forum, LinkedIn, Goodreads, Google Scholar, and my Substack subscriptions.\r\nThat is fairly cold and impersonal; it is perhaps more fun and interesting to get to know each other by talking. But for now, here are some less work-y things about me:\r\n* I like to read, play board games and ~any sport, hike and camp, talk about philosophy and physics and photosynthesis and occasionally non-alliterating things.\r\n* I am very honest and value open, frank, fairly direct communication with others. I tend to ask quite a few questions, mainly because I am curious to learn about other people\u2019s experiences and ideas!\r\n* I am not very artsy; beyond the occasional poem (e.g. here, here), and some elegant mathematising if that counts, my creative output is meagre.\r\n* I have rather little familiarity with pop culture and I mostly do not regret this. But it means I wouldn\u2019t be a very good conversationalist on such things.\r\nHere are some photos of me doing things I like. And this is what my[2] face looks like:\r\n  \r\n\r\nAbout you\r\nApart from demographic things (I have only ever been attracted to women, this seems very unlikely to change; being a somewhat similar age/life stage is helpful) and unsurprising things (one\u2019s partner being kind and clever and caring and calm and courageous is always nice) I would like to be with someone who is:\r\n* Morally serious - the stakes are high; there is so much to protect; doing the right thing matters. I think I would struggle to deeply empathise with and respect someone who had a more blas\u00e9 attitude to improving the world. It seems less important what exactly you care about and want to work on.[3]\r\n* Intellectually curious - talking about ideas is quite important to me, and it would be hard to spend lots of quality time with someone who isn\u2019t interested in ideas. But what you study/studied, who your favourite philosophers are, what your favourite theorem is etc is less important.\r\nBeyond that, of course, it would be nice if we enjoyed some of the same activities, but I feel like that is more malleable.\r\nIt would clearly be nice to live near each other, but I am open to exploring a relationship with someone who currently lives far away.[4]\r\nI am open to ~any preference on whether to have kids, I have quite mixed thoughts.[5]\r\nYou can email me at oscardelaney0@gmail.com.\r\n________________\r\n[1] My parents were doing \u2018global health and development\u2019 work before it was cool in EA ;)\r\n[2] Is my past self really \u2018me\u2019? What is the relationship between \u2018me\u2019 and \u2018my face\u2019? Tricky questions!\r\n[3] I care quite a bit about EA as a project, and somewhat about EA as a community. It might be helpful if you do too, but I think the \u2018morally serious\u2019 frame of mind is the more important part.\r\n[4] I quite like living in Oxford, but would be open to moving for the right (work or romantic!) opportunity.\r\n[5] I like spending time with kids and would all else equal prefer to be a parent (and am generally pro-natalist!). But all else isn\u2019t equal, e.g. if AGI comes this decade it could be a very tumultuous few years where I want to focus fairly hard on work without caring for young kids. But I don\u2019t know.",
