    ProfileText: "\ufeffOverview\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\t\r\n\r\n\tI\u2019m building a life of impact, intellectual curiosity, physical activity, and a growth orientation. I\u2019d like a partner who values and shares these areas, if not the specifics in each area. I can seem hard on the outside, but I\u2019m a romantic and I promise that there\u2019s a warm, soft core.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\nHere\u2019s how excited I can get about ideas! (Very old.)\r\n\t  \r\n\r\nIn a castle in Spain, after picking a padlock to get there.\r\n\t  \r\n\r\nI accidentally got a cat during covid. I\u2019m lucky to have a lot of friends who look after her when I\u2019m traveling.\r\n\t  \r\n\r\nNot my child. But isn\u2019t she cute?\r\n\t\r\n\r\nThe basics\r\n* Male, age 44, seeking female, age approximately 35 to late 40s, for a monogamous relationship akin to (or actually) marriage.\r\n* I live in San Francisco. More below.\r\n* I don\u2019t need to have children. I\u2019d be excited about it with the right person, in specific situations. See below.\r\n* Email: m@redheron.com\r\n* Facebook profile. I don\u2019t post much, and less publicly, but you can see mutual friends at least. Twitter. I don\u2019t post much there either. It\u2019s a bit out of date, but you can also find me on OkCupid.\r\nMore detail\r\nImpact\r\n* I\u2019m involved in nuclear fusion, because I believe that the world needs clean, cheap, abundant, safe energy in order to limit climate change and create abundance.\r\n* I\u2019m passionate about structural improvements to our governance systems. I\u2019m also working on a software project (writeup) to help people vote faster, with more information.\r\n* I spend a lot of my time on another software project -- a collaborative note taker, task manager, etc. (That sounds boring, but I promise that it\u2019s not!)\r\nIntellectual curiosity\r\n* I love discussing things that we\u2019ve read or heard, or pondering how something works, or listening to/watching something together and trying to figure it out. I especially love finding people who are experts in some random field but are patient enough to let me question them about what they are doing, why it makes sense and how it works. I especially especially love tag-teaming this quizzing with a friend.\r\nPhysical activity\r\n* I run, ski, back-country ski, snow camp, backpack and mountain bike. At the moment I\u2019m working on running further. Have you thought about how far one can run in a day, and how much further it is than we can backpack?! Imagine setting up a base camp in a national park somewhere and then running all over the place for a few days. You could see so much!\r\n* I\u2019m totally excited to try your sports. These are just the ones that I\u2019ve gotten sucked into so far.\r\n* I\u2019d like to learn to dance. I\u2019m pretty terrible at it, and cuban salsa did not go well, even after a year of trying. The next experiment is fusion (dance, not energy, in this case).\r\n* I\u2019ve done a lot of urban exploration. I don\u2019t do as much now, but I\u2019ve picked every lock in the Conservatory Flowers in Golden Gate Park and I still love climbing cranes.\r\n\r\n\r\nGrowth orientation\r\n* I\u2019m not in coaching or therapy at the moment, but I\u2019ve gotten a ton from coaching in the past.\r\n* I\u2019m all over the various growth books and recently read Good Inside and The Courage to be Disliked.\r\n* I strive to improve my close relationships and bring my best self to them; and to take feedback gratefully.\r\n* Don\u2019t confuse this for woo. I\u2019m a rational atheist who wants to take the good stuff from the touchy-feely hippies, but also keeps discovering that they have more good stuff than I thought. (Who knew that blindfolded contact improv could be so much fun?)\r\nSampling of things that I like talking about\r\n* The world\r\n   * What's the right way to address climate change? And population growth?\r\n   * If you could change something about how American democracy works, what would it be? Is western democracy on a decline? How can we fix it? (I think that America may be on the verge of what I call the \u201cNew American Consensus\u201d, and with it an era of great accomplishments.)\r\n* Tech\r\n   * What would I do if I had good VR/AR hardware?\r\n   * How can software be better? How can we build it better? What would a debugger designed for functional programming look like? (IMO: very different, and very awesome.)\r\n   * How can we collaborate more effectively?\r\n   * How will the world change when SpaceX gets Starship working?\r\n* Other\r\n   * How can I be kinder, warmer and gentler, but still help groups to get things done?\r\n   * How can I get into somewhere I shouldn\u2019t?\r\n   * How can I travel with less gear?\r\nWhere I live\r\n* I live in San Francisco.\r\n* I\u2019ve been here for nearly 25 years and know a lot of wonderful people.\r\n* I live in a community of 4 buildings, one big shared garden, 15 adults and 6 children (more planned or on the way!), 3 hot tubs and lots of cats. We each have our own units, so we don\u2019t have to agree on how clean our kitchens, bathrooms, etc are. It\u2019s co-livinging for grownups and it\u2019s great. You might love it too. \ud83d\ude00\r\n* I\u2019m loath to leave SF permanently but I\u2019m also really eager to find an amazing partner and am willing to look in many other places for her. Europe (especially Berlin) and New York tug at my heart. I recognize that I might get lured away from SF, but I\u2019ll also try to lure you here. Maybe we can travel a lot.\r\nChildren\r\n* I used to be pretty strongly opposed to having children. I\u2019d be married at least twice by now if it weren\u2019t for that.\r\n* I still don\u2019t need to have children, but now I can now see a path where I\u2019d be excited to have children: with a partner who is highly aligned on values and goals, and in a community like the one that I live in, with lots of social contact built in, so that parenting isn\u2019t as isolating.\r\n* The two biggest things that changed my mind about children are (1) seeing how different parenting is when done in community, and realizing that the future will be less awesome if a whole group of us opt out of having children.",
