    ProfileText: "\ufeffUpdated January 20, 2025  \r\n\r\n\r\n.Emily\u2019s Date- Me Doc \u2665.\r\n\r\n\r\n\r\n\r\n.Me.\r\n\r\n\r\nA curious do-gooder. \r\n\r\n\r\n.You.\r\n\r\n\r\nAlso a curious do-gooder. :)\r\n.About Me.                \r\nI\u2019m 24 years old, a cis female, 5\u20193\u201d, and 105 pounds. I try not to give weight to typologies, but INTJ and Enneagram 1 describe me well.\r\n\r\n\r\nI\u2019m an intense person who goes all in for the things I care about.\r\nI naturally like to optimize, but lately have been evaluating this mindset.\r\n\r\n\r\nI adore unconventional ideas (e.g. I sleep in a sleeping bag on the floor with no pillow) and highly value authenticity and open-mindedness. Deep relationships are most important to me.\r\n\r\n\r\n.What I\u2019m doing with my life.\r\n\r\n\r\nI graduated college in May and am still figuring out my career. Since graduating, I\u2019ve helped Democratic campaigns in the US. I worry that if we don\u2019t address facism in the US (if it\u2019s not too late), it will be much harder to address all the existential crises we\u2019re facing. I\u2019ll likely continue on the politics/campaign path for at least the next four years.\r\n\r\n\r\nI love climbing and anything in nature (I thru-hiked the Appalachian Trail three years ago), reading nonfiction, journaling, philosophy (esp. Buddhism), minimalism, board games (I get weirdly competitive), and experimenting with life!\r\n                                \r\n.What I\u2019m looking for.                                       \r\n\r\n\r\nA life partner/husband who is my best friend - a relationship that feels secure, playful, and has shared interests (passes the traffic test). I\u2019m monogamous and am not sure yet if I want kids. I\u2019m currently based in Northern Virginia (but move depending on work) and am willing to relocate. Also open to new friends!\r\n\r\n\r\n.Please reach out!.\r\n\r\n\r\nDo you think we\u2019d get along well? If yes, message me here. :)\r\n\r\n\r\nDo you know someone I might get along well with? Please share this doc with them!\r\nBounty: I\u2019ll give $1,234 to the person who introduces me to my husband. But- What if you\u2019re my husband?\r\n\r\n\r\n\r\n\r\n\r\n\r\n                                                                                                        haha jk\u2026 unless\u2026?",
