    ProfileText: "\ufeffGrant\r\n30yr old male from Basingstoke, England looking for a date\r\nIntro\r\nThere\u2019s only so many times you can keep swiping past women looking for \u201cgolden retriever energy\u201d and a \u201ctime and place\u201d before you lose your sanity and realise a change in approach is needed, so let\u2019s give this dating docs thing a try. I\u2019ll give you an overview then you can decide if you want to go further.  \r\nStory so far\r\nIn terms of finding love my track record is\u2026interesting. At time of writing I\u2019m in my third year of dating and still very much learning how all this works but proud at how far I\u2019ve come.Whilst not smooth sailing I\u2019ve learnt a lot about myself and what I\u2019m after (which I\u2019ll try to summarise a bit further down)\r\nIf you\u2019ve done the math so far you\u2019ve probably come to the conclusion I haven\u2019t been in a relationship - and you\u2019re right.It\u2019s mainly been wheelspining in first dates with the occasional step into dates 2-4. Whilst not the most glamorous statement on here it does mean I come with no baggage (kids,crazy exes,etc.) so every cloud right?\r\nWhat I\u2019m after\r\nMost of these docs usually end with this section but I\u2019m going to pop it near the top so I don\u2019t waste your time if none of these float your boat.I don\u2019t have a \u201ctype\u201d but do have some boundaries/preferences:\r\n* Kids - This is very much a don\u2019t have and will not be pursuing.If you have any desire for parenthood now\u2019s the time to close this doc and move on.Happy to go into why I\u2019ve chosen this path if asked.\r\n* Distancing Strategies - By this I refer to ghosting/similar tactics.This is a strong no from me and if I get a whiff of this I will be out.\r\n* Attachment style - So I sit on the anxious side of attachment theory and as such would ideally want a secure partner or at the very least an avoidant partner who acknowledges their attachment style and is willing to work towards developing secure tendencies as I am.\r\n* Distance - Preference would be for prospective partners to sit in the range I\u2019ve used for dating apps in the past - within a 30km radius from Basingstoke.I\u2019ll leave this below so you can see if you fit in the bubble.\r\n  \r\n\r\n* Age - Again will keep this in line with my current dating app settings - 25 to 40 year olds.\r\nAs you can see I don\u2019t have any crazy demands (I hope) written down here. Fundamentally I\u2019m after a nice person I fancy - simple as.Title,possessions,etc. are not super important as in my eyes we lose it all in the end anyway.\r\nIt\u2019s the journey/experiences that count.\r\nAbout Me\r\nStill interested? Well then let\u2019s get into what I\u2019m about.\r\nInterests\r\n* Fitness - I currently go to the gym 1-2 times a week with 2-3 running sessions around my work in the week. Running has been something I\u2019ve introduced into the mix tailend of 2024 and has been a fun challenge when it comes to running a 5k. My aim is to get a 5k consistently within 30 minutes in 2025 and potentially look at longer distance running in the future.\r\n* Nature - I like to get out and about around the natural parts of my area. Accompanying me is my dog Daisy who has been a faithful companion and cheered me up in even the most difficult of times.Before you ask, yes you will get to meet her.\r\n  \r\n\r\n\r\n\r\n* Motorsport - One of my biggest passions. What kept me glued to the screen as a kid has turned into my most favorite thing ever and has led to me attending many car events, go-kart races, building my own simulator and working for a F1 team (albeit in their supercar division) - McLaren.\r\n* Pursuit of Knowledge - I\u2019m very much one of those people who will read/YouTube/Google something and - if it\u2019s interesting enough - pursue it.This has led me into learning how to code,how to date/interact with others using cognitive theory and build a computer. If you\u2019ve got any cool things you\u2019ve learnt that you think might interest me it would be good to hear.\r\nBest Qualities\r\n* Open/Honest - I will always tell you how it is (good or bad), there will be no ambiguity around me. If you feel that\u2019s not the case, then you just need to say and I\u2019ll do my best to address any concerns.\r\n* Resilience - Having been through many hardships in my 20s and surviving them, I\u2019ve built up a decent resilience and drive to press on despite challenges.I feel this will serve me well in a relationship as there will be plenty of difficult discussions/issues to overcome.\r\n* Growth Mindset - I\u2019m very much of the opinion that I\u2019m not anywhere near my peak and that there is more to come. If you're after someone who will continue to work hard, even deep into a relationship, I might be a good fit for you.\r\nLife admin\r\nJust so we can avoid the boring bits on the first date and get to the fun conversations, let\u2019s get these life admin bits out the way:\r\n* I have a stable job in Quality Engineering.Not a CEO or anything but the pay is decent and I can typically get a 4% raise every year.\r\n* Understand the fundamentals of money and can budget expenses reliably while leaving funds for savings/retirement/enjoyment.\r\n* Own my own car and can drive.\r\n* Not on the property ladder currently and staying with my mum supporting her through a serious illness.\r\n* Only a social drinker, no smoking or drugs.\r\nMore Photos\r\n  \r\n\r\n  \r\n\r\n\r\n\r\nWant to find out more?\r\nThanks for reading my date doc. If you want to find out more and potentially go on a date send an email to grant.eckett@gmail.com with why you think you might be a good match and a photo so I know you are a real person. If you can suggest things you may be interested in for a first date then even better!",
