    ProfileText: "\ufeffI am where I want to be. Duluth. On the shore of a beautiful Great Lake, in a definitely Midwestern city with nooks and crannies that are anything but. A big small town where more people know your business than ought to. And more people care than the wider world could imagine. \r\n\r\n\r\nI'm a 55 yo journalist, writer, poet, designer, philosopher, gad-about, live music/art fan, father of a beaming 7 y.o. girl. \r\n\r\n\r\nSearching for a seriously nonserious woman. A laugher. A crier. A human. A seeker. A reader. A wordsmith. A lover. A passionate jokester. Many things. \r\n\r\n\r\nFrankly, I haven't been much in the dating world since divorce five years ago. No time, I say. An excuse. I can be selfish with my space, I think. But I'm feeling something again about finding the right connection, taking the time to do that.\r\n\r\n\r\nI'm mike(dot)Creger(at)Gmail.com\r\n\r\n\r\nSome writing/nonsense that may provide more clarity on my state of being:\r\n\r\n\r\n\r\n\r\nIn the past few weeks I've learned that people are becoming acutely selfish and rotten. Those teetering into this category seemingly fall into the pit more easily these days. Me, I follow the golden rule instilled by my mother.\r\n\r\n\r\nBut yeah, public behavior at festivals, driving, and just casually looking around. People are dying inside, and taking it out on others.\r\nDon't die inside. Follow your heart and be gentle, even with those who deserve no gentility back.\r\n\r\n\r\nBe raw, honest, relatable. Take nothing for granted, don't back down, but don't just make something a pissing match. That's like following the natural course of water. The easy way out.\r\nPound empathy on your stand. \r\n\r\n\r\nAnd be proud, sure of who you are, sure of how someone has you wrong. Correct their course with humanity, kindness.\r\n\r\n\r\nIt's lazy to fight. It's lazy to pick a fight. \r\n\r\n\r\nKnow where your heart is, where you want to be. Go there.\r\n__------------\r\n\r\n\r\nThe wind bellows its argument with the ceiling, the sea and unsprouted spring.\r\nIt wends through the alleyways and swirls the surviving leaves.\r\nIt relishes the irony it hoards in low pressure.\r\nIt doesn't know its strength or siren.\r\n\r\n\r\n_----------\r\nYour Artist: Wilco\r\nAre you male or female: Either Way\r\n\r\n\r\nDescribe yourself: Outtasight\r\n\r\n\r\nHow do you feel about yourself: Misunderstood\r\n\r\n\r\nDescribe where you currently live: Sky Blue Sky\r\n\r\n\r\nThe first thing you think of when you wake up: She's A Jar\r\n\r\n\r\nIf you could go anywhere, where would you go: Impossible Germany\r\n\r\n\r\nYour favorite form of transportation: Passenger Side\r\n\r\n\r\nYour favorite color is: Ashes of American Flags\r\n\r\n\r\nWhat's the weather like: What Light\r\n\r\n\r\nIf your life were a TV show, what would it be called: At Least That's What You Said\r\n\r\n\r\nWhat is life to you: A Shot In The Arm\r\n\r\n\r\nWhat is the best advice you have to give: I'm the Man Who Loves You\r\n\r\n\r\nIf you could change your name, what would it be: Kingpin\r\n\r\n\r\nYour favorite food is: Spiders (Kidsmoke)\r\n\r\n\r\nHow I would like to die: Why Would You Wanna Live\r\n\r\n\r\nMy soul's present condition: On and On and On\r\n\r\n\r\nThe faults I can bear: The Art of Almost\r\n\r\n\r\n--------\r\nTHE KNOCKOFF POEM\r\n\r\n\r\n \r\n\r\n\r\nSomebody posted on Instagram or Facebook -- or was it Twitter?\r\n\r\n\r\n \r\n\r\n\r\nThis picture of a Nerf football.\r\n\r\n\r\nSomething funny was written -- a witticism about the spongy ball being a dog\u2019s delight.\r\n\r\n\r\nBut I was fixed on that foam football,\r\n\r\n\r\nUnlocking a surprising cache of memory.\r\n\r\n\r\n \r\n\r\n\r\nI don\u2019t think my childhood ever saw a real Nerf football.\r\n\r\n\r\nJust a cheaper, if that\u2019s possible, knockoff.\r\n\r\n\r\nThere was a pink plastic football\r\n\r\n\r\nI remember.\r\n\r\n\r\nA knockoff of a knockoff, a buying pattern that runs through my early family experience.\r\n\r\n\r\n \r\n\r\n\r\nFake Rubik\u2019s cubes and triangles,\r\n\r\n\r\nLoose and adorned with failing stickers,\r\n\r\n\r\neventually plocked apart by my too-curious brother.\r\n\r\n\r\n \r\n\r\n\r\nWe didn\u2019t get Pong until Dad \r\n\r\n\r\nhappened by a yard sale.\r\n\r\n\r\nThis was real Atari -- but so many years too late.\r\n\r\n\r\n \r\n\r\n\r\nThe Pong battles burned lines\r\n\r\n\r\nin the screen of our portable black and white TV,\r\n\r\n\r\nanother knockoff,\r\n\r\n\r\nuntil you couldn\u2019t watch any shows \u2013 via a knockoff antenna -- without more imagination than you wanted to exert.\r\n\r\n\r\nMy brother eventually took the TV apart as well.\r\n\r\n\r\n \r\n\r\n\r\nKnockoffs. \r\n\r\n\r\nIt was the age of brand names\r\n\r\n\r\nand we were having none of it \r\n\r\n\r\nin our recession-pocked existence on the farm.\r\n\r\n\r\n \r\n\r\n\r\nThe air was real.\r\n\r\n\r\nThe vegetables.\r\n\r\n\r\nThe fruit.\r\n\r\n\r\nThe eggs.\r\n\r\n\r\nThe barn.\r\n\r\n\r\nAnd the animals,\r\n\r\n\r\nall named,\r\n\r\n\r\nour own branding scheme,\r\n\r\n\r\nI suppose.\r\n\r\n\r\nWe weren\u2019t focus-group savvy about it.\r\n\r\n\r\nMore Captain Obvious.\r\n\r\n\r\nA rust-colored horse called Cinnamon, \r\n\r\n\r\nher gray sister, Pepper,\r\n\r\n\r\nthe jet-black brother Midnight.\r\n\r\n\r\n \r\n\r\n\r\nWe named a cow Hamburger, \r\n\r\n\r\nbringing to mind my brother brightly chirping \r\n\r\n\r\nover the Salisbury steak I hated:\r\n\r\n\r\nWho are we eating tonight?\r\n\r\n\r\n \r\n\r\n\r\nAll of this streaming\r\n\r\n\r\nfrom a photo on my phone.\r\n\r\n\r\n \r\n\r\n\r\nMore than tackle football\r\nduring fifth-grade recess\r\nwith real Nerf football\r\n\r\n\r\n \r\n\r\n\r\nI grimace, but not\r\n\r\n\r\nfrom this trip\r\n\r\n\r\nto a memory\u2019s lane\r\n\r\n\r\nof pre-teen products and uses.\r\n\r\n\r\nI wince with a wont\r\n\r\n\r\nfor a time when I engaged\r\n\r\n\r\nmore wholly in my life.\r\n\r\n\r\nActually.\r\n\r\n\r\nNot virtually\r\n\r\n\r\nor electro-socially.\r\n\r\n\r\nThat pink football was lost\r\n\r\n\r\nin the open cesspool \r\n\r\n\r\nin the front yard,\r\n\r\n\r\na sewage maw in the earth,\r\n\r\n\r\ncovered by boards,\r\n\r\n\r\nsome broken, with gaps forming.\r\n\r\n\r\nAnd there went the ball.\r\n\r\n\r\n \r\n\r\n\r\nThat pit was filled in\r\n\r\n\r\nwhen the new septic came on.\r\n\r\n\r\nIt became second base of our\r\n\r\n\r\nkickball field, marked by a lid \r\n\r\n\r\nfrom a can of knockoff paint.\r\n\r\n\r\n \r\n\r\n\r\nHome was the front steps.\r\n\r\n\r\nFirst was a pine tree,\r\n\r\n\r\nthird a boxelder.\r\n\r\n\r\nNone of which remain today. \r\n\r\n\r\n \r\n\r\n\r\nOnce you hit a certain age, probably 13, \r\n\r\n\r\nyou are constantly told\r\n\r\n\r\nto not look back.\r\n\r\n\r\nForge ahead.\r\n\r\n\r\nDon\u2019t rue.\r\n\r\n\r\nAs if simple acknowledgement\r\n\r\n\r\nof a life lived\r\n\r\n\r\nwas some sign of malignant sorrow, \r\n\r\n\r\nor akin to sucking a finger for too long.\r\n\r\n\r\n \r\n\r\n\r\nShould my memories\r\n\r\n\r\nbe buried under the sluice of time like that pink football?\r\nIt\u2019s all been a setup, of course,\r\n\r\n\r\nto the knockoff lives lived today.\r\n\r\n\r\nUnengaged and not in any moment,\r\n\r\n\r\nlet alone \u201cthe\u201d moment.\r\n\r\n\r\n \r\n\r\n\r\nI\u2019m going to stop feeling bad about my reminiscence.\r\n\r\n\r\nI\u2019ve abstained long enough.\r\n\r\n\r\nI relish this spongy reminder\r\n\r\n\r\nof youthful engagement.\r\n\r\n\r\n \r\n\r\n\r\nPhysical proofs fading,\r\n\r\n\r\nall I have left is memory:\r\n\r\n\r\nprodded by a photo\r\n\r\n\r\nfound on my handheld,\r\n\r\n\r\nsoul-sucking device.\r\n\r\n\r\n \r\n\r\n\r\nA Nerf football.\r\n\r\n\r\nAlso handheld.\r\n\r\n\r\nBut, so unexpectedly,\r\n\r\n\r\nsoul nourishing.",
