    ProfileText: "Wife - James Norris\nSkip to content\nHome\nWritings\nContact\nMain Menu\nBunker Wife\nI\u2019m looking for my \u201c\nbunker\nwife\u201d. (Yes, seriously.)\nI hold a\n75% probability\nthat humanity kills or displaces itself due to AI in the next 1-15 years (2025-2040). If you don\u2019t get this yet, you\u2019re in for an enormously painful surprise soon.\nMy long dating profile is\nhere\n.\n*\nContrary to the above, I\u2019m actually quite fun at parties.\nBut the tl;dr on what I want: a driven hot nerd with a heart of gold.\nMy unique dealbreakers: my wife would be fine with living off-grid at the first sign of a major catastrophe brewing. (Bunker optional.) No kids, I\u2019m afraid. She\u2019d ideally have spent a few years already fighting for humanity in some way, shape or form. Or help me do so now.\nI\u2019ll donate $1,234 to an effective charity of your choice to anyone that introduces me to my future wife. (Or to you if your net assets are <$100k.) We\u2019ll name our first robot kid after you.\n*I like my privacy, so please request access to the GDoc. Kindly don\u2019t share that; instead share this page.\n\u2014\nFor those who also dislike online dating, see\nEffective Online Dating\n.\nOr for those who want to go deep into finding their ideal partner, see\nUpgrade Program Relationships Plan\n.\nAnd for those of you who don\u2019t want to die from AI, see\nCollective Action for Existential Safety\n.\nHome\nWritings\nContact\n\u00a9 2025 James Norris",
