    ProfileText: "\ufeffHello future lover boy, \r\n\r\n\r\nTis I, Libby. Guess you heard, through one of those pesky grapevines, that I am looking for a beau. I am indeed looking for a romantic partner. Let\u2019s keep this short and sweet\u2026here are some things I\u2019m looking for, and things I\u2019ve got to offer (back to dowry times I suppose!): \r\n\r\n\r\nLooking-for list (for your ease and my graphic design pleasure, i\u2019ve made this a tick box list): \r\n\r\n\r\n* Curious (do you think? A lot? Great!) \r\n* Comfortable with one self/brave (how do you feel about strangers? Being on your own? Sharing your emotions? Dancing in front of people?) \r\n* Funny (don\u2019t worry about specifics, if you make your friends laugh you probably satisfy this)\r\n* Principled (having values and sticking to them (roughly))\r\n* Want children long-term, but not in the next ~3 years (all in favour of procreation say I)\r\n\r\n\r\nExtra points if you \r\n* Speak another language \r\n* Enjoy/play team sports \r\n* Have a creative practice/enjoy the arts and have opinions about what you like  \r\n* Wear a helmet when cycling \r\n* Try not to spend too much time on tech/enjoy spending a lot of time outside  \r\n* Thoughtful consumer \r\n\r\n\r\n\r\n\r\nLatest deals offer list, i.e. what I bring to the table: \r\n* Funny (improv comedy level funny)\r\n* Curious/Big thinker (academically in philosophy and linguistics, but enjoyed more widely too) \r\n* Playful \r\n* Creative (art, music, poetry, dance, theatre, you name it!) \r\n* Big de-digitaliser (gamifying low screen time >) \r\n* Community oriented \r\n* Somewhat spiritual, in that I enjoy spiritual adjacent activities like meditation, 5 rhythms, circling/authentic relating, etc \r\n\r\n\r\nNote: I\u2019ve kept this brief, mainly because I\u2019m excited at the prospect of you discovering things about me in real life rather than via a word doc. \r\n\r\n\r\nBoring logistical stuff: \r\n22 years old, final year of undergrad degree at Uni of Ox, intention to stay in Oxford long term (probably) but interested in some periods of being elsewhere/maybe abroad, especially staying somewhere I can practice my french/other languages (german, spanish, open to more!), interested in polyamoury but more recently leaning towards a primary partner in a monogamish partnership. Happy to be swayed by my partner if they have strong desires, but would like to have a conversation customising what our style might look like. \r\n\r\n\r\nHere are some photos of me for your viewing pleasure ;0 \r\n\r\n\r\n\r\n\r\n  \r\n\r\n  \r\n\r\n  \r\n  \r\n  \r\n\r\nBig five scores: \r\n* Openness 98 \r\n* Conscientiousness 71 \r\n* Extraversion 85 (I would estimate this is slightly lower, because I absolutely love time on my own, but also love thoroughly love social contexts with the right people) \r\n* Agreeableness 60 \r\n* Neuroticism 42\r\n\r\n\r\nIf you\u2019re interested, email me at burnerfahrenheit@gmail.com",
