    ProfileText: "\ufeffDaniel Filan\u2019s date-me doc\r\nLast edited 2024-12-09, best viewed on desktop\r\n\r\n\r\n  \r\nHi! I\u2019m Daniel Filan! Here are some basic things about me:\r\n* Man\r\n* 5\u20198\u201d, ~170 lb\r\n* Born March 1994\r\n* Berkeley, CA\r\nI\u2019m looking for\r\n* A woman\r\n* \u2026 to (eventually) be in a committed relationship with\r\n* \u2026 that ideally leads to having kids.\r\nInterested? Email df@danielfilan.com, or reach out some other way (e.g. via twitter). Want to know more? Read on.\r\nWhat I\u2019m like\r\nI work in the field of AI research\u2014specifically, research that aims to reduce the chance that AI takes over the world. At the moment I\u2019m helping run a research internship program and helping manage the interns. I also make a podcast where I interview people in the field about their research.\r\n\r\n\r\nAt the moment, my main hobby is learning Latin. Other present and past hobbies include contra dancing, learning about the history of Christianity, and watching anime. I also try to do intense cardio exercise at least twice a week, and enjoy taking long walks (I recently walked 17 miles diagonally across San Francisco).\r\n\r\n\r\nIf I had to describe my general vibe, I would say that I\u2019m academic-shaped. The thing I am best at is studying, and if I may flatter myself, I think I would make a good 60-year-old whose job was to be generally erudite and warm.\r\nTestimonials\r\nI\u2019m bad at describing myself, so here are some friends\u2019 descriptions of me:\r\n\r\n\r\nAsya Bergal (excerpts below, full testimonial here, bolding original):\r\nDaniel is very (intentionally) funny, at least to me and a lot of people whose sense of humor isn\u2019t too far from mine. IMO the best thing about Daniel is a mixture of being generative, funny, and low-ego that reliably makes me joyful (often laughing) and at   ease when I\u2019m around him. I think he fosters this feeling to a really unusual extent among people I know, and I suspect the optimal long-term partner for Daniel will be someone who really likes that feeling and wants to live in it forever.\r\n* [...] several individuals from different parts of my social network have unpromptedly expressed to me that they find Daniel very good to be around, including one who I think of as extremely judgmental and perceptive.\r\n\r\n\r\nEli Tyre:\r\nDaniel Filan is among the top 10 highest integrity people that I know.\r\n\r\n\r\nQ:\r\nDaniel is interesting to talk to, he knows many things. I usually get a bit anxious around new people but did not feel that way when talking to Daniel - he seems nonjudgmental and is also occasionally funny :p\r\n\r\n\r\nJohn Steidley:\r\nDaniel is a fantastically passionate guy. He\u2019s always interested in some new topic and learning everything about it. He\u2019s funny. He\u2019s cheerful. He\u2019s a delight. It\u2019s extremely rare to find him in a bad mood. \r\n\r\n\r\nDaniel stands up for what he believes in, but also admits his mistakes quickly and completely. He\u2019s terrifically smart.\r\nWhat I\u2019m looking for\r\nAt a high level: intimate, reliable, and comfortable companionship that helps me grow in unexpected ways and can serve as a foundation for the rest of my life. But I think that\u2019s pretty generic. So here are traits someone could have that I think predict I would get on well with them:\r\n* Being analytical\r\n* Being ambitious but also (at least somewhat) pro-social\r\n* Being curious and open-minded\r\n* Favouring bluntness and honesty, while trying to maintain tact\r\nCompatibility\r\nHere are some things about me that will maybe help you predict whether we\u2019re compatible. They are \u201cthings about me that you may or may not want\u201d, not things I\u2019m asking of partners (except for the children + location entries).\r\n* As mentioned above, I think I want kids. I\u2019m not dead set on them, but they seem pretty cool, and in general I\u2019ve observed that my positive affect towards babies and children has grown a lot in the past 5 or so years.\r\n* I live in the SF Bay Area. Moving for a relationship is not totally out of the question, but the bar for doing so is quite high.\r\n* I\u2019m asexual. I enjoy physical contact, but having sex doesn\u2019t feel desirable or attractive to me.\r\n   * I\u2019m open to polyamorous relationship arrangements, but would want to be in a primary/committed role.\r\n* I\u2019m vegan, and disapprove of the consumption of meat, eggs, and dairy. I\u2019m OK with being close with people who aren\u2019t vegan, but I could imagine tension about how to raise any children, or if you think that non-human animal welfare obviously doesn\u2019t matter.\r\n* I don\u2019t really drink alcohol or take other recreational intoxicants (which is to say: I do such things less than once a month, but not never).\r\n* I am very politically libertarian.\r\n* I\u2019m active in the LessWrong and Effective Altruism communities, altho I would say I\u2019m more of a LessWronger than an Effective Altruist.\r\n* I sneeze extremely loudly\u2014loud enough that I have one friend who is genuinely seriously bothered by it (but not so loud that I have more than one such friend (well, as far as I know)).\r\n   * If you don\u2019t have misophonia, I think this will probably not be a deal-breaker.\r\n* I don\u2019t believe in God. I\u2019m interested in the phenomenon of religion, but don\u2019t recommend practicing it.\r\n I am normal and can be trusted with babies.   More photos of me\r\n  ________________\r\n\u2018Fun\u2019 facts about me\r\n* I grew up in Australia. My accent is predominantly general American, but retains a few Australian characteristics (e.g. the way I say \u201cno\u201d).\r\n* The caption on the previous page, while funny, is literally true: I am extremely bad at purposely smiling in photos.\r\n* I can, in my head, approximately calculate the factorials of large numbers, but it takes me an unimpressive amount of time.\r\n   * You can too by memorizing Stirling\u2019s approximation and a few base-ten logarithms.\r\n* I wrote the sentence that Wiktionary uses to illustrate the use of the word \u201cscrutable\u201d.\r\n* I came up with what I believe is the worst unparalleled misalignment yet found\u2014specifically, it was used by the creator of the art form as an example of the epitome of un-funniness and torturedness.\r\n   * It\u2019s Los Angeles // newspaper comics.\r\n* The reason I got around to actually writing this date me doc is that I told someone I would pay them $200 if I didn\u2019t publish one by a certain date. The reason I did that is that I told the same person I would pay them $100 if, by a certain date, I didn\u2019t arrange to make a deal to pay them >$100 if I didn\u2019t publish a date-me doc by a     certain date.",
