    ProfileText: "\ufeffDate me[1] \ud83e\udd9d\r\n\r\n\r\nVersi\u00f3n en espa\u00f1ol\r\n\r\n\r\n\r\n\r\nQuick details & trivia\r\nAge: 34\r\nLocation: Barcelona, Spain\r\nLooking for: a relationship based on mutual compatibility and connection (with man or woman)\r\nPersonality type (Myers-Briggs): INFP-T\r\nZodiac sign: Virgo\r\nFavorite dish: chicken curry\r\nFavorite movie: Pocahontas\r\nFavorite series: Sense8 & Game of Thrones\r\nBest thing about me: I have empathy and care about others\r\nWorst thing about me: I am always hesitant and scared of making mistakes so I end up not doing many things that I\u2019d like to do\r\n\r\nAbout me\r\nHello, (whoever is reading this)!\ud83d\udc4b I am an introverted and shy girl trying to meet new people over here. I generally have a hard time starting off conversations, but I can be friendly and nice once I manage to get over the initial awkwardness. I appreciate quality time spent together, deep conversations and shared laughter, especially if they are over a cup of tea or good food. \r\nI decided to create this file because the idea of Date Me Docs seemed old-schoolish in a cute, nerdy way (in other words, quite appealing, especially in contrast to the shallowness of dating apps). Why not? Maybe the right person for me might be out there reading this doc right now. \r\nHere are some random facts you may want to know about me:\r\n* I am a bit childish: I use colorful fineliners when I write in hand and add many emojis when I type; and I like doing stuff like watching animated movies, singing karaoke and wearing costumes on Carnival \ud83e\udd2a\r\n* I am in the autism spectrum (feel free to ask if you want to know more).\r\n* I have a driving license but it\u2019s been years since I last drove a car.\r\n* I struggle with time management, but I hate it when someone is late.\r\n* I have moved 5 times over the last 6-7 years.\r\n* I can say \u201cI love you\u201d in 18 different languages \ud83d\ude0f\r\n* I LOVE eating ramen and sushi (in case you don\u2019t have any date ideas\u2026 \ud83e\udd2d)\r\n\r\n\r\nWhy no picture?\r\nTwo words: privacy concerns. I do not feel very keen on the idea of my picture being available online for anyone to see. However, I will be happy to share my picture with you privately if you reach me out. For now, I can broadly say that I am Caucasian, a brunette, small-sized (short and thin) and that I wear glasses. So I would look something (very approximately) like this avatar:\r\n  \r\n\r\n\r\n\r\nMy hobbies\r\n* Books. I love reading and immersing myself in a good story. I wouldn\u2019t say that I stick to a particular genre, but I like historical fiction and fantasy most of all. Just let me know if you want any recommendations \ud83d\ude09\r\n* Languages. Apart from English, I can speak Catalan, Spanish and Russian. Now I am learning Turkish too and I also have some basic knowledge of Hindi and Italian. So if you speak any of these languages, we might as well have a language exchange \ud83d\ude09\r\n* Movies. Yes, I know, that\u2019s typical, but who doesn\u2019t love lying on the sofa with a blanket and watching a good (or not so good) movie? Btw, Disney/Pixar movies are among my favorites \ud83d\ude0a\r\n* Going to the theater, museums\u2026 anything cultural.\r\n*  Writing. I am not going to share my texts with anyone for now, but I can say I am working on a historical-romantic novel that might (or might not) be completed some day.\r\n* Traveling. Yes, I know this is controversial and I myself have some mixed feelings about this one because of how everything nowadays seems to revolve around taking selfies and posting how cool you are on Instagram. However, I still like to explore different places and cultures, and it would be great if we could have that passion in common. Some countries on my bucket list: Laos, Cambodia, Morocco, Iceland, Nepal, Sri Lanka, Peru, Bolivia, Uzbekistan \ud83d\ude0f\r\n\r\n\r\nWhat I\u2019m looking for\r\nEssentially, I\u2019m looking for someone I can have a mid-to-long-term, caring and nurturing relationship with. I am not interested in long-distance, open or polyamorous relationships (yup, I am a traditional girl), so we might not be well-suited for each other if you don\u2019t live close to Barcelona or are looking for that kind of thing.\r\nWhat I ask for in a partner:\r\n\r\n1. You must be an honest, humble and wholesome person. Yes, that is a strict must, but I think it\u2019s the bare minimum you can ask from a human being.\r\n2. Having an open mind. While I have my own political views and values, and it would be great if we align on those, we will not always agree on everything, and that is perfectly fine as long as we respect each other\u2019s views. Of course, I draw the line at homophobia, racism, fascism and any sort of bigotry or discrimination.\r\n3. Being independent. And by that I mean that both you and I can make plans on our own (we do not have to always do everything together) and that you are able to make your own decisions and have your own thoughts besides what your friends, parents, etc. might tell you. Oh, and being able to do basic tasks like doing laundry, washing dishes or making a simple meal.\r\n4. Having some sort of intellectual curiosity. I am generally a quiet person, but I do like to talk about things I\u2019m interested in and to have deep conversations about life, society, geopolitics, psychology, etc. And if you have a particular hobby or interest or enjoy a specific activity, please do share it with me! I love learning new things \ud83d\ude0a\r\n\r\n\r\nWhat I value in a relationship\r\nI strongly believe that you need to be (best) friends with the person you\u2019re dating. While attraction is a necessary ingredient in a relationship, especially at the beginning, I would never consider dating someone I don\u2019t trust or someone who is not genuinely interested in hearing how my day went. So\u2026 let\u2019s build that trust and that connection together, shall we?\r\nIf you feel like talking to me, you can drop me a line either on my email, Facebook or Telegram.\r\n________________\r\n[1] Only if you want, of course!",
