    ProfileText: "\ufeff* Cis female, 5\u20198\u201d, 37, living in Oakland, California, looking to date men or fairly masculine non-binary people. Most likely ambiamorous. I would equally love a life with kids or without kids. I never could have biokids, so there\u2019s no rush. I prefer surrogacy over adopting from foster care. I\u2019m an electronics engineering student. I\u2019m passionate about earning to give, and hope to work on projects that make the world a better place. \r\n* I want to learn everything about everything from everyone. My biggest goal when I go to a party is to change my mind about something important, and people often say I\u2019m unusually good at it, even for a rationalist/EA. The Effective Altruism movement means many different things to different EAs, but the most important thing it means to me is open-mindedness. I feel possibly my most alive when I\u2019m having a conversation with someone whose beliefs I find deeply harmful, about those beliefs. Their wisdom illuminates so many flaws in my reasoning that I miss when I stay in my bubble. I have a preference for dating people so different from me that most people would consider these attributes dealbreakers, because it allows me to experience moments of adventure like this that I so cherish. I\u2019ve happily made huge sacrifices to live a life on the frontiers of human understanding. I\u2019m looking for someone who also loves learning with all their heart.\r\n* I spend a lot of my free time studying social science through a rationalist/EA lens, and  am looking for someone to geek out with about it. I do things like multiply my vote by maybe an order of magnitude by developing expertise in down-ballot elections, and get so excited about theories of malthusian economics and the evolution of morality that I start writing a novel to explore it. \r\n* I adore tabletop RPGs, where I particularly enjoy coming up with creative solutions to problems, practicing the art of writing, and watching my friend\u2019s personalities shine. \r\n* I often attend authentic relating events; I would be especially thrilled to date someone else who sees each individual human being\u2019s uniqueness as one of the most beautiful mysteries of the universe, and can\u2019t wait to meet each other at the heart of that enigma.\r\n* I\u2019m very agentic; Through persistent hard work, I overcame tremendous disadvantages, vaulting from the American underclass to the upper class. I think there is a good probability my difficult life for someone in our community was worth it because it made me more compassionate, tough, grateful, open-minded, and insightful than I otherwise would have been.\r\n* I\u2019m a lovely intense synthesis of cold culture and deeply caring about people\u2019s wellbeing, both near to me and far away.\r\n* I am quite into BDSM, and am looking for someone who enjoys being sexually dominant.\r\n  \r\n\r\nSome things that sound like a great date to me:\r\n* We attend a meeting together of a community that has very different values from us (Conservative religious? Neo-Nazi? Communist?) and process it afterwards over a cheap meal, ultimately discovering a new truth about humanity.\r\n* We circle together, and discover fundamental parts of each other that we didn\u2019t even know ourselves well enough to name.\r\n* We take a walk where we come alive talking about moments of intense beauty we are witnessing. Sewers saving lives? Plump produce in a grocery store out of an ancestor\u2019s vision of heaven? Oncoming traffic lights shining like stars?\r\n* We find the things we disagree most strongly on and work to overcome our human frailty together until we each realize we are wrong in some way about one of our most deeply held beliefs.\r\n* More civilized dates are also wonderful! I\u2019m a big fan of dinner dates; I love adventure, and what could be more adventurous than a couple weirdos going wherever their curiosity takes them?\r\n  \r\n\r\nI have a deep passion for self-improvement. In addition to traditional rationalist techniques like reading about research on cognitive biases, I often do this through my Christianity. This is the kind of Christian I am: I believe God doesn\u2019t care whether people are Christian or not, love dating non-Christians, and would be happy to raise my child(ren) non-Christian if it was important to my partner. My church is majority queer, I am unusually sex-forward even among rationalists, and otherwise violate all the common stereotypes I have encountered in our community about Christians. I\u2019m Christian because these practices have proven more effective for me for becoming a better rationalist than the methods that work better for others. I want to eliminate every part of me that isn\u2019t maximally truth seeking and replace it with that which is. I utilize the tools that maximize my efficiency in this endeavor. I\u2019m looking for someone just as passionate about becoming a more moral version of themselves. \r\n  \r\n\r\nWhat people close to me think:\r\n\u201cSonia is a rare outlier in openness, both to new ideas and experiences. To me she\u2019s tagged as both brave and thoughtful, and self-aware enough to hold onto her boundaries. Lots of charity and empathy along with high decoupling ability\u201d - Damon\r\n\u201cSonia is steadfastly positive, uplifting, and always sees the bright side of things when others might complain. She can have a conversation with seemingly anyone and have a great time.\u201d       - Dmitriy\r\n\"I've found Sonia to be really thoughtful and kind. She seems to think deeply about issues and has a bunch of really original takes. She's also been very consistent about prioritizing global welfare.\" -Ozzie\r\n  \r\n\r\n  \r\n\r\nIf I interest you, please contact me at salbrecht314@gmail.com",
