    ProfileText: "\ufeffRelationship Goals\r\nContact Info\r\nMore About Me  \r\n  \r\n________________\r\n  \r\n  \r\n  \r\n\r\n\r\n\r\nRelationship Goals\r\nI\u2019m Wiggles!, a curious adventurous outdoorsy energetic enthusiastic 37-year-old straight cis Bay Area woman who\u2019s seeking a lifelong, child-free, monogam-ISH partnership[1] with a man who\u2019s committed to growing, learning, laughing, exploring, and doing some good in the world together.\r\n\r\n\r\n  \r\n\r\nThis is the only type of kid I want\r\n\r\n\r\nLet\u2019s co-create a union wherein we mutually challenge each other\u2019s minds, see into each other\u2019s souls, and worship at the altar of one another\u2019s body. A connection wherein both parties are committed to growth and practicing the art of love on a daily basis.\r\n\r\n\r\nI have periodically taken career breaks to globe-trot and spend time in awe-inspiring natural landscapes; and would love to continue to do so with my mate. This would require that you be in a similarly financially stable position as me.\r\n\r\n\r\nIf you give my brain a boner, the rest of my body can follow. Hit me up if you wanna skip the small talk[2] in favor of meaningful conversations on the trail, at the beach, or in bed.\r\n\r\n\r\nYour character matters to me. Your height genuinely doesn\u2019t.\r\n\r\n\r\nContact Me\r\nIf you\u2019re thinking to yourself, \u201cI bet the most direct way to get into her pants is by filling out a form,\u201d then you\u2019re damn right.\r\n\r\n\r\nI could probably beat you at\r\nPun competitions\r\n  \r\n\r\n\r\n\r\n6 things I could never do without\r\n1. Snuggles! Preferably with humans and doggos, but a highly affectionate cat will do in a pinch \ud83d\ude42\r\n\r\n\r\n  \r\n \r\nIf I were a cephalopod, I'd be a cuddle-fish.\r\n\r\n\r\n2. Feeling wonderment and smallness in gorgeous natural settings.\r\n\r\n\r\n3. Vegan meals. A way to my heart and other parts is through my belly. (You don\u2019t necessarily have to be vegan yourself, though.)\r\n\r\n\r\n4. Laughing so hard it starts to hurt, and inducing said laughter in others.\r\n\r\n\r\n  \r\n\r\nMy underground improv performance at BART Basel\r\n\r\n\r\n5. The pursuit of self-improvement.\r\n\r\n\r\n6. The type of intimate connection wherein one feels fully seen, valued, appreciated, held, and empowered to become the best version of themselves.\r\n\r\n\r\nThe first thing people notice about me\r\nI\u2019m a total nerd. And a total dork. And totally love it.\r\n  \r\n\r\nYou can call me Babe-raham Lincoln\r\n\r\n\r\nA day in our life\r\nNote: While this is cribbed from my days right now, I'm very much interested in collaborating with my partner, and would love your input on what you'd like our life together to look like.\r\n\r\n\r\nWaking up to you caressing my body. Time and space seem to disappear as our bodies entwine; there\u2019s only us; our souls dancing together in the ether.\r\n\r\n\r\nWe have an ongoing competition between us of who can make the other laugh harder. I thought I'd already defeated you before we even started making breakfast, but by the end of the meal we\u2019re clearly tied.\r\n\r\n\r\nHopping in the car to hit the trailhead. You start playing a lecture from one of The Great Courses, and I periodically pause the recording to discuss what we\u2019re learning together.\r\n\r\n\r\nMeeting up with our friends for a hike through a beautiful location. You\u2019ve brought gloves for everyone so we can pick up litter we spot along the trail. We take goofy pictures. The group conversations alternate between being silly/funny and profound/vulnerable/informative.\r\n\r\n\r\n  \r\n\r\n\r\n\r\nJoining our friends for an epic post-hike meal. Food always tastes better when shared and after your body has worked for it!\r\n\r\n\r\nHeading home for a quick rinse/make out session in the shower before we split up to do our own thing for the evening.\r\n\r\n\r\nI eventually head back into our bedroom for my nightly wind-down ritual of putting my phone to bed, silently reading, writing in my journal, meditating, brushing my teeth, and changing into cozy pajamas.\r\n\r\n\r\nEventually you wrap up whatever cool thing you were doing and crawl into bed as well, and we snuggle while exchanging gratitudes and setting intentions for the next day. As we drift off to sleep our limbs are once again interdigitated, and the world feels like a calm and serene and lovely place.\r\n\r\n\r\n________________\r\n[1] I could also be open to a polyamorous lifestyle, but am not looking to date poly men who already have primary partners.\r\n\r\n\r\n[2] Let's instead talk about: relationship goals, commitments, how to better the world, passions, philosophies, lies we\u2019ve told, science, psychology, the quantified self, enlightenment, paradoxes, projects we could work on together, embarrassing stories, epiphanies, bucket list items, lessons learned from previous relationships and other experiences, patriarchy, your personal definition of \"god\", economics, culture, why you're optimistic about the future, hermeneutics, animal intelligence, history, escaping the rat race, traditions, the most impactful book you've ever read, role models, habits, the awe of the cosmos, the awe of humanity\u2019s place within the cosmos, rituals, friendships, altered states, sexuality, what makes you want to jump out of bed in the morning and take on the day, consciousness, social cohesion, anything in my profile, anything in your profile, and whatever else fascinates us.",
