    ProfileText: "Carson McNeil\nCarson McNeil\nNeuroscience, Machine Vision, and Mysticism\nAbout\nScience\nCreative Content\nContact\nTwitter\nSubstack\nYouTube\nGithub\nLinkedIn\nWelcome\nI also officiate weddings.\nCV/Resume\nLinkedIn\nSubstack\nCarson McNeil is a Neuroscientist, Data Scientist, Consultant, and Researcher specializing in medical imaging, neuroscience, and machine learning applications. With a background in both computational neuroscience and software engineering, Carson has planned and executed on high-impact projects at Verily Life Sciences, Google, and the University of California, Berkeley. His work bridges cutting-edge machine vision and deep learning techniques with practical applications in health, such as the development of generative models for digital pathology. Carson's work has spanned basic research in the cognitive neuroscience of human vision, the neuroscience of Buddhist meditative states, and many practical applications of machine learning to diagnostic healthcare problems. His research is driven by a desire to improve human health, happiness, and flourishing, whether mental or physical. He believes in driving forward practical technologies while sharing and publishing relevant scientific findings with the world.\nCarson has a long-running interest in Mysticism, and believes that there \n    is not such a difference between the tools we think of as \"therapeutic\",\n    and millenia-old mystical traditions such as Buddhism and Daoism. A culture,\n    such as ours, which is overly materialistic and has lost touch with the subjective,\n    the natural, and the ritualistic, is at risk of collapsing under its own weight.\n    Carson hopes that his teaching, writing, and research will help bridge this divide,\n    and make esoteric mysticism more legible to the rationally-minded scientist.\nWe rarely hear the inner music, but we are all dancing to it nonetheless.\n- Rumi\nPlease do reach out if you are interested in research collaboration, coaching, or consultation!\nResearch and Teaching\nI have two Neuroscience degrees (Caltech BA 2013, UC Berkeley Masters 2019). I have also worked as a\n        researcher and Data Scientist at Google Machine Intelligence, YouTube, and Verily Life Sciences. My research interests span medical imaging, neuroscience, machine intelligence, and Dharma science.\nGoogle Scholar profile\nLinkedIn profile\nResearch Tools\nAutofluorescence Microscopy\nWhile at Verily, I worked on the\nVirtual Stainer\nproject. We used generative learning to predict histological stains from autofluorescence scans of unstained tissue. See\n(McNeil et al., 2024)\n, in Modern Pathology, and other publications.\nMedical Image Embedding\nI worked on a project to use Masked-Siamese Networks to embed colonscopy videos in a semi-supervised way. See\n(Shor, McNeil et al., 2024)\nFunctional Neuroanatomy\nWhile at Berkeley, I was in the\nGallant Lab\nwithin the Berkeley Artificial Intelligence Research org, working on fMRI research projects to model the human visual system.\nHuman Emotion\nWhile at Google Machine Intelligence, I kicked off a collaboration between Google and Berkeley to study emotion in human faces using DNNs. 5 years later, this collaboration produced\n(Cowen et al. 2021)\nin Nature. I have an ongoing interest in emotion and mental health.\nDrugs and the Brain\nWhile at Berkeley, I taught the course\nDrugs and the Brain\nunder\nProf. David Presti\n. At Caltech, I taught a class of the same name under\nProf. Henry Lester\n. Psychedelics, as a therepeutic, spiritual, and investigative tool remain of interest to me.\nCreative Content\nScienctific work is creative work. But I have also produced a lot of more casual content.\nSubstack Essays\nMedium Essays (will move to Substack)\nYouTube Channel\nYouTube Lectures\nI have several long-form talks on psycho-spiritual frameworks on my\nYouTube Channel\n. These were given at a private event, and due to popular acclaim, I posted them online. Perhaps more on this theme will follow.\nEssays\nI write essays sometimes, which I post to my\nSubstack\n. The topics range between philosophy, poetic, light research projects, and psychology. For example:\nPolyamory doesn't Liberate; Monogamy doesn't Protect by Carson\nReflections and community quotes from a decade in the Bay Area dating landscape.\nRead on Substack\nWedding Ritual Design for a Pluralistic Society by Carson\nA recollection of, and guide to, hand-crafting a syncretic, modern, and personal wedding ceremony.\nRead on Substack\nFlirtations with Death by Carson\nNecro-posting an old note from my Medium with some extra explication on the macabre.\nRead on Substack\nADHD: Steroids, The Gym, and The Game  by Carson\nThe Game is changing, and this is twice as true on college campuses, where the amphetamine black market is booming \u2026 Given my own experience and that of friends, I was surprised to see the positive effects [of meditation] were so mild, until I saw the meditation protocols. \u2026 Would you go to the gym for 5 minutes a day and expect any sort of change?\nRead on Substack\nContact\nThis contact form will send to a tagged place in my email, where I am likely to see and respond to it.\n- Subject -\nResearch Collaboration\nConsulting\nCoaching\nOther\nSend Message\n\u00a9 Carson McNeil.\nThis site is protected by reCAPTCHA and the Google\nPrivacy Policy\nand\nTerms of Service\napply.",
