    ProfileText: "\ufeffTl;dr: Pan ENTP woman looking for people to nerd and build deep bonds with. \r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n                                                                                           Date me?\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nFirst of all, thank god that this site exists. You all seem like lovely people! Also, your docs put mine to shame\u2026 consider this a work in progress. \r\n\r\n\r\nA heads up: I\u2019m currently quite busy and socially (over)saturated. If I was to invest time into building a relationship with someone (especially online), it would be with the hope of developing a deep poly relationship.\r\n\t\r\n\r\nWho am I? \r\nAge: 22\r\nGender: Female\r\nLocation: Oslo, Norway\r\nMonogamy?: God no\r\nWant kids?: Probably not. Not in the near future at least.\r\nLooking for: Women, NB folks, men, anyone in between or outside or whatever\r\nWhat\u2019s important for me?\r\n* EA - I want to use my life to make the world better. Duh.\r\n* Nerding\r\n   * Philosophy, science, maths (eg cognitive science, epistemology, meta-ethics, AI, etc). I consider myself a philosopher at core, but kind of a \u201cnatural philosopher\u201d, Sean Carroll-style\r\n   * Some books that have had an effect on me. No attempt at completeness:\r\n      * Reasons and Persons (I\u2019ve actually read it, I promise! Should\u2019ve skipped the first half though): Very clever about personal identity. I don\u2019t think you have one of those!\r\n      * Chalmers\u2019 The Conscious Mind: If you don\u2019t believe in the hard problem - or worse, think that consciousness is an illusion - I am sitting at the edge of my seat to debate you.\r\n      * Josh Green\u2019s Moral Tribes: I\u2019m very much of a valence utilitarian. I\u2019ll gesture towards this book while explaining away any conflicting intutitions you might have with moral psychology.\r\n      * Dawkins blew my mind as a kid. Memes!!\r\n      * It\u2019s not a book, but I adore Scott Alexander\u2019s writing. Who doesn\u2019t though?\r\n* Other people! I love sharing my life with others. It gives me energy, gives colour to my life and helps me grow. \r\n   * I\u2019m really deeply interested in other people\u2019s inner worlds. It's been this way ever since I realised as a kid that other people have inner worlds, and I don't have direct access to them. You could say it's one of my special interests. I want to understand how it feels to be like you! Shifts in my own internal landscape have made me realise (and really internalise) the mind-boggling diversity in people\u2019s internal experience. And I probably haven\u2019t seen half of it yet! This is one of the biggest reasons I\u2019m looking for more people to love - I want to know people deeply, and be known deeply.\r\n   * Not to brag, but I\u2019m very empathetic. Perhaps to a fault. You can see how it would lead to this interest, right? And then it feeds back in a never ending connection-feedback-loop\u2026\r\n   * One of my big life projects is to build a community. Maybe you can become part of that?\r\n* Sounds a bit vague, but\u2026 Growing as a person? I feel like I\u2019ve lived many lives already. Started out in a small Hungarian town, working class family, difficult upbringing. Did well at school, moved out of the country alone. Building a life in Oslo now, studying maths, leading my local EA uni group and finding people to love. I\u2019m used to a pretty high insight/year ratio. If I feel stagnant I get restless. \r\n* People have told me I am \r\n   * very mature\r\n   * make them feel comfortable\r\n* Singing, dancing (I\u2019m not super coordinated but still enjoy it very much). I loove me a good psytrance rave every once in a while.\r\n* I\u2019ve found myself quite spiritual (and also somewhat of a psychonaut). Meditation and the rest. But can they factor the number? \r\n* Spending time in nature. Ghawd isn\u2019t it regulating! Sometimes I unironically hug trees. It just feels nice.\r\nDownsides of dating me\r\n* I\u2019m prone to anxiety and overcommitting. Both of those have become a lot better over my adult life, but I\u2019m still working on it. Is it just me or is uni actually way too much work?\r\n* Not vegan for complicated personal reasons I\u2019m happy to explain.\r\n* Although an intellectual spark is very important for me, I\u2019ve had an emotionally taxing few months, and not at my intellectual peak at the moment. What I need first and foremost is an emotional connection with a high level of intellectual compatibiltiy.\r\n* Currently I\u2019m located in Oslo. Statistically I would guess you aren\u2019t. I\u2019m not averse to moving eventually and can even travel a bit, but my budget is at the 22yo-student-working-class-moved-countries-by-herself level, so realistically we would have to get to know each other online. \r\nWhat am I looking for?\r\nNon-negotioable:\r\n* Friends, romace, anything in between or outside. We\u2019ll figure it out:)\r\n* Good communication is a must - I don\u2019t expect you to be perfect, but I can\u2019t be pulling the wagon all by myself. Had enough of those relationships already. Expect regular check-ins about how our relationship is going and how we would like to form it.\r\n* Polyamory. No hierarcy.\r\n* Intellectual connection. Playing around with ideas.\r\n* No kids for the next few years. 80% sure I\u2019ll never want any. (I don\u2019t mind if you have kids though!)\r\n* I don\u2019t care about your age. If you think you\u2019re too old for me, you probably aren\u2019t.\r\nPreferable:\r\n* I am very touchy-feely. Physical initmacy makes me happy, and it\u2019s a great way for me to build attachment. Cuddles, hugs, kisses, holding hands - if you\u2019re not a fan we\u2019re probably not a great match.\r\n* Softness and gentleness. Sensitivity and empathy.\r\n* Located near-ish Oslo so we can actually meet! \r\n* Ultimately I\u2019m looking for something long-term, living together or close to each other. I\u2019m in no rush though, and can imagine many other mutually enriching setups.\r\n\r\n\r\nNo-nos\r\n* Monogamy.\r\n* People who are a bit too type-A. I\u2019m not against ambition, I have plenty of it myself. But I want to get to know well-rounded people, with hobbies, experience in navigating interpersonal relationships, etc.\r\n\r\n\r\nContact me:\r\nWrite an email to 2002anna.anna2002[at]gmail.com. Write \u201cDateMe\u201d in the title. Send your own doc if you have one:)\r\n\r\n\r\nYes, I\u2019m looking for someone to date, but if you just find me interesting as a friend and not as anything romantic I\u2019m still happy if you reach out. Especially if you have experience with polyamory! Please do reach out, I would really appreciate some poly wisdom in my life.",
