    ProfileText: "\ufeffPip Moss - Date Me Doc\r\n* Age: 34\r\n* Height: 5\u20196\u201d\r\n* Occupation: Solicitor \r\n* Location: London, UK.\r\n* Looking for: Women, ideally long term relationship but open to starting and seeing where we get to. Not fussed on mechanics of relationship.\r\n\r\n\r\n* Top priorities:\r\n\r\n\r\n   * Significant Overlap of Values. We don\u2019t have to agree on everything but I want to be able to wake up and spend a bit of every day helping you achieve your goals and feel good about that.\r\n\r\n\r\n   * Intellectual Curiosity. I like knowing things, from trivia to social research, and I like people telling me things. I\u2019ll enjoy learning new things for the rest of my life and it would probably be good if you did too because I\u2019ll want to talk about them.\r\n\r\n\r\n   * General Zest for Life: I like my calendar being fairly full of things to do, be they attending talks or trying a new type of exercise. I have main hobbies but am always up for trying something new. I\u2019d really value someone pushing me in new directions.\r\n\r\n\r\n   * Clear Communication. I\u2019m a direct communicator and can only really be like that. I work hard to be direct, not abrasive, but I\u2019m not great at reading between the lines. I\u2019m very honest (but not tactless) and take honesty fairly seriously, which friends and family mostly really like.\r\n\r\n\r\n   * Independence. I want a partner, and a partnership, rather than someone to completely merge lives with until we are practically one person. I want to do lots of things with you but wouldn\u2019t expect you to curtail having a life and projects outside of \u2018Us\u2019 and I\u2019d want that balance for myself too.\r\n\t  \r\n\r\n\r\n\r\n* Non-Negotiables:\r\n   * I don\u2019t want kids.\r\n\r\n\r\n   * I can\u2019t bear the smell of tobacco. Am not much better with cannabis though if you never smoked where we lived I could maybe manage.\r\n\r\n\r\n* Slightly Negotiables:\r\n   * I\u2019m a pretty committed urbanite. I\u2019ve lived in London and Manchester, and might live in other cities in the future but really value living centrally and the lifestyle that allows.\r\n\r\n\r\n   * I\u2019m not religious or a believer in the supernatural, and while I don\u2019t mind if you are I am unlikely to ever buy-in and share that beyond joining festivals to be supportive/share experiences.\r\n\t* My Main Hobbies: \r\n\r\n\r\n   * Bouldering, Running, Obstacle Course Running. Two years ago I tried bouldering and I\u2019ve fallen into a fitness lifestyle since then. I climb twice a week, run a similar amount, and am working towards the London Marathon in 2026. Allez!\r\n\r\n\r\n   * Cooking. I cook from scratch almost everything I eat and like expanding my repertoire. Currently trying different mapo tofu and seitan recipes as I become \u2018Pesc-an\u2019 (Vegan, plus fish). Got a great vegan brownie recipe. Love cooking for friends and family, and would love to cook for a partner.\r\n\r\n\r\n   * Cat lover. Currently sharing my house (as well as a lodger) with my cat Serral.\r\n\r\n\r\n   * Random research online. From perusing Wikipedia (then double-checking it) to reading government reports, I like knowing more about the world. I\u2019m the kind of person who will fact check myself online. I try to live an evidence-based life and want a data-driven world.\r\n\r\n\r\n   * Visiting Museums/Galleries/Places of Interest/Classical Music Performances. No particular theme as to where, I just like seeing friends at somewhere more interesting than a coffee shop if we can. What else is life in London for? Most recent trip: Freemasons Hall. Beautiful but left me with more questions than answers!\r\n   *    * Political Gambling. I\u2019ve been betting on elections since I was 20, with a good record. I sometimes write about it. But I\u2019m an obsessive, not an addict. I even have the spreadsheets to prove it\u2026\r\n\r\n\r\n   * Board Games. Also another great way to spend time with friends. I\u2019m not hyper-competitive but do tend to do a bit of pre-research and want to give a good account of myself. OK maybe I am competitive, but I\u2019m a pretty good loser.\r\n\t* Values/Personality (This is not a checklist of things you have to be):\r\n\r\n\r\n   * I value agency and intentionality, in myself and others. I fear too many people too much of the time make decisions passively, by default or the path of least resistance. I want to live deliberately. I get frustrated by adults not taking accountability for their lives and I want to be held accountable for mine.\r\n\r\n\r\n   * Introverted but outgoing in a comfortable environment. I like a busy social life, just not so open to events with heavy drinking or loud music.\r\n\r\n\r\n   * Organised. I believe in systems. I meal plan, I track my freezer contents in Excel, I check my net worth quarterly, I often instigate and co-ordinate social plans in my friendship groups. I even have a spreadsheet for when I last saw each of my friends so I don\u2019t forget someone for too long (the name turns red after 90 days). They laughed, but then half of them asked me for the template.\r\n\r\n\r\n   * High Decoupler. I don\u2019t take disagreement personally and am happy to discuss almost anything in a dispassionate way. I try to be sensitive to other people\u2019s discomfort, but I\u2019m rarely unwilling to answer a personal question or consider an idea.\r\n\r\n\r\n   * Environmentalist. I cycle most journeys if I\u2019m not on the Tube and I don\u2019t fly for leisure at the moment (though I\u2019d be open to, especially if I found some effective offsets). I\u2019m also a YIMBY and a New Urbanist. Don\u2019t own a car, but can drive and would get one if it made sense for my life.\r\n\r\n\r\n   * Effective Altruist. By which I mean I donate 8% of my income (and growing) to effective charities and generally buy-in to the concept.\r\n\tSome more photos of me:  \r\n\r\n\r\n\r\n\r\n\r\n\r\nMaking the most of the period Serral was light enough to hold up on one arm. I actually have a shirtless version of this from another day but that felt tacky to share unprompted.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nPost-Parkrun photo with two friends who got me into running and whom I owe many thanks for that and much besides.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nIt turns out there is such a thing as vegan clotted cream. And it\u2019s good!",
