    ProfileText: "\ufeffDate Vanessa \ud83d\udc9d\r\n  \r\n\r\nBasics\r\n* \u2640\ufe0f\ud83c\udff3\ufe0f\u200d\u26a7\ufe0fTransgender woman (post-op)\r\n* \ud83c\udff3\ufe0f\u200d\ud83c\udf08Bisexual\r\n* \u267e\ufe0fPolyamorous (married)\r\n* \ud83c\udfb8Born 1983\r\n* \ud83c\uddee\ud83c\uddf1 Lives in Ramat Gan, Israel\r\n* \ud83c\uddfa\ud83c\uddf2 \ud83c\uddec\ud83c\udde7 Visits the San Francisco Bay Area and the UK around 2 times a year each\r\n* \u2195\ufe0f180cm tall\r\n* \ud83d\udd24Speaks English, Hebrew and Russian.\r\n* Reach out at highpriestessofelua@gmail.com\r\nAbout Me\r\n\ud83e\udd16I\u2019m an AI alignment researcher. In a nutshell, I\u2019m trying to invent math that would enable methods of designing artificial intelligence systems which are much more responsible than how it\u2019s done today. And, it\u2019s very important to me: not just a job, but a life calling.\r\n\r\n\r\n\u269b\ufe0fAs you might have guessed from the above, I\u2019m a huge nerd. Math, computer science and physics are areas in which I have professional knowledge. I also know a little about history and analytic philosophy, and enjoy nerding out about virtually any intellectual topic.\r\n\r\n\r\n\ud83c\udf0dSome properties of my world-view: I\u2019m an atheist, transhumanist, vegan. Politically I\u2019m a centrish liberal (I strongly support personal freedoms and democracy guardrails, dislike collectivism and traditionalism).\r\n\r\n\r\nThings I enjoy in my free time:\r\n* \ud83d\udcda Reading, mostly scifi and fantasy, with a special soft spot for romance novels \ud83d\udc98. Favorite writers include Naomi Novik, Kate Elliot, Lois McMaster Bujold, Brandon Sanderson, Greg Egan and Sharon Shinn.\r\n* \ud83c\udfb2 Playing board games, even though I\u2019m a sore loser.\r\n* \ud83e\uddd9\u200d\u2640\ufe0f Tabletop RPG, although I never manage to find a group that sticks together for long.\r\n* \ud83d\uddbc\ufe0f Art galleries, both classic and modern.\r\n* \ud83c\udfad Theatre. I haven\u2019t seen many plays, but recently I enjoy it a lot.\r\n* \ud83c\udfb5 Listening to music, of almost any genre besides extreme metal. Some artists I like: Zaz, Nightwish, Beth Hart, Leonard Cohen, Rona Kenan, Muse.\r\n* \ud83c\udf06 Walking around cities with good vibes or beautiful architecture (in particular, I love the old European cities).\r\n* \ud83d\udc60 Shopping with friends.\r\n\r\n\r\n\ud83d\udc8dI've been married to my love and life-partner Marcus since 2021 (and we\u2019ve been poly from the start). You can read our marriage vows here.\r\n\r\n\r\n\ud83d\udc31I have two children from my previous marriage. And also a cat.\r\nAbout You\r\n* \u2640\ufe0f\u2642\ufe0f\u26a7\ufe0f I\u2019m attracted to people of any gender and anatomy.\r\n* \u23f325-55 is my usual age range, might consider exceptions.\r\n* \ud83e\udd14I like people with deep intellectual interests. Info-dump away please!\r\n* \ud83e\udd17I like people who are kind and honest.\r\n* \u2195\ufe0fI don\u2019t filter by height.\r\n* \ud83d\udeadI don\u2019t date heavy smokers.\r\nOur Relationship\r\n* \ud83d\udc9eI want a mental, emotional and physical connection. Something that is only about sex is not in the cards.\r\n* \ud83d\ude0b\u2026but also, sexual exploration is fun ;)\r\n* \ud83e\udec2Trust, openness and mutual support are key ingredients. Naturally, these will usually take some time to develop.\r\n* \ud83d\udd70\ufe0fI\u2019m open to secondary relationships of any intensity, anything between seeing each other multiple times a week to meeting once in a blue moon.\r\n* \u2604\ufe0fIf you live not in Israel it will by necessity be a comet (i.e. meeting once in a blue moon).\r\n* \ud83e\udd84I also don\u2019t mind dating a couple, but once again, only if it\u2019s a relationship that\u2019s much more than just sex.\r\n* \ud83d\udda4BDSM is a lovely bonus (I\u2019m a sub).\r\nMore Pics",
