    ProfileText: "\ufeffhello, i\u2019m e (not my real name but it is suitable as a pseudonym) from texas (probably). i am 27 going on 28. i love competing in niche games primarily but i also love film and write about it occasionally. traveling to see my friends all over the world is typically where my money goes. it used to go to archive fashion but i have grown satisfied with my wardrobe and dissatisfied with spending my money on products. i don't buy anything physical besides clothes, food, and hygiene products. i am an antinatalist. i am a non-denominational leftist. i am generally speaking quite happy in my day to day as there are many things i find fulfilling.\r\n\r\n\r\ni am not posting photos of myself. this is not due to insecurity of my appearance (which i have learned to more or less live with) but because i don't value physical attraction in relationships and it's not something i care to maximize for myself. it also feels somewhat dishonest to work on my physical appearance when i have so much work to do on myself in other departments. i also want to limit pictures of myself on the internet to the best of my abilities, but i can of course send them directly if you interested.\r\n\r\n\r\nlikes and dislikes\r\n\r\n\r\nlikes:\r\n\r\n\r\ncompeting (ask me about which games if you're interested)\r\nwatching films (my favorite director is jacques rivette)\r\nwearing a nice outfit out\r\nfinding a good clothing deal\r\nhanging out with friends\r\nhelping my friends when they need help\r\nnice food\r\ntraveling to see friends\r\nnoise music, along with other kinds sometimes\r\nlearning\r\ntutoring math\r\nbouldering (even though i am bad at it)\r\n\r\n\r\ndislikes:\r\n\r\n\r\ndating (i prefer talking online)\r\nflirting (i will not flirt with you; it's nothing personal)\r\ndancing\r\nsex work (i have no beef with sex workers of course and would not object to dating one)\r\nbigotry\r\nvoting\r\nmachine washing clothing\r\ndriving \r\ndoing poorly in tournaments\r\nsports (i am interested in sports statistics however)\r\nnostalgia as a concept\r\nnormie designer bags\r\n\r\n\r\ni dislike biographies that try to sell the reader on the author; i find myself too insecure about my potential narcissistic traits to write about this. some people find me funny and intelligent, some people find me insufferable and dim; who knows what you will find me? i have nothing intrinsically positive to say about myself.\r\n\r\n\r\ni am very online and most my humor comes from this. i make okay money (from a boring job - you can ask about it if you\u2019d like) but not enough to support a partner, something i feel extremely guilty about. i would prefer a long distance relationship as that is what is most familiar to me, but i am open to other possibilities. i am monogamous. one \"relationship\" setup that i wouldn't mind is a strictly platonic marriage in which i provide access to living in the US and, in exchange, i gain access to my spouse's insurance which allows me to retire early. an ideal romantic relationship would involve myself and my partner lifting each other up and trying to bring out the best in each other, and i think it would be most advantageous if we had at least one or two things in common if that is the case.\r\n\r\n\r\nas i mentioned earlier i don't find physical appearance important. i am also unconcerned with how much my partner makes, unless they are dependent upon me for survival which i don't know if i can guarantee that on my current income. you can contact me via discord at souljaboytellemdotcom if you'd like to talk - i am also open to just making new friends of course, if your primary takeaway is \"this guy sounds insane but i would like to talk about film and clothing with him.\" in any case i hope you have a nice day and find what you are pursuing : ) .",
