    ProfileText: "\ufeffDate or be friends with me doc\r\nSo, tell me about yourself\u2026\r\nSure. I\u2019ve broken this down into work & purpose, family & community, relationship leanings, joy, food, location, and what I look like. \r\nWork & purpose\r\nI work as a user researcher and self defence instructor. My research mostly informs public service and policy but I research anything interesting e.g. DIY gene editing tools, bike paths, storm response systems (this is starting to sound like a pitch\u2026)\r\n \r\nI also run an Empowerment Self Defence charity. We offer survivors of violence and people at risk of abuse workshops to harness their own strength, practise nervous system regulation, and have fun and thrive while learning self defence skills.  \r\nFamily & community \r\nFamily & community are priorities for me. I listed my work initiatives first because it\u2019s where I\u2019ve put most of my energy in the past without quite realising I was doing it. Recently, I've resolved to intentionally cultivate community and create family, rather than assume this will all work out with minimal intervention on my part. I\u2019d love to create a relationship with a community around it; a relationship that is in itself a family and that also generates more family in some form.  \r\nRelationship leanings\r\nI\u2019m into monogamous relationships, ones that are co-located, and I\u2019d love to be in a relationship that feels like a great team.  \r\nJoy\r\nThis is a recent focus. I can\u2019t think of a lot to say about it other than: why not make a point of generating and savouring it?\r\nFood\r\nYes. Please. Ideally vegetables. Moderate drinker, more of a savourer than a guzzler. Sweet tooth problem (cake I can guzzle for some reason?) \r\nLocation\r\nUK, London, Hackney. \r\nAre you open to relocating?\r\nI can imagine doing this under some circumstances, and definitely know how to. Yet after moving back and forth across 3 continents for lots of my adult life, I\u2019m trying something newish (to me): staying in one place, becoming rooted. \r\n\r\n\r\nI also think I\u2019ve exceeded the threshold of how many long distance relationships are sensible to have in one lifetime, so best if a partner and I live in roughly the same place.\r\nWhat are you looking for in a partner?\r\nQualities I deeply appreciate include: kindness, curiosity, a general sense of presence, attentiveness, introspective skills, interest in bodies, not just in how they look but in how they are, and how they connect, co-regulation (\u2190 which is more of a relational than individual attribute, but such a magic thing that I think worth mentioning.)\r\n\r\n\r\nI\u2019d like to be and to be with someone we\u2019d all want on a team; someone resourced, with skills and perspective to bring to the mix, someone who values learning and growth, someone who has my back as I have theirs. \r\nWhat do you think a relationship even is?\r\nI think of a relationship as a creation; something we cultivate intentionally, consciously, caringly; something we feel worthwhile to maintain and nurture even when that takes a little effort after the butterflies stop fluttering all the time. \r\n\r\n\r\nI\u2019d love to create a relationship that changes and expands as we do; that forms a secure ground from which we can step out into the world, have rich experiences, change, grow, and bring those changes and that growth back to each other and watch them enrich our relationship. \r\n\r\n\r\nI also think of it as bowls of soup on the couch in winter, watching each other's bags at the train station so we don\u2019t have to lug them to the toilet, arguing well, giggles, surprises, whispers, building community and creating some form of family incl. children, dogs, neighbours, friends, or a subset of these.\r\nCan we be (\u2018just\u2019) friends?\r\nIf we\u2019re compatible as friends, yes please. I cherish friendship and have space and time for new friends. \r\nWhat do you and your world look like? \r\nHere are some photos. The most typical moments I don\u2019t have photos of, so these ones below aren\u2019t a representative sample. They\u2019re all reasonably recent and relevant though.\r\n  \r\n\r\n  \r\n\r\nI sit in a chair lots for work but like to move so I practise and sometimes teach chair yoga\r\n \r\n  \r\n\r\nI lived on a boat for a while, and started to find land weirdly rigid\r\n\t  \r\n\r\nOne of my favourite little friends and me\r\n\r\n\r\n  \r\n\r\nLip syncing to Whitney Houston for a pandemic-era work zoom flash mob (sparkly shirt courtesy of downstairs neighbour)\r\n\r\n\r\n  \r\n\r\nOne of my besties and me on a cold UK beach walk \r\n\t  \r\n\r\nThis is an improv scene about a toothache \r\n\r\n\r\n  \r\n\r\nA hackathon about improving outcomes for violence survivors with trauma-informed self defence \r\n\tHow can I get in touch?\r\nSend me a line here :)",
