    ProfileText: "\ufeffDave  \r\nSan Diego, California\r\ndavidabarak@gmail.com\r\n\r\n\r\nI've been divorced since March, 2021, and I'm thankful that it was a drama-free event. My ex-wife is a good woman but we just drifted apart. I've done a lot of work on myself since then, and I have a good handle on the things I did wrong. If I get a second chance at love, I'll know how to make it work.\r\n\r\n\r\nBecause of the divorce and my retirement that followed soon after, I really began to examine my life. It turns out I'm not the center of the universe after all! Okay, I wasn't really that self-centered, but I did realize that my greatest rewards come from service to others, whether it's working to be a better partner and friend, volunteering, or just doing simple things that might make someone's day just a little nicer. Compassion, kindness, generosity, awareness, gratitude, honesty, humility and even that trait some guys don't understand - vulnerability.\r\n\r\n\r\nBeing open to life and living fearlessly are part of my new outlook. One example: I recently began bodyboarding (\"boogey boarding\"), and not long ago I had a magical experience - I was surrounded by dolphins as they fed, some as close as 10 feet away. One rose up out of the water to take a look at me. I was the closest human by quite a bit; everyone else was a couple of hundred feet away or more. That put a smile on my face and laughter in my heart for two full days. It felt like a personal gift from the universe. You can't experience life if you don't show up for it.  \r\n\r\n\r\nThere's a term I heard recently - ambivert. It describes someone who has the traits of both an extrovert and introvert. It seems to describe me, although I lean a little toward extroversion. I volunteer as a docent at a very popular local museum, so I get to be part tour guide, part educator and part entertainer. It's perfect for me, and I come away with a sense of joy.\r\n\r\n\r\nI'm a glass half-full kind of guy. Sure, sometimes the level drops a little below the halfway mark - I'm human - but more often the glass is almost overflowing.\r\n\r\n\r\nI'm not religious but I'm trying to find my way spiritually. (There's a story about how I came to finally acknowledge my spiritual side, something I kept suppressed for decades.)\r\n\r\n\r\nI've got a pretty sharp sense of humor (or at least I think so), but I know how to rein it in so I don't offend people. I don't take myself too seriously. Sometimes I wake up laughing. But I don't overplay my sense of humor - I'm presentable in public and I won't embarrass you.\r\n\r\n\r\nAlthough I don't have any pets, I love 'em - cats, dogs, birds, just about anything that has even the slightest personality.\r\n  \r\n\r\nI'm a natural-born romantic (I love surprising the one I love with little tokens and acts) and I respect a woman's boundaries.\r\n\r\n\r\nHaving someone special in my life is important to me, but not so important that I'd rush carelessly into it. Being in a romantic relationship isn't a one-way thing for me - I want to give at least as much as I get. After all, I'm not the center of the universe!\r\n\r\n\r\n\r\n\r\n\r\n\r\nFactoids\r\n\r\n\r\n* 64 years old as of the end of June of 2024\r\n* 5' 6\"\r\n* Low to mid 160s in weight\r\n* Retired (with a stable income)\r\n* No children (but I get along great with them)\r\n* Living solo\r\n* Mostly vegan at home and vegetarian with friends and eating in restaurants, although I recently began incorporating fish into my diet when out to eat\r\n* Non-smoker, light drinker, cannabis-friendly with the right people and in the right conditions (which amounts to maybe two or three times a year at most)\r\n* Navy veteran (but I don't wear it on my sleeve)\r\n* Liberal (surprising for a veteran, huh?)\r\n* Past careers:\r\n   * Photojournalist (also time as a columnist, editor and illustrator)\r\n   * IT professional\r\n* Lots of funny stories from a life of derring-do\u2026 and derring-don't.\r\n\r\n\r\n\"To say of what is that it is not, or of what is not that it is, is false, while to say of what is that it is, and of what is not that it is not, is true.\"\r\n\r\n\r\n* Aristotle\r\n(I don't even want to try to figure out what that quote means. It's Greek to me.)",
