    ProfileText: "\ufeffMeta: this doc is oriented toward a long term romantic relationship. I\u2019m also open to more \u201ccasual\u201d possibilities, but if that\u2019s what you\u2019re after you should probably ignore this doc.\r\n\r\n\r\n  \r\n\r\n\r\n\r\nWhen I was 11 years old, as my 12th birthday was approaching, I noticed that the people younger than me tended to have grand ambitions - going to space or becoming president or, in my case, building a new continent. But the people older than me generally did not have such ambitions. Clearly something happened to nearly everyone as they got older, such that they gave up on their dreams and decided to get married, buy a house and have 2.5 kids instead. I was terrified that would happen to me.\r\n\r\n\r\nSo I swore very hard never to do that - never to embrace a life of mediocrity. And that basically worked.\r\n\r\n\r\nI want a cure for aging. I want weekend trips to the moon. I want flying cars and an indestructible body and tiny genetically-engineered dragons. I want to understand minds, be able to build them and edit them and read off their internals. I want things well beyond humanity\u2019s current bounds, and the focus of my life is pursuing those goals wherever they may lead.\r\n\r\n\r\nWhat I also want - very badly - is a partner for that pursuit. And I do mean a partner - not a hanger-on, not an enthusiastic supporter, but someone with grand ambitions of their own and capabilities on par with my own or perhaps even greater. I want someone who can actually be a peer in pushing beyond humanity\u2019s current abilities. Because that is what I need, in order to feel romantic love; nothing else seems to work.\r\n\r\n\r\n\u2026 and that\u2019s it. There\u2019s lots of little things I could say - I am sadly quite straight, I love dancing, etc, etc\u2026 but I\u2019ve said the part which matters most and I don\u2019t want to water it down further. If a partnership of pushing beyond humanity\u2019s current abilities and making the world more to our tastes is something you want, you should get in touch and we can find out if we\u2019re a good fit along other axes.\r\n\r\n\r\nIf you want to scope me out, I write a lot on LessWrong. A message on LessWrong is the most expedient way to get in touch if we don\u2019t already have another channel; Facebook or the myriad of slack spaces also work if our social circles overlap already.",
