    ProfileText: "\ufeffBen Schwab\u2019s Dating Document\r\nLat updated: August 14th 2024\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nWho am I?\r\n* I\u2019m a 40 year old, pansexual, cis gendered male, nerd.\r\n* I live in the Virginia suburbs of Washington DC.\r\n* I\u2019m independently wealthy with enough income from my investments to live a comfortable but not lavish life.\r\n* I volunteer on a weekly basis to support the Northern Virginia community.\r\n* I like interacting with people but I need time by myself to recover the energy loss from doing so.\r\n* I play video games and read in my free time.\r\n* I enjoy going to concerts, opera, theater, or sporting events when I have someone to share the experience with.\r\n* I go to nerdy meetups at-least once a month.  They usually involve conversing on a wide variety of topics and sometimes playing board games.\r\n* I\u2019m a, mostly non-practicing, Buddhist.\r\n* I have an undergraduate degree in physics.\r\n* I\u2019m an anaclitic thinker and tend to over think things.\r\n* I enjoy conversations on philosophy, science, history, law, sociology, and many other topics.\r\n* I am open minded and tolerant of opinions on which I disagree.\r\n* I am teetotal.  I don\u2019t drink, smoke, or do recreational drugs.  I\u2019m okay with my partner drinking on occasion.\r\n\r\n\r\n\r\n\r\nWho am I looking for?\r\n* I am looking for a 27-57 year old of any gender.\r\n* I would like to find a fellow nerd.\r\n* I am looking for a long term partner and potentially a life partner.\r\n* I value honesty, intelligence, independence, and humor in a romantic partner.\r\n* I would appreciate someone who could challenge me.\r\n* I have a preference for someone who is open minded.\r\n\r\n\r\n\r\n\r\nWhat am I looking for in a relationship?\r\n* I am looking for someone to spend time with and build a life with.\r\n* I am okay with not having children.  I am willing to consider raising children.  I do not want to be the biological father of children but would consider adoption, fostering, making use of a sperm bank, or helping to raise someone else\u2019s child.\r\n* I am willing to try new things.\r\n* I am looking for an intellectual and emotional connection.\r\n* I am happy with a more relaxed relationship.\r\n\r\n\r\n\r\n\r\nWhat type of relationship am I looking for?\r\n* I\u2019m happy with a monogamous relationship.  I\u2019m open to considering a non-monogamous relationship but I would be looking for a primary partner in such a setup.\r\n* I desire a relationship where we do things together but it is also okay if we do things apart.  This might be socializing without the other partner present or time for individual activities.\r\n* Sex is not important for me in a relationship but it is desired.  I am willing to partner with someone who wants to wait to have sex and potentially never wants to have sex.  My preference is to have a physical relationship once we get to know each other well enough.\r\n\r\n\r\n\r\n\r\nWhat can I provide in a relationship?\r\n* I can provide emotional and social support to a partner.\r\n* I am told that I am a good listener.  I try to always ask if someone wants me to just listen or if they want feedback when they want me to listen.\r\n* I am someone who is not afraid to challenge his partner.\r\n* I can promise to be available to provide emotional, intellectual, physical, or logistical assistance in dealing with life\u2019s problems.\r\n* I am rather domestic.  I enjoy cooking and cleaning.  I do not enjoy yard work.\r\n\r\n\r\n\r\n\r\nAre there any potential roadblocks?\r\n* I sometimes need some time for myself.\r\n* I am a leftist and a Buddhist.  I am okay with dating someone who has a different political and/or religious ideology than me but these might be important for other people.\r\n* I regularly attend mental health therapy.  My issues limit my ability to work and I apparently cannot work a full time job.  I have my mental health under control for the most part so I would not be needing much support here but my struggles are a part of who I am.\r\n* Some people might find me lacking in ambition.  I am not looking for a prestigious career, or to make lots of money, or to be in charge of things.\r\n* I find routines comfortable.  I have a weekly schedule where I have this for dinner this night, I go to the store this day, etc.  I can sometimes become attached to a comfortable routine.\r\n\r\n\r\n\r\n\r\nHow does one contact me and is there anything else?\r\n* I check my e-mail, schwabbenjamin@gmail.com, at-least once a day and usually multiple times a day.\r\n* I am not willing to relocate for a relationship that is just starting.  I am willing to relocate for a relationship that is well established and looks like it could last.\r\n* I live on my own in a two bedroom condo that I own outright.  I am willing to upgrade my living situation if a relationship advances far enough.  I prefer to live in a condo or townhome as opposed to a single family house.\r\n* I like animals though I currently don\u2019t have any pets.",
