    ProfileText: "\ufeffHow\u2019s it going? I\u2019m Destiny!\r\n29 | female | 5\u20193\u201d | Naples, FL (For Now)\r\n________________\r\n\r\n\r\nAbout Me\r\n\r\n\r\n* I am a big-hearted nerd looking for a match who is kind, funny, and loves stories.  \r\n* I am a published author of middle grade novels, audio dramas, and TTRPG content (writing is my main passion in case it\u2019s not obvious). I\u2019m also a lawyer, but I don\u2019t practice currently.  \r\n* I am on the asexual spectrum and looking for someone to form a connection with rather than jumping straight to physical intimacy. Taking it slow is important to me.  \r\n* I\u2019m a pescatarian (minus shellfish) but that\u2019s more a taste thing, not a moral stance. \r\n* I am currently in Naples, Florida but don\u2019t plan to be here indefinitely. Just waiting for the right opportunity to spur a move.\r\n* I am very open to starting out long distance. Some of my closest friendships started online. \r\n* Jump down to the bottom of the doc for pictures.  \r\n\r\n\r\nDealbreakers\r\n* Kids: I\u2019m not interested in having kids, biological or adopted. \r\n* Age Range: I am looking for a guy who is in the 25-35 age range. \r\n* Conservative Politics: Although I\u2019m not overly political in my day to day life, my values don\u2019t align with conservative politics and it\u2019s important to me that whoever I date shares my values. \r\n* Hardcore Atheism: I was raised Christian and still consider myself Christian (though in a much less legalistic and much more acceptance and love thy neighbor kind of way). Though I don\u2019t need my partner to share my exact beliefs, I\u2019d prefer someone who is baseline spiritual, even if agnostic.\r\n* Smoking/Excessive Drinking: I don\u2019t smoke or drink. Casual drinking is fine but I don\u2019t like the smell of smoke.  \r\n* Polyamory: I am 100% monogamous. \r\n* Cats: I don\u2019t have anything against cats and in fact I like them a lot. I\u2019m just allergic to them unfortunately :( \r\nThings I Love \r\n* TTRPGs: I am never playing as many TTRPGs as I\u2019d like so, to supplement, I watch a bunch of actual plays. My current favorites are Dimension 20 (especially Fantasy High), Worlds Beyond Number, and NADDPOD. \r\n* Theme Parks: I grew up in Florida so I usually went to Orlando at least once a year and I\u2019ve kept the love of theme parks into adulthood. I love roller coasters (even though I can be a total baby about getting on them). The last one that really wowed me was Mako at SeaWorld. The airtime on the hills was amazing! \r\n* Escape Rooms: I am such a huge sucker for riddles and puzzles and there is not a secret tunnel in the world that I don\u2019t want to fling myself into with reckless abandon. It\u2019s the closest to a real-life point and click game that you can get and I love it. There\u2019s one in Baton Rouge called 13th Gate Escape that I\u2019ve been dying to check out. I\u2019ve heard it\u2019s like the Disney of escape rooms! \r\n* Musical Theater: I lived in NYC for three years and the best part (besides the subway which I miss so much) was Broadway proximity. Some of my favorite shows are She Loves Me, Little Shop of Horrors, Six, Legally Blonde, Phantom, Ride the Cyclone, Matilda, Nerdy Prudes Must Die, and Hamilton. It hasn\u2019t been staged yet but I\u2019m also really enjoying Epic as it releases! And the single best musical episode of a TV show hands down is Once More With Feeling from Buffy (though Subspace Rhapsody in ST: Strange New Worlds is the best one in a long while).  \r\n* Travel: I love to travel but I don\u2019t love solo travel so I haven\u2019t gotten to do nearly as much as I\u2019d like. I\u2019ve been to the UK and Spain while studying abroad and Australia for my bar trip. I\u2019ve also been to Jamaica (where my parents are from) and several other Caribbean islands. I\u2019d really love to go back to Europe to hit some of the countries I missed and Japan is my current big ticket dream location. \r\nFive\u2026\r\n* Movies I Love: Enchanted, Shrek 2, Into the Spiderverse, Everything, Everywhere, All At Once, The Mummy\r\n* TV Shows I Love: Pushing Daisies, The Bear, Community, Frasier, Star Trek (TNG, VOY, DS9, LD, SNW)\r\n* Video Games I Love: Slay the Spire, Hades, Return to Monkey Island, Chicory, Tunic \r\n* Childhood Favorite Books: Ella Enchanted, Holes, The Lion, the Witch, and the Wardrobe, The Lightning Thief, Dealing with Dragons\r\n* Non D&D TTRPGs I Love: Kids on Bikes/Brooms, Dread, Tales from the Loop, Perils & Princesses, Mausritter \r\nVibe Check Me\r\n* My Goodreads: I tend to read a lot of middle grade both because I like it and because I write it. \r\n* An Actual Play I Guest GM\u2019d: Watch me wrangle a group of princesses as they make (delightful) choices I never anticipated coming up when I wrote the module. \r\n* My itch.io Page: Check out some of my side projects. \r\nThink We Might Be a Good Match? \r\n* Feel free to shoot me an email at serendipitousfox37@gmail.com with some info about yourself and some pics.\r\n* If you don\u2019t think we\u2019d be a good match but you know someone who you think might, absolutely feel free to forward them this profile.\r\n* Also feel free to email me if you want to talk about Dimension 20. I always want to be talking about Dimension 20 :)\r\n\r\n\r\n\r\n\r\nPictures of Me\r\n\r\n\r\n     \r\n\r\n\r\n\r\n\r\n \r\n________________\r\n    ________________",
