    ProfileText: "\ufeffJake Stiles Owen\u2019s Date-Me Doc\r\n  \r\n\r\n  \r\n\r\nContact info:\r\nPhone: 703-945-0660\r\nEmail: jakestiles@hotmail.com, jakestilesowen@gmail.com\r\nSocial media: https://www.instagram.com/jakestilesowen (I don\u2019t use Facebook or X. I barely use Instagram.)\r\nBasic info:\r\nDating status: Single (divorced in 2016), seeking dates and long-term relationship, open to short-term\r\nLocation: Orlando\r\nAge: 32 (born in 1992)\r\nKids: Shared custody of my 10-year-old daughter; not interested in more children of my own\r\nCore values: Honesty, openness, charity/love, organization\r\nPolitics: Liberal\r\nLifestyle: Physically active. I drink socially. I don\u2019t smoke or do drugs.\r\nReligion: None\r\nOccupation: Data Analyst\r\nEducation: B.S. Statistics\r\nInterests: \r\nArt (consuming): Broadway musicals, girlpop, open mics, reading, botanical gardens\r\nArt (creation): Cooking, game design, piano\r\nPhysical: Biking, walking, hiking, pickleball, volunteering\r\nIntellectual: Logic puzzles, Programming (Python), board games (especially chess and Scrabble)\r\nTravel/adventure: NYC, skydiving, national parks, Cedar Point, New Orleans, Seattle\r\nMisc: Fancy restaurants (love mocktails), people-watching (coffee shops, libraries, parks), tutoring\r\nLinktree: https://linktr.ee/JakeStiles\r\nWhat I\u2019m looking for:\r\nI\u2019m seeking someone to care for and who cares for me. I\u2019ve been single since about July 2023, and I\u2019m increasingly tired of it. I am a positive and happy guy, and I feel overfull with capacity for love and close relationships, but I currently lack an outlet. When I\u2019m with my daughter, I\u2019m able to care for her, and our relationship is great. But our inconsistent schedule together (1-4 days a week with variable hours on those days) leaves a lot of alone time. I cope by surrounding myself with strangers/acquaintances (at coffee shops, libraries, parks, social clubs/meetups, and bars) and friends, but I still feel lonely.\r\nWho I\u2019m looking for:\r\nMore important to me\r\nAge: Prefer within -8 years or +5 years of my age.\r\nPolitics: Prefer liberal (If you\u2019d seriously consider voting for Trump, we likely won\u2019t get along well enough to date).\r\nChildren: Prefer none, but could consider being a step-parent especially if your situation is similar to mine (one older child, shared custody, and not full-time care). If you have two or more young children full-time, we likely wouldn\u2019t make a great match.\r\nLifestyle: Prefer active, non-smoker, and not a heavy drinker.\r\nLocation: Prefer in/near Orlando. I won\u2019t move from Orlando due to my daughter. \r\nLess important to me\r\nReligion: Prefer areligious, however as long as you don\u2019t seek to impose your religion on others, I\u2019m not fussed.\r\nOccupation/Education: Prefer employed and intelligent. If you plan to be fully financially dependent on your partner, then I suggest you look for someone with a higher income than me.\r\nMonogamy/non-monogamy: Open to monogamy, polyamory, ENM, relationship anarchy, etc. I\u2019ve had differing thoughts and preferences on this over time, and I\u2019m happy so long as there is honesty and an open dialogue about what we want.\r\n\r\n\r\nWhat I\u2019m like:\r\nEnthusiastic:\r\n* I respond to texts right away.\r\n* I respect mutual enthusiasm: if you\u2019re into something, I\u2019m into it. If you\u2019re meh, I\u2019m out. \r\n* I like to express and receive love through quality time, words of affirmation, touch, and acts of service. Giving/receiving gifts doesn\u2019t come as naturally to me.\r\n* I like to joke, tease, and generally not take things seriously (unless they\u2019re serious things).\r\n\r\n\r\nThoughtful and honest: \r\n* I think before I speak.\r\n* I'm polite and non-pushy.\r\n* I admit when I\u2019m wrong and appreciate when others do the same.\r\n* I\u2019m positive and don\u2019t focus on things I dislike.\r\n* I argue calmly and quietly and love to have friendly debates about trivial things.\r\n\r\n\r\nObsessive:\r\n* I keep my house clutter-free and love to simplify (aka throw things away).\r\n* I love to organize my life, especially using Google Sheets and Google Docs (as I\u2019m sure you can tell).\r\n* I plan things in advance and arrive early almost everywhere that I go.\r\n* I like to \u201cgo deep\u201d on things. My favorite games are Hanabi and Slay the Spire, each of which I\u2019ve put hundreds of hours into.\r\n* In relationships, I want to spend lots of time together.\r\n* I\u2019ve been learning piano very slowly by self-teaching myself one song (and no others) for months.\r\n\r\n\r\nCharitable:\r\n* I like doing good deeds such as volunteering, picking up trash, listening patiently to someone who needs a friend, giving rides to/from the airport, helping people move.\r\n\r\n\r\nSuccessful and happy:\r\n* Besides being single (which I greatly dislike and causes me some mental distress), I have my life together. I\u2019m a great father to my daughter, my finances are reasonably in order, I\u2019m relatively healthy and active, and I excel at my job. \r\nConclusion:\r\nI trust this has provided more than enough information for you to decide if you\u2019d like to go on a date. My contact info is at the start of this doc. Thanks for your time, and I look forward to meeting and learning about you!",
