    ProfileText: "Yash Sharma\nYash Sharma\nabout\nposts\nprojects\npersonal\nnow\nsearch\nHi there, I am Yash!\nWelcome to my blog.\nMeaning\nSomehow, the YouTube algorithm recommended this video from Austin Augie. I took the bait and watched a few of his videos of India. I am from India so I am interested in people\u2019s experience of India.\u00a0However, I am not interested in seeing the filthy parts of India, I skip over those for some reason. I don\u2019t know why!\nAnyway, the videos are great and the guy seems authentic. YouTube realized I like such stuff so it sent another video called Travel the world, ask strangers the wildest questions, it will change your life....\nDecember 30, 2024\n\u00b7\u00a04 min\u00a0\u00b7\u00a0663 words\u00a0\u00b7\u00a0Me\nIstanbul\nDay 0 I couldn\u2019t sleep at night, thanks jet lag! So, I decided to go get something to eat at 3 am and my neighborhood bakery was open. It\u2019s 24*7 and highly rated. The bakery is tiny with lots of outdoor seating on both sides of the street. It was 3 am and it felt like 8 pm. The street was bustling with people, chai, cigarettes and chatter. I couldn\u2019t believe my eyes....\nOctober 31, 2024\n\u00b7\u00a010 min\u00a0\u00b7\u00a02071 words\u00a0\u00b7\u00a0Me\nMaine\nIt\u2019s 7 am and we\u2019re driving towards the national park to see the Cadillac mountain. It\u2019s the final spot on the itinerary. A friend invited me to this trip. We\u2019re four guys, two of them I met the first time at the rental car center. It\u2019s a short weekend trip with people with very different personalities.\nI have done such trips before but this one has been somewhat different. I see conversations that I would call aggressive to be commonplace....\nOctober 25, 2024\n\u00b7\u00a03 min\u00a0\u00b7\u00a0484 words\u00a0\u00b7\u00a0Me\n30 Day Challenge: Fruit till noon\nBaby pineapple, Peru\nI read Living with a Seal last year and in the book, Jesse Itzler talks about only eating fruit till noon. It sounds like a healthy change in lifestyle. My usual breakfast is eggs if there\u2019s a breakfast at all, which I think is healthy but I am gonna challenge myself to follow Jesse\u2019s advice and see if it makes a difference.\nSince, I have already eaten breakfast today, I am gonna start the clock tomorrow....\nOctober 11, 2024\n\u00b7\u00a01 min\u00a0\u00b7\u00a0124 words\u00a0\u00b7\u00a0Me\nSan Francisco\nThis is my 6th time (or maybe it\u2019s 7th, I am not certain) in San Francisco and everytime I come here, I have had feelings in the realm of:\noh, this city could be a paradise but sadly it\u2019s so far away from it. It\u2019s pretty meh! It\u2019s terrible, why would anyone live here? I really wanna like this place but it\u2019s still terrible. I have wished and tried hard to like this place and I feel so happy that it\u2019s paid off....\nOctober 4, 2024\n\u00b7\u00a02 min\u00a0\u00b7\u00a0265 words\u00a0\u00b7\u00a0Me\nIn the moment\nI was listening to a podcast that mentioned that Gen Z regularly binges old high school videos from the 80s and 90s on YouTube. The implication was that we really miss the old times of living in the moment. The time when you could talk to people anywhere, when nobody was on their phones all the time, when nobody was wearing airpods. To be honest, I am an old soul and I miss those times....\nSeptember 29, 2024\n\u00b7\u00a02 min\u00a0\u00b7\u00a0356 words\u00a0\u00b7\u00a0Me\nDecisions\nI haven\u2019t had a problem making decisions until now. I had always been at ease with them because I had a strong compass. The compass always pointed to career and financial success. I evaluated all my choices on the objective questions\nIs it good for my career? Will it help me move up the ladder? Will it help me financially? Focussing on just one dimension is a bad way to make decisions....\nSeptember 21, 2024\n\u00b7\u00a03 min\u00a0\u00b7\u00a0532 words\u00a0\u00b7\u00a0Me\nThe Harsh Realities of Legal Immigration\nThe essay was published on Tangle.\nRegardless of their politics, everyone has a view on immigration. More often than not, people support legal immigration over illegal immigration. Both sides also generally agree that highly skilled immigrants are a valuable asset to the U.S. economy. I would even say most people who immigrate illegally would want to do so legally. But obscure and dated laws in the U.S. make legal immigration downright painful....\nSeptember 12, 2024\n\u00b7\u00a09 min\u00a0\u00b7\u00a01710 words\u00a0\u00b7\u00a0Me\nPeru\nI am at the Lima airport waiting for my flight back to NYC. It\u2019s been a fabulous 11 days in Peru. I don\u2019t think I got to see a whole lot of places but I did have a fantastic time and I made a bunch of friends. It\u2019s amazing and unexpected how great this trip has been.\nIt seems weird when I say I spent 11 days but didn\u2019t see much....\nSeptember 11, 2024\n\u00b7\u00a08 min\u00a0\u00b7\u00a01568 words\u00a0\u00b7\u00a0Me\nCities\nCities shape us in profound ways, often more than we realize. I am sure you have heard of the quote that you\u2019re the average of 5 people around you. I can\u2019t say how true that is but I can say that the basic idea makes sense. We are influenced by our surroundings, both consciously and unconsciously.\nCities, however, are more than just collections of people. Each city has its own culture and an implicit message, and whether we like it or not we\u2019re influenced by it to a degree....\nAugust 25, 2024\n\u00b7\u00a05 min\u00a0\u00b7\u00a0943 words\u00a0\u00b7\u00a0Me\nNext\u00a0\u00a0\u00bb\n\u00a9 2024\nYash Sharma\nPowered by\nHugo\n&\nPaperMod",
