    ProfileText: "\ufeffHi.  Thanks for reading my info.  My name is Brian.\r\n\r\n\r\nI'm a 57-year old white male living in the Phoenix area.  I have a background in IT and a graduate degree. I\u2019m 6\u20191\u201d and about 210. I seek femme or androgynous-presenting people of any gender and prefer smart, engaged and self-aware types. I look for a connection & serious chemistry with someone before I can really get into a relationship.  It\u2019s that tangible vibe that I can\u2019t ignore and can\u2019t make up.\r\n\r\n\r\nI am nonbinary and genderfluid; some might say \u2018genderchaotic\u2019.  This does not mean I cross dress.  I am just not interested in being a masculine male in attitude or look and it\u2019s much easier to just go with what looks and feels good to me and often it\u2019s black.  \r\n\r\n\r\nI'm an INFJ-T so fairly loner-ish, a Sigma and 6w5 Enneatype.  I like my own company when I am not partnered but tend to focus on the person I'm with when that applies.  I prefer small groups where I can talk to interesting people and don't particularly care for big, noisy venues.  I'm extremely well-read and look for the same in a relationship - show me your library. One of the main aspects of my personality is an obsession with the esoteric, the metaphysical, the unusual and hidden.  This extends to physical and emotional intimacy.  I want a deep, visceral reaction when I look at my partner and vice versa.  We should know what the other is thinking across a crowded room with just a look and feel a need to be touching and affectionate no matter the circumstances.  QAF. Curiosity, exploration, openness, desire and heat - if you resonate with \u201cTake Me to Church\u201d by Hozier, that captures the feeling I have in mind.\r\n\r\n\r\nWhen I'm not reading or pursuing these things I'm listening to podcasts, sometimes working on novels or nonfiction research projects or watching documentaries. I play videogames and spend time in Second Life.  I have done some virtual photography and found it very soothing and creative.  I like to hand-bind journals when I have time.  I enjoy target shooting but am not a hunter.\r\n\r\n\r\nI'm looking for a smart woman of any gender, 40 and up, who knows herself but wants to dig deeper.  I like those who are mentally strong, who have survived some of the rough experiences life can provide and come back stronger.  I tend to be attracted to tomboys and transwomen who look good in jeans and a tank top and I'm wild for ink and piercings. I like curves, whether they are natural thickness or muscles.  If you speak multiple languages or ASL I'd love to learn, ditto with anything else you're good at and obsessed with. I seek someone similar who is focused on their spiritual development and the search for knowledge and understanding. I want to find someone who is in touch with all aspects of themselves and not put off by the shadow.  Physically I am often drawn to women with a high melanin content but I'm open to anyone with whom I connect.  I'm not a monotheist and I lean way left politically. I would do best with someone of like persuasion who is open-minded, tolerant, progressive and spiritually attuned.  Bonus points if you are into Star Wars, particularly those who run around with red lightsabers.\r\n\r\n\r\nI'd really like to meet someone in the Phoenix area but I'm open to travel and potential relocation if the vibe is right.  I'd consider anything more or less in the Western US.  I'm a monogamous person though I would consider a closed throuple with the right pair.  I want to meet someone who first and foremost gets me just as I am, accepts me where I'm at and respects my wants and needs as I will surely do the same in return.  I'm housebroken, responsible, employed and live on my own.\r\n\r\n\r\nIf this resonates with you, send me your bat sign\u2026  bhodges209@gmail.com.",
