    ProfileText: "\ufeffDaryna\u2019s Date Me Doc\r\n\r\n\r\n  \r\n\r\n\r\n\r\n  \r\n\r\nBackground\r\nUkrainian, living in Germany since 2015. I moved here for studies (rationally) and due to my late childhood memories of calm, clean cities and sporty, smiling people (emotionally). I've also lived in China and the States, so I\u2019m fairly used to fitting my life into two (largely overweight) suitcases. I was supposed to move to Stuttgart but stayed in Berlin (mainly because my paintings no longer fit into those two suitcases).\r\nLanguages: German, English, Russian. Any of them goes, but I feel less witty in German.\r\nLocation: Berlin, DE. I previously couldn\u2019t imagine myself moving elsewhere, but now that has changed, and I would switch cities for new experiences and to shake things up.\r\nHow I see myself: Emotional, curious, creative, extremely stubborn.\r\nHow my close friends/family see me: \u2018She is kind, ambitious, self-reflective, and gives good advice. But beware of the girl, she\u2019s an avid hoarder\u2019 (the \u2018avid hoarder\u2019 part was probably about the amount of art supplies I own, haha).\r\nWho I am not: Never say never, but I\u2019m not a party/club person. I feel comfortable around big numbers people at conferences and events at work but prefer smaller groups and dialogues in my private life. The quality of conversation matters to me. And the clubs nowadays don\u2019t even play Britney Spears songs, so why would you want to go anyway, right?\r\nLW/EA community: This is how I came across the concept of a date-me-doc but wouldn\u2019t expect any other approach from the rationalists. My approach towards charity and rationalism grew naturally till I found out that it is in tune with a large community out there. I would like to engage with it more on a regular basis since I agree that the whole is greater than the sum of its parts.\r\nRandom facts: I was part of a girls' band in high school. I put salt on top of sweet foods (ice cream, chocolate, porridge, etc.). My guinea pig was a centenarian (by animal measures, 8 years = 144 years) and had a collection of hand-made dresses, made out of socks and rhinestones  \ud83c\udf80 \r\n\r\n\r\nMy everyday life\r\nWork: I identify a lot through what I do, so my profession is worth a mention. I am an architect and an interior designer who is currently transitioning into the field of tattooing. I've been painting since I was little and previously used to sell my art. I paint with oils and digitally, also experimenting a lot with charcoal and ink.\r\nBooks: I usually read up to 5 books simultaneously, mostly sci-fi, dystopias, biographies, and non-fiction on society, economics, and psychology. I also love myths and fairytales of various nations. Currently, I'm relaxing my reading muscle and enjoying a fantasy book series from my childhood about a boy who was given ancient powers to rule Hell and his controversial journey to find Heaven.\r\nMusic: I really enjoy silence, to be honest. I am not much of a \u2018music playing in the background all day long\u2019 kind of person unless it's something repetitive like lo-fi. When I sit and listen to music, it\u2019s usually some indie rock, hip-hop, classical, or jazz music. I am very unspoiled as far as the quality of the equipment, like sound systems or record players, goes, so feel free to teach me a thing or two about it.\r\nSports: Mostly yoga, pilates, and gym. I\u2019ve had a quite bad knee injury and have been taking it slow since then. I would love to try more group sports and hiking in the future.\r\nActivities: Painting/sketching, photographing, singing. Redesigning my apartment for the 100th time, helping friends redesign their apartments for the 100th time, treasure hunting for new lampshades at thrift stores. Repotting my astonishingly fast-growing basil plants.\r\nWhere you can usually find me: Bookstores, vintage markets, parks, theaters, cinemas, somewhere in the streets (I walk a lot), or at home enjoying my afternoon beauty sleep.\r\n\r\n\r\nDating preferences\r\nLove language: All of them matter, but I would pick Physical Touch and Acts of Service as my main ones. With Physical Touch being one of the things you can almost exclusively get in a romantic relationship, it is a very important feature for me. While Acts of Service show the invisible care, and I like their casual subtlety.\r\nStyle: Monogamous, long-term. Committed, honest, intimate, caring, romantic.\r\nLooking for: A kind, reliable, emotionally mature, ambitious person with a strong set of values they stand by.\r\nKids: For me, the partner comes first, and children are negotiable. I am looking for a person with whom I could share this experience, but having kids is not the main goal of a relationship. I want someone I know I can safely rely on while bearing and raising a child, sharing this responsibility together.\r\nSidenotes: I don\u2019t drink/smoke/take drugs, so would prefer a partner with no habitual substance abuse.\r\n\r\n\r\n\r\n\r\nYou made it to the end of this document! Feel free to contact me @silxxdar on Telegram or share this doc with anyone who you think would be a great match for me, thank you.",
