    ProfileText: "\ufeffDating Chiaki \ud83d\udc08 \u2764\ufe0f  \r\n\u2618\ufe0fBasic info:\r\n* 35 year old (1989) woman based in London (ish*) from Japan\r\n* 5.4ft (164cm), average build\r\n* Software Engineer at a fintech, ex chef/pastry chef with a graduate degree in English/Religious Studies\r\n* Does not have kids, open to discussion but >70% on staying childfree. Has a (world\u2019s best) cat. Happy for you to already have children\r\n* Diet: usually vegetarian, often vegan, occasionally pescatarian, hardly ever omnivore. Never smokes, rarely drinks alcohol\r\n* Has some chronic illnesses which are normally under control, but prone to fatigue\r\n* Autistic and introverted (INTJ), but I have good communication skills\r\n* Looking for: man/woman, for a long term relationship, ideally a life long partnership (happy to start from LDR), and/or friends\r\n* Relationship type: I think monogamish, but open relationship negotiable (I\u2019ve had both mono and poly relationships. I\u2019m not really jealous in general)\r\n* Location: Happy to relocate to anywhere if the climate is not extreme\r\n* If you want to see my OKC profile, here it is\r\n\ud83c\udf38More about me:\r\n* I\u2019m a rationalist/EA adjacent. I seem to get along best with people in this community\r\n* I like learning things (when my brain fog permits) and my topics of interests are:\r\n   * Philosophy\r\n   * Psychology\r\n   * Behavioural economics\r\n   * Health/medicine/epigenetics\r\n   * Eugenics/Ethics\r\n   * History\r\n   * AI safety\r\n* But I\u2019d enjoy people explaining things they\u2019re passionate about to me, pretty much anything. I find it very attractive when someone\u2019s very nerdy about things\r\n* I work really hard to improve myself, my health, and my life, taking one day at a time\r\n* I meditate regularly, and am trying to learn more about Buddhist philosophy and Stoicism. I don\u2019t practise any religion\r\n* I go for walks daily, but my favourite kind of walks are nature walks, as well as culture walks in a foreign city on occasions. I also exercise regularly\r\n* I have overcome so many life challenges including dropping out of high school because of my health, severe depression for decades (no longer the case, yay!), illegal dismissal from employers, coming to London from Japan all by myself, changing careers from a pastry chef to a software engineer, accepting long term illnesses etc\r\n* I\u2019m extremely agentic and get things done. Super responsible. Good at taking initiatives. Used to be type A, worked really hard to not be.\r\n* I'm very independent and I can take care of myself, and love being on my own (and my beloved cat Toffin), but also love spending time with my partner\r\n* I'm at my happiest when I'm around nature, and animals, reading/watching a film quietly, enjoying tasty food, wandering around a museum, or exploring a foreign place\r\n* I'm very good at cooking and baking, as well as cleaning. It would be nice to cook together with my partner\r\n* I have a good sense of humour, and am childlike\r\n* I'm smart and would like my partner to be way (ideally one more big 'WAY') smarter than me and teach me anything\r\n* Very cliche but I like watching films, listening to music, reading books\u2026trying to get back into more creative hobbies like writing, drawing, singing, playing the ukulele, craft etc\r\n* I used to love cycling, swimming, and dance aerobics, and I\u2019m working to be able to do those again!\r\n* I\u2019m the kind of person who NEVER FAILS to pet a cat on the street, or always tries to rescue snails when they\u2019re on the street\r\n* I love enjoying nice food (just tasty, doesn\u2019t have to be fancy. In fact, my favourite kind of food is free food) and it\u2019s very important to me that I can share that enjoyment with my partner\r\n* As you can see, I\u2019m very autistic honest and transparent\r\n* I'm reasonable and able to change my views based on evidence. I apologise for my actions if I made any mistake. I might argue to understand and reach an agreement if there's a relationship problem, but I don't fight.\r\n* *Recently moved from Camden (central London) to Milton Keynes (30 min train from London Euston) where there\u2019s more green and is quieter. I live alone in a house full of plants with Toffin, and there are a bunch of cows 10 minutes walk away which I\u2019m making friends with :)\r\n* I\u2019d seriously consider being a housewife if you\u2019d like that too. I\u2019m just really good at house chores and I find it way too demanding to continue working full time with my health conditions\r\n\r\n\r\n\ud83c\udf33What I\u2019m looking for:\r\n* Companionship based on trust and deep friendship where we help each other grow and be a better version of ourselves, and be happy together. We respect each other's space and also enjoy each other's company. We feel truly safe and free to be ourselves.\r\n* Although I loved living in a big city where a community of friends are walking distance away, and I also want to travel around the world, at this point in life (how many years have we got before the AGI?), I want to live in the countryside with a big, beautiful garden with a bunch of animals. I would like a partner who would want to share that quiet, peaceful life mindfully, enjoying each other\u2019s company and tiny little things nature would grant us each day\r\n* I don\u2019t particularly see sex as an important factor in a relationship (although I do love physical touch). I just think there are other things more fun to do together than sex? If you think regular, frequent sex is essential in a relationship, I might not be your girl. Happy for you to change my mind about it though - it might be different in a truly loving relationship which sadly I\u2019ve never had\r\n* Someone who understands my health limitation and is willing to support me when I need (it\u2019s often more emotional support rather than a practical one although my mental health is well under control thanks to years of effort and resources gained)\r\n* From my experience (I\u2019m recently out of an 8 year relationship) someone with below characteristics will probably work well with me:\r\n   * Very patient\r\n   * Very stable (not much emotional fluctuations towards negative direction in particular)\r\n   * Who is capable of loving someone deeply\r\n   * Very smart and knowledgeable\r\n   * Kind and caring\r\n   * Practices mindfulness/meditation and has basic understanding of psychology and philosophy in general, as well as communication (NVC, IFS etc)\r\n   * Has a great sense of humour\r\n   * Still avoids covid, or is willing to avoid it for me (I certainly don\u2019t need Long Covid on top of what I already have)\r\n   * Willing to communicate and be honest and transparent\r\n\r\n\r\n\r\n\r\nThank you for reading! If you think you might get along with me, please don\u2019t hesitate to contact me at chiakimizuta61@gmail.com or pass this to that weird friend of yours :) If you want a reference, my ex (who is now my best friend; we still have a great relationship, just no longer romantic. He moved to Berkeley so don\u2019t fret) is happy to vouch for me.\r\n\r\n\r\nScroll down for more pictures! (neatly laying out the pictures on Google docs is clearly not my forte and I can live with that)\r\n\r\n\r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n\r\nLast Updated: 14/11/2024",
