    ProfileText: "\ufeffUpdated: 6/1/24 \r\n\r\n\r\n  \r\n\r\n\r\n\r\nFind me on Instagram for additional photos, or to communicate -  https://www.instagram.com/phxtj or email me tjguitar85 at gmail.com.\r\n\r\n\r\nHi there! \r\n\r\n\r\nMy name is TJ and I'm a jack of all trades, master of none. I have a bachelor of arts in performing arts music, but I have never been compensated for anything remotely artistic in my entire life.  I have worked in the federal government for the last five years. In those five years, I\u2019ve been an airport security screener, a tax auditor and a project manager.  I currently live in South Orange County, California - I have previously lived in Arizona, Hawaii and various other parts of Southern California. I'm considering leaving California again within the next few years due to the cost of living - despite all of my family being here.\r\n\r\n\r\nI'm 39 and I would consider an acceptable dating range to be someone in her late 20's to late 40's. I would only consider monogamy, and my deal breakers are smoked substances, recreational drug usage, and general meanness. I have never had a girlfriend though I\u2019ve lost track of the people I have met on OLD - I have been on OLD - off and on - since before swipe apps were a thing. I\u2019m hoping this longer form word doc does a better job of actually marketing myself to someone who finds my flavor of weird adorable.\r\n\r\n\r\nI go back and forth between wanting to chuck my career to pursue global nomadic life (with a partner) or just find a kind and interesting person to settle in one spot with. (Because maybe I should just be grateful for all the places I\u2019ve been able to travel to in the past?) Perhaps it will end up something in between.\r\n\r\n\r\nI like going for scenic walks and being near, on, or in the water.\r\n\r\n\r\nPart of me loves nothing more than a grand adventure. I\u2019ve been to the Great Barrier Reef in Australia, I rented an AirBNB restored trailer in somebody's yard for 28 nights (monthly discount!), explored Zion National Park and Bryce Canyon, and soaked in Iceland's Blue Lagoon (though the skies did not cooperate and I could not see the Aurora Borealis....)\r\n\r\n\r\nThat's not to say I don't enjoy life closer to home. Sometimes exploring the world looks like finding a new restaurant and trying something new on the menu. I also love going to classical music concerts, and enjoy being a spectator or participant in numerous sports.\r\n\r\n\r\nI'm looking for a partner to share life's moments with, both large and small. My ideal relationship emphasizes quality time, mutual respect, affection, and straightforward communication.\r\n\r\n\r\nI tend to prefer one on one and smaller group socializing over large group hangouts, but I can hang in the large ones on occasion.\r\n\r\n\r\nI've been planning my own life for the past 20ish years. I'm more than ready to share the burden with someone else who wants to take it on. Even better if you\u2019re the planner type because I tend to be pretty go with the flow - though clearly I\u2019ve planned everything for myself for a long time, so I am capable and willing to do some planning.   :) \r\n\r\n\r\nI do not have any kids, and I\u2019ve never had a burning desire to be a parent. For that reason, I don\u2019t think that I would be compatible with someone who definitely wants kids. I look forward to a future where I can take advantage of last minute travel deals and don\u2019t need to schedule my life around a structured work schedule.\r\n\r\n\r\nI do not consider myself religious, but I was raised religiously Lutheran and I do in fact have some Ashkenazi Jewish in me according to a spit test of my DNA.\r\n \r\nI\u2019ve been part of the FIRE community for a while, and I lean frugal - but I\u2019m not rigid about that and I\u2019m willing to compromise to some extent to avoid a perpetual single life. :D I can\u2019t imagine ever needing to receive financial support from a romantic partner - and I\u2019m definitely not looking for a \u201ctraditional gender roles\u201d scenario - I very much would like to give and receive an abundance of emotional support and physical affection.\r\n\r\n\r\nI prefer warm temperatures and I am sensitive to the cold. For whatever reason, this seems to be the opposite of a lot of the people who I meet. I love going for walks by the ocean - the last time I went to Maui, I walked 7 miles every day on the boardwalks which proved that my sedentary life in gloomy coastal California is entirely a choice and not a physical limitation. I guess cold temperatures and cloudy skies do not inspire me to get my walking on. :D I have never lived somewhere with actual winter, but I'd certainly be willing to try it. One of my friends tells me I need to move to the East Coast to find the type of person who will appreciate me, but perhaps I just need to find someone from the east coast who has decided to make the trek to somewhere warmer. The heat didn\u2019t really bother me in Phoenix until it got above 105 degrees.\r\n\r\n\r\nAt the end of the day, I'm looking for someone who does actively want a partner like I do - not one of those with the mindset of \u201cif it happens, it happens\u201d - I don't want to build some full life for myself and then try to fit someone else into whatever little room might be left - I want to build an awesome life with someone else, together - I hope it\u2019s you, because I\u2019m pushing 40 and it would be great to meet you sooner rather than later.",
