    ProfileText: "\ufeffHi! I\u2019m Rishi!\r\n34 | male | hetero | monogamous | 5\u20195\u201d | San Francisco, CA | seeking LTR/marriage/kids\r\n\r\n\r\ntl;dr\r\nPlant-based 30-something with a big heart seeks woman for urban hikes, carry-on-only travels, friendly but competitive game nights, dance parties, marriage, babies, and everything in between.\r\nPics!\r\n  \r\n  \r\n  \r\n  \r\n\r\nMore pics on Instagram and at the end if you want to see more.\r\n\r\n\r\nWho am I?\r\nI\u2019m insatiably curious, embrace silliness and play, and love to find adventure.\r\n\r\n\r\nI like to pick up new hobbies/obsessions every few years but the consistent themes are healthy living (cooking, exercise, sauna, meditation, healthspan extension), adventures (travel, hiking, biking, camping), and intellectual curiosity (wikipedia wormholes, reading fiction, history and geopolitics).\r\n\r\n\r\nI\u2019m an extrovert by the traditional definition but I enjoy spending time alone as much as meeting large groups of random strangers.\r\n\r\n\r\nI was raised in Pittsburgh, PA by Indian immigrant parents and have lived in San Francisco for most of the last decade with a stint in London in between. I\u2019m somewhat agnostic to location but have grown accustomed to the Mediterranean climate of the Bay Area. I\u2019m pretty close to my family and they play an important role in my life.\r\n\r\n\r\nI grew up vegetarian and became vegan 10 years ago because I care about reducing animal cruelty. It\u2019s not a dealbreaker but I\u2019d prefer to be with someone who is plant-based or at least respects the decision I have made. I love to cook for others and people who have tried my cooking have said they could be vegan if they could have food like that all the time.\r\n\r\n\r\nWhat I\u2019m looking for\r\nSomeone family-oriented who is excited about finding a monogamous long term relationship leading to marriage/kids. I am open to biological children or adopting.\r\n\r\n\r\nSomeone kind and empathetic who cares about helping other people and the world around them.\r\n\r\n\r\nSomeone who is interested in living a healthy and active lifestyle.\r\n\r\n\r\nSomeone who is passionate about something (work/hobbies/ideas). We don\u2019t have to share all of the same interests but we should be excited about supporting each other\u2019s passions and goals.\r\n\r\n\r\nSomeone who is open-minded to a little weirdness but still grounded in reality.\r\n\r\n\r\nI want to live a comfortable but relatively simple lifestyle that values experiences over possessions.\r\n\r\n\r\nReach out!\r\nE-mail me at rsmohnot@gmail.com or DM me on Instagram or get an intro from someone I know (probably my brother who has like 5M friends).\r\nMore Pics\r\n  \r\n\r\nI organize a monthly walk and hang around a neighborhood in San Francisco for groups of friends.\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n  \r\n\r\nFam\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n  \r\n\r\nI was one of those people who got stuck in the mud at Burning Man in 2023.\r\n  \r\n\r\n\r\n\r\n  \r\n\r\nI climbed this 100ft tall tree in Vancouver\r\n  \r\n\r\nI officiated my brother's burning man wedding in a dust storm while standing on a Funkadelephant, a giant mechanical elephant art car.\r\n  \r\n        \r\n  \r\n\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nI  \r\n  \r\n\r\n\r\n\r\n  \r\n\r\nEaster egg for reaching the end: My sister in law INSISTED that I put this picture in - I\u2019m helping her move a really heavy console table up the stairs",
