    ProfileText: "\ufeffText me maybe? \r\nI read about Date Me Doc recently, and I was excited to get started. I try to make it as digestible as possible, if anything is not clear just ask.\r\n\r\n\r\n*       \r\n\r\nMy Story \r\n   * Age - Mid 30s\r\n   * Height - 5ft 7\r\n   * Sexual orientation - Straight, strictly monogamous \r\n   * Location: London, UK\r\n   * Languages - English, Mandarin, Korean, Malay, (want to learn Spanish)\r\n   * Human Design Type: Manifestor\r\n   * Attachment style : Fairly secure, tendency to be anxious\r\n   * Love languages: Beyond touch, act of service and words of affirmations; I seek stability, commitment and conscious communication\r\n   * What I can offer: Patience. Listening. Awareness. Conscious communication. Friendship. Independence. Space. Teamwork. Compassion. Reassurance. Personal and relationship growth. Shared memes. Comfortable Silence. Delicious food. Emotional and Physical Intimacy \r\n   * Life quest: learning how to swim, free-diving, own a 5-bed home, have family, and own a book cafe that encourages people to disconnect from their online world. \r\nMalaysian-born mixed-race life enthusiast, who finds joy in little moments and is passionate about personal and professional development. Single-handedly raised by my mother, I learned the values of resilience, determination and gratitude from an early age. Despite its challenges, my childhood was filled with beautiful memories, love, laughter and experiences. My academic journey took me to South Korea, and ultimately to UK, where I now call home. \r\nFamily holds a special place in my heart. I live with my mom since my last relationship, and remain in close contact with my brother, who\u2019s married. I have a close knit circle of friends and community, who I consider extended family \u2013 these connections ground me and remind the importance of love and support. \r\nImportant to know - I don\u2019t drink alcohol,but I have an active social life. I enjoy socializing in ways that foster deep conversations via conversation cards and shared experience. I enjoy hosting, inviting friends over for dinner or social events. In addition to that, I seek spiritual experiences such as cacao ceremonies, breathwork sessions, and forest bathing. These activities allow me to connect with my inner world, God, nature and explore different dimensions of consciousness, and deepen my appreciation for the world around me. \r\n  \r\n  \r\n\r\n\r\n\r\nI love books - self growth, historical, geographical and autobiographies. I love random adventures, peace and quiet. I love everything about nature, indoor, outdoor spaces, fresh air. I love warm nights sleeping with the windows open.I am the type of person who gets excited about sunrises and sunsets, the night sky, thunder and the scent after the rain and engages in deep conversation while holding a mug filled with hot chocolates, sitting by the fire. I love not wasting. I love freshly squeezed orange juices. I love and I love and I hope I always keep on loving and choose love. \r\nI find joy in movements, of any sort - lately, I have been redefining my own limits and engaging a lot with salsa-bachata dancing, F45 exercises, Hyrox and the Turf Games competition. I also love reading, watching documentaries, and listening to podcasts - constantly expanding my knowledge and understanding of how this world works. \r\nWhat I am seeking:\r\nI want to connect, and genuinely get to know that person at a deeper level before we decide to embark on a journey called relationship. In my case, I am looking for my life partner. \r\nMy ideal partner is someone who shares similar values, which are non-negotiables \u2014fitness, family and growth mindset. Ideally, someone who appreciates physical, emotional and spiritual intimacy, physically active, adventurous, trustworthy, has the ability to be vulnerable, and appreciates PDA.Ideally my partner would:\r\n\r\n\r\n   * Prioritize family -I value maintaining strong ties with yours, my family and/or building family of our own. \r\n   * Want children - I want to have only one child and to conceive naturally. I love my life, enjoy travelling and I want to continue doing the things that bring me joy, finding my purpose in life and contributing to this world. I want to share these experiences with you and our children. Therefore, one is enough. I believe in natural order, and will not endure the pains and lengths of IVF or egg/embryo freezing to have children. \r\n   * Be physically active - Share my passion for physical activities and maintain healthy lifestyle. Love outdoor adventures.\r\n   * Growth and abundance mindset - embrace positive outlook of life, focusing on growth, gratitude and the belief that there is enough for everyone and there\u2019s solutions to every problem. \r\n   * Vulnerability and communication: I believe that having the ability to be vulnerable allows deeper intimacy. Conscious, open, honest communication is important to me. \r\n   * Kind - Display kindness not just towards me, but to everyone around you, me, us, including animals. \r\n   * Shared household responsibilities \u2013 be willing to contribute equally to household tasks and chores, as well as taking the initiatives to keep our relationship alive through planning dates and quality time together.\r\n   * Spirituality - Have a strong faith or spiritual practice, willing to do the deep work. Spirituality is an important part of my life and I would like to share /exchange that with my partner. \r\n\r\n\r\nDate Bucket List\r\n\r\n\r\n   1. Parkrun 9am Saturday & brunch\r\n   2. Farmer\u2019s market \r\n   3. Arcade fun \r\nQ&A with Bilqis\r\nConscious relationship agreement - core values (something I\u2019d like to have when we get into relationship)\r\n   1. No secrets - imagine our connections to each other like a living energy between us. I\u2019ve noticed that with most relationships the natural tendency is for this filmy layer to build up between us, small unspoken things or untruths only add to that layer and it becomes hard to truly see and feel close with each other. Radical honesty is a way of wiping away that layer between us. It keeps the connection clear. This doesn\u2019t mean we don\u2019t respect each other\u2019s privacy. \r\n   2. We are a team. As a team we get to play to our strengths. The ways we show up in our relationship are unique and there isn\u2019t an expectation that because I do X, you will do X. It\u2019s more about how can we both most authentically contribute and does that dynamic leave us both feeling nourished and supported. \r\n   3. No one outside the partnership knows more than we do. There isn\u2019t a single (consequential ) thing someone else could tell me that I don\u2019t already know. In moments of tension, instead of my first reaction being venting to friends, this practice has encouraged me to go inward first, to journal or speak to my partner to work through it. \r\n   4. No request or feeling is inherently \u201cwrong\u201d and everything can be talked about. Let\u2019s create a space that felt like freedom, not judgement. All requests and feelings are valid even if we can\u2019t meet that request in the moment. I want to feel safe to express my innermost thoughts and needs. It\u2019s also been an amazing practice in hearing someone without needing to fix or change, just listen. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nNext steps, if you are interested in getting to know each other better, please do\r\n   * Drop me a line via IG @hej.bilqis or my LinkedIn profile\r\n   * Please include a link to your Date Me Doc and your photos if your Date Me Doc doesn't have them",
