    ProfileText: "\ufeffDate Kerry!\r\nHi, I\u2019m Kerry!  \r\n\r\n\r\n\r\nI am a lighthearted intellectual with dad energy, who likes to be serious and playful all at once. I appreciate thought-provoking conversations, folkways, and every kind of beauty.\r\n\r\nMy current projects:\r\n* Seeking a monogamous marriage to start a family\r\n* DIY upgrading my house and creating a beautiful yard and garden\r\n* Trying to start a blog and generally publish more work\r\n* Doing computational geometry and cloud backend software at a geology startup\r\n* Running a rationalist meetup\r\n\r\n\r\nWhat I\u2019m like:\r\nI\u2019m extroverted and sociable, and I like making new friends and meeting new people. I like dinner parties and hosting events, and I\u2019m constantly moving in and out of little jokey improv bits. My friends and I often get together for silly events and private game shows, and I wouldn\u2019t have it any other way.\r\n\r\n\r\nI get really into learning about subjects that catch my fancy. Some current examples include: How do Aristotle\u2019s virtue ethics hold up in light of Darwinian evolution? Are there cool garden hacks to let me grow more plants in Colorado? Why do Karl Popper\u2019s fans claim empiricism is wrong? What does societal collapse look like, and are we experiencing one? What will LLM-based agents look like, and how will they act? How is there a whole volume of Robin Hood ballads when I\u2019ve only ever heard the one with the peddler?\r\n\r\n\r\nI really want to have a big family. I understand that in parenting, as in battle, no plan survives contact with the enemy, but I\u2019m low-key thinking that five children sounds good.  I\u2019m open to more, but we are not a good match if you want fewer than three kids. A dog would be nice, too\r\n\r\n\r\nI love making music. I play saxophone in a chiptune band, and occasionally strum murder ballads or Americana songs on my guitar. I used to sing baritone in choirs in and out of school and am thinking about getting back to it.\r\n\r\n\r\nI like to be outdoors and the wilder the better. Hiking and skiing and camping restore me to myself. Delight is U-shaped valleys, geologic strata, and cliff-nestled glacial lakes. Sometimes I will bring a recorder to the mountains and play songs for the forest creatures. I\u2019m a big fan of backyard chilling around a fire pit, and of road tripping to national parks.\r\n\r\n\r\nIn between all that, I read many books, drink fancy cocktails, and play games with friends. I also write, though that\u2019s new and should still perhaps be considered aspirational. I\u2019m still figuring out how to (and how much to) rebalance my time away from ephemera (socializing, outdoors, learning, travel, experiences, weak relationships) into more durable things (published work, communities, strong relationships, traditions, a family, and maybe a startup)\r\n\r\n\r\n\r\n\r\nSpicy stuff:\r\nPolitics:\r\nOnce a progressive, now I\u2019d self-describe as a classical liberal informed by cultural evolution.  Center-right, if you insist on a 1-D coordinate, but I\u2019m not attached to the label. I try (sometimes unsuccessfully) to avoid the culture war; I\u2019d rather focus on living well, controlling the things I can, and connecting to my community.\r\n\r\nReligion:\r\nI spent the last decade as an atheist and was surprised this year to discover that God is real after all. So now I\u2019m figuring out what it means to be a Christian again. I\u2019m looking for someone who is, even if not a believer yourself, then willing to live in a way informed by Christian teaching. I\u2019m still figuring out exactly what this means for me, feeling out denominations, and searching for the right community. I was raised Catholic and always loved the sacraments, the liturgy, and the high-church aesthetics, but there are some doctrinal issues that I\u2019m not sure whether I\u2019ll be able to come to terms with.\r\n\r\nSex:\r\nOpen-minded and I like experimenting, but I also don\u2019t need weird stuff to be satisfied.\r\n\r\n\r\n\r\n\r\nA relationship with me:\r\n- Monogamous marriage. I want to build a life with one other person, and make decisions as a unit of two.\r\n- Touch is my primary love language. I am very physically affectionate, and I love to receive affection in turn. We shall exchange many kisses and enjoy many cuddles.\r\n- Good communication. I try to be explicit and to over- rather than under-communicate. I am pretty good at picking up on weird emotions or social dynamics in the interest of improving/avoiding them for next time\r\n- I am gender euphoric and I think leaning into gender roles is great. That said, I\u2019ve had to learn a lot of my gender performance explicitly, like an autist. I like being the leader in the subtle leader/follower thing that develops in heterosexual relationships. Ideally, you like being the follower here, and you\u2019re willing to explicitly communicate about this stuff sometimes so we can grow better for each other over time.\r\n\r\n\r\nActivities I like doing together:\r\n- Visiting museums or galleries\r\n- Walking and talking\r\n- Outdoor adventures (hikes, campouts, ski weekends, scenic drives, etc)\r\n- Exploring and refining ideas, or critiquing books/movies\r\n- Hosting and attending barbecues and their winter counterpart, the dinner party\r\n- Traveling to new places/cities/countries\r\n\r\n\r\n\r\n\r\nWhat I\u2019m looking for in a woman:\r\n- Someone who loves learning, talking about ideas, and seeking out new ones\r\n- Someone who is kind and fair-minded\r\n- Someone who is family-oriented and ready for kids. IE, excited to be a mother, and intending to make raising a family the major ongoing project of our lives until the kids are grown. Certainly not alone! I intend to be actively involved too. But other things should be sidequests while the kids are at home.\r\n- Someone who wants to live in a Christian-informed way, meaning regular(ish) church attendance, holidays, and taking scripture seriously-but-not-literally. (It\u2019s okay with me if you believe God is literally real, as long as you\u2019re okay with the possibility that I may never quite get there.)\r\n- Someone who is politically tolerant. We don\u2019t have to agree (though it would be nice), but it deeply bothers me when someone I\u2019m close to casually and habitually treats political opponents as being uniformly stupid and/or evil.\r\n\r\n\r\nNice-to-have bonuses that definitely aren\u2019t dealbreakers:\r\n- Interest in being a housewife or stay-at-home-mom. I think this is a noble and worthy vocation, and I have the means to make it work.\r\n- Interested in making music together\r\n- Being actively outdoorsy and having a fondness for wilderness\r\n- Being sweet and sassy\r\n\r\n\r\n\r\n\r\nIf you think we might be a good match, drop me a line at kerrydatemedoc@gmail.com, and let\u2019s get to know each other! I live in Colorado but work remotely and travel frequently, so I\u2019d like to come visit you if we hit it off. I\u2019m aiming to start a family sooner rather than later, and am somewhat open to relocating for the right person.\r\n________________\r\nHere are some more photos of me. I\u2019m 6\u20193\u201d and I had long hair until this year, when I cut it off.",
