    ProfileText: "\ufeffUpdated 5 July 2024\r\nPics\r\n\r\n\r\n  \r\n  \r\n\r\n  \r\n  \r\n\r\n\r\n\r\n(All from 2022-2023)\r\n\r\n\r\nMe\r\nVital stats\r\n* 5\u20199\u201d\r\n* 34\r\n* Oakland, CA\r\n* LinkedIn, Facebook\r\n\r\n\r\nWhat I\u2019ve been thinking about lately\r\nMaybe this is kind of like having an async conversation with me, and is useful to see whether we vibe?\r\n\r\n\r\nSome things I\u2019ve been thinking about:\r\n\r\n\r\n1. That they made this \"hang out with your friends BB-8 and Chewy\" rather than straight-up cult indoctrination into the Jedi religion is unforgivable\r\n2. \u201cYou miss NaN of the shots you don\u2019t take\u201d. Wait no that\u2019s not right, it\u2019s not 0/0, it\u2019s n/0 \u2013 \u201cYou miss Infinity of the shots you don\u2019t take\u201d. Wait that\u2019s not right either, it\u2019s actually just n/n, AKA 100%, AKA the conventional saying was right all along \ud83d\ude1b\r\n3. How open should I be with various friends in various contexts? Where are the lines between sharing, exploring, over-sharing, holding things back in ways that create fun tension?\r\n4. Well shit, now that we finished the climb, we\u2019re on top of a fin of rock with cliffs on both sides \u2013 how do we get down?\r\n5. AI for epistemics is great and all, but what about AI for coordination and political stability?\r\n6. Quintal voicings on piano! And the \u201charmonic experimentation\u201d sitting down at the piano that led me to \u201cdiscover\u201d them\r\n7. Textbook, you say that isometric mappings are linear, and you show that they preserve sums. But what about scalar multiples?!? How can you just not address that at all?!?\r\nStuff I\u2019m into\r\nOutdoors/exercise\r\nI go backpacking in the Sierras a few times a year \u2013 I\u2019ve recently gotten into hiking up from the east side, going off trail, and wandering around the basins, ~as described in this excellent book.\r\n\r\n\r\nI go climbing in the gym and outside, often sport at Mount Saint Helena and occasionally trad in the Sierras.\r\n\r\n\r\nI love mountain biking when I\u2019m back home in Tucson, but I haven\u2019t bought a bike yet in the Bay.\r\n\r\n\r\nI also enjoy hiking, tennis, soccer, Spikeball, and weightlifting.\r\n\r\n\r\nOn most days I do one of the above.\r\n\r\n\r\nMeditation etc.\r\nI do concentration meditation most days, and I\u2019m in a weekly circling/relatefulness group. I used to go on meditation retreats fairly often but recently I\u2019ve been going on noble silence solo backpacking trips in the Sierras, which have been excellent.\r\nMusic\r\nI play jazz-adjacent piano. I rehearse with my band every week. Here we are playing one of my tunes, and here we are playing my arrangement of one of my favorite pop songs.\r\n\r\n\r\nI also enjoy jamming with friends and singalongs.\r\n\r\n\r\n\r\n\r\nWhat I\u2019m trying to accomplish in the world\r\nAI is rapidly getting smarter, and I expect it to have a huge impact on the course of world events in the coming years. My main professional goal is to make that impact as positive as possible. I\u2019m pursuing that goal by working at Elicit, a startup that\u2019s building an AI research assistant to do literature review. I hope that AI-assisted research can give everyone access to high quality evidence and reasoning, and help us work together to make wise decisions, agreements, contracts, and policies.\r\n\r\n\r\nRelatedly, I\u2019m an Effective Altruist:\r\n1. I used to work on alleviating global poverty\r\n2. I\u2019m ~vegetarian\r\n3. I\u2019m into some weird subcultural stuff e.g. date-me docs \ud83d\ude1b\r\n\r\n\r\nUs\r\nWhat I\u2019m looking for in a relationship\r\nI\u2019m looking for a very long-term, marriage or marriage-adjacent life partner\r\n\r\n\r\nKids?\r\nIn short: probably but flexible\r\n\r\n\r\nI can imagine living a good and fulfilling life without kids with the right partner; I can also imagine living a good and fulfilling life with kids with the right partner. The latter feels more straightforward and easier to imagine.\r\nMono vs. poly?\r\nIn short: ~mono\r\n\r\n\r\nI\u2019ve done both and both have worked for me. I lean towards ~monogamy but with flexibility so it\u2019s not a disaster if after some years we go through a spot of not being attracted to each other. Strict monogamy also OK, poly OK with the right person. I am very non-jealous, FYI\r\nPersonal qualities\r\n1. I\u2019m very loyal, I stick with friends and partners. I try hard to make things work in relationships. I\u2019d like you to be pretty loyal as well. On the flip side I hope we can both stay loyal to ourselves and only move forward with deepening a relationship if it\u2019s the right thing for each of us\r\n2. I\u2019m pretty honest \u2013 I\u2019m ~never actively dishonest, and I\u2019m more on the side of over-honesty and over-sharing than keeping things to myself. I need you to be pretty honest and ~never actively dishonest or deceptive. I\u2019d be quite interested in an excruciatingly open/honest relationship, though I\u2019m also happy with normal levels of openness and honesty\r\n3. Relatedly, I\u2019m quite interested in exploring my and other peoples\u2019 emotions/hearts/souls. I\u2019m in the middle of my journey on this one. 5 years ago I was below average at feeling, understanding, and working with feelings. I think I\u2019m now roughly average, I\u2019d like to be extremely good\r\n4. I\u2019m pretty smart. I know about lots of different domains and I\u2019m also pretty good at figuring stuff out. I\u2019d like you to also be pretty smart\r\n5. I\u2019m extremely high-openness. Probably won\u2019t work unless you\u2019re also fairly high-openness.\r\n6. I think I take in and interact with the world in my own weird, surprising, and beautiful way and I think I bring lots of joy to how I interact with myself, others, and the world. Looking for someone who does the same but in their own way\r\n7. I\u2019m trying to accomplish some stuff in the world. It\u2019s not important to me that you are, exactly, but I tend to get along better with people who are\r\n\r\n\r\nReach out!\r\nAt datebenrachbach@gmail.com\r\n\r\n\r\nFeel free to just send me a quick ping to take a look at your dating doc/dating profile :)",
