    ProfileText: "\ufeffHi! If you\u2019re seeing this, odds are you\u2019re a woman who is attracted to men and wants or is open to kids, and filtered according to those criteria on the Date Me Directory of dating docs! And if you did that, you\u2019ve probably noticed- \r\n\r\n\r\n-wow! There\u2019s a lot of people! Large number of people! Lot of profiles to look at! That\u2019s a lot of reading to do! Are you gonna read all that? Maybe not! Maybe you need to make a quick decision about whether to read any further! Let me help you out with some\r\n\r\n\r\nBASIC BIOGRAPHICAL INFORMATION\r\n* 30 years old\r\n* heterosexual(ish) man(ish) \r\n* flexible on mono/poly\r\n* 5\u201911\u201d (181cm), 190lb (86kg)\r\n* wants one or more kids\r\n* Rhode Island, USA, willing to travel\r\n* software developer, WFH, most recent salary $115k/year\r\n* atheist, ratsphere\r\n* politically like, weird complicated center-left-lib utopian\r\n\r\n\r\nOkay, cool. None of those things are dealbreakers? You want to know more? Cool. Very nice. Here\u2019s another thing that might help you make some decisions:\r\n\r\n\r\nHERE\u2019S WHAT I LOOK LIKE\r\n  \r\n  \r\n  \r\n\r\n  \r\n  \r\n  \r\n\r\n\r\n\r\nThe hair situation is less than ideal for me, as it impedes a certain wise wrestleman\u2019s sacred commandment that you gotta have blue hair, but unfortunately the family genetics are merciless in that department. C\u2019est la vie. I compensate by wearing blue everything else.\r\n\r\n\r\nAnyway, one thing that\u2019s important to me is- do you like that? Do you see that and think, \u201coh, hey, that looks good, I am attracted to that, it would make me happy to smooch that\u201d? Because, like, I dated an ace partner for a while and it turns out it does a number on one\u2019s self-esteem to not have your partner think your body is attractive. \r\nIf you do like that body, then- hey, thanks! That means a lot to me. Please continue reading this document, and maybe you will discover that it would be a good idea to interact with that body!\r\n\r\n\r\nWHAT DOES THIS GUY MAINLY DO?\r\n\r\n\r\nWell, I play a lot of video games.\r\n\r\n\r\nIf the fact that I mention this first is a red flag for you, you might wanna move on. I\u2019m not, like, the guy addicted to grinding loot in some MMO, games don\u2019t take over my life- but they are a good chunk of my cultural context. I have a lot to say about them, I grew up with them, they\u2019re a major way I connect with people, and I make them as a hobby. It\u2019s pretty important to me that my partner is someone I can talk to about the things that make me excited, and it\u2019d be ideal if you are also interested in and excited about video games. I would ideally like to be able to make my partner happy by acting the way I normally act!\r\n\r\n\r\nOf course, it\u2019s not just video games with me. I have lots of other interests! Maybe too many. I also read webcomics and fanfic and play tabletop games and watch anime, that whole cluster of very-online interests. Sometimes I even watch movies or read books! Wild stuff. When I consume media I like to discuss it to death with people, and if you also like to discuss media to death then we might be a good fit!\r\n\r\n\r\nApart from consuming various sorts of media and working my day job, I\u2026\r\n* Make video games\r\n* Draw things\r\n* Write fiction\r\n* Sort of do all three at once collaboratively (run RPGs)\r\n\r\nYou might notice a theme here wherein these are all just the production of the same things I spend the rest of my time consuming! It\u2019s an endless cycle! Dare you date an ouroboros?\r\n\r\n\r\nBut that\u2019s the main thing, isn\u2019t it? Like, what are you in for if you attach your life to mine? Because creating is important to me, and I have limited capacity to compromise on it. The prime directive is to create until nothing is left to create, and the universe bursts with an overworked sigh. The number one thing I\u2019m looking for is someone who can support that, and is happy to support that. If you\u2019re also a creative, and we can feed on each other\u2019s energy and reinforce each other- that\u2019s the dream.\r\n\r\n\r\nHOW ABOUT SEX AND RELATIONSHIP STUFF THOUGH\r\n\r\n\r\nOh jeez. Maybe you were curious about the heterosexual \u201cish\u201d in the bio? Thing is, I definitely experience heterosexual attraction strongly, but the sex bits of human bodies seem kinda\u2026 gross? The whole affair seems kinda unsanitary and unappealing. Crucially, though, I haven\u2019t tried it, and I hear it feels great despite how it looks (also you need to do it to have kids), and I\u2019m willing to take that on faith and figure out a way to have fun with it- so I don\u2019t know if I\u2019d self-describe as sex-repulsed or asexual. You\u2019re not dealing with a high sex drive but I am pretty much down for whatever.\r\n\r\n\r\nWith monogamy and polyamory- I sort of prefer poly, but not for the standard reasons. On the relationship side of things\u2026 I have clear weaknesses as a partner. I\u2019m bad at consoling and dealing with sadness, I get absorbed in ambitious projects and am jealous of my own time, so\u2026 like, if I\u2019m failing to support you in some way and you can get some backup support from someone else, great! And on the sex side of things, modern contraceptive technology exists and so I don\u2019t really experience jealousy (so long as I\u2019m not stuck raising someone else\u2019s kid). However you need to meet your relationship needs, I\u2019m happy for you. \r\n\r\n\r\nBut, like\u2026 if we really click, and we don\u2019t feel like we need anyone else, our relationship issues are surmountable the old-fashioned way, and you\u2019d prefer monogamy? I have no problem committing to that. Higher bar to clear, I guess? Like you should be really confident I\u2019m capable of being the one guy you\u2019ve got.\r\n\r\n\r\nWHAT\u2019S ON THE WISHLIST\r\n\r\n\r\nRight, you! I\u2019ve been talking mainly about me because that\u2019s the point of this, and because you are an anonymous reader I currently know nothing about, but here are some traits that I find attractive in a partner! If you have a lot of these and want to ask me out, you have good odds!\r\n\r\n\r\n   * Plays games/reads comics/watches anime/etc- we come from the same planet\r\n   * In particular, likes mysteries, comedy, and weird sci-fi- we come from the same town on the same planet\r\n   * Knows me and empirically likes the things I actually produce- we come from the same neighborhood of the same town on the same planet\r\n   * Thinks I am attractive\r\n   * Is a generally happy person- easy to make smile and laugh (my favorite things to do to people)\r\n   * Has a creative hobby of some sort- art or writing or music, a project to cheer on or help with\r\n   * Looking for a long-term relationship involving marriage and kids\r\n   * Smart in the brain\r\n   * Clear communicator, or familiar with ratsphere communication norms- has read \u201cA Human\u2019s Guide to Words\u201d, ideally\r\n   * I\u2019m not too fussed about appearances but know if you have red hair and/or freckles know that you will be rolling with advantage\r\n\r\n\r\nIf that seems good to you, you can contact me at benedictide@gmail.com!",
