    ProfileText: "\ufeffAbout me\r\n\r\n\r\n* 38 years old\r\n\r\n\r\n* 5\u20198\u201d (Don\u2019t care about your height; I\u2019ve dated women who are taller than me barefoot and I\u2019m not bothered by it. Obviously, it\u2019s okay if you have a preference.) \r\n\r\n\r\n* Based in NYC (Currently on sabbatical in Argentina and working on some personal goals.)\r\n\r\n\r\n* Agnostic/Spiritual \r\nSpirituality in the sense of my understanding of the world through what I know from science, experience, reflection, etc. Belief systems are also connected to language.\r\n\r\n* Divorced; no kids\r\nThe divorce was in 2017. The marriage was practical and beneficial to both of us. But we were also in love - so not just a practical arrangement either. \r\n\r\n\r\n   * Don\u2019t smoke (prefer that you don't, or you're trying to quit). Rarely drink (don\u2019t mind if you do).\r\n\r\n\r\nPhotos\r\n\r\n\r\n  \r\n\r\n\t  \r\n\r\n\t  \r\n\r\n  \r\n\r\n\t\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\n\t\r\n\r\n\r\n\r\nHow I spend my time\r\n\r\n\r\nFor work (as defined in the conventional sense), I do machine learning in tech.\r\n\r\nMy background is actually in applied math, which I love. I enjoy using my quantitative skills at work. But I value things outside of work a lot, in terms of how I interact with and contribute to society.\r\n\r\n\r\nI really value expression in life, whether it\u2019s through the written word or through movement. Some of my interests:\r\n\r\n\r\n   * Dance: It\u2019s been a non-trivial part of my life for at least a decade now. I\u2019ve always been moved by music (although I didn\u2019t have the chance to learn music/dance formally growing up). And being able to express music is what I love the most about dance.\r\n\r\n   * Movement practice like yoga, fitness classes and aerial hoop (this is my latest obsession as of a year ago - I always try to have some things that are hard for me to keep me humble and motivated to grow, and some things where I can feel good about myself).\r\n\r\n   * Written words: I love to read (when I can these days) and write creatively. Within fiction, I love any flavor of existentialism.\r\n\r\n\r\n      * Tennis. Really any racquet sport: ping pong, badminton, pickleball (I gave in)\r\n\r\n      * Cooking: I cook for myself and love what I make for myself more than any restaurant food.\r\n\r\n\r\n         * Travel: I\u2019ve traveled a lot, both solo and with partners. There\u2019s a wide variety of things that interest me: foreign cultures, nature, road trips.\r\n\r\n\r\n         * Volunteering: a bunch of different things from children\u2019s health and education to homelessness and food security. \r\nRelationship stuff\r\nThings I value\r\n(both in others and about myself)\r\n\r\n\r\n         * Empathy: I just want to be around people who care about others. I\u2019m empathetic and it\u2019s so easy for me to care about my partner in long term relationships. It\u2019s nice when we can look out for each other in our own ways and our strengths can be complementary. Two people thinking for both!\r\n\r\n\r\n         * Authenticity/sincerity: I just like being myself and I appreciate people who can just share time with me and maybe we see through each other a bit during the time we interact. It\u2019s what I enjoy in any kind of connection, even non-romantic ones.\r\n\r\n\r\n         * Open-minded: I mean in the sense of questioning your own assumptions about life. I\u2019m curious about the deep stuff in life and am very aware that all of my beliefs are also connected to my personal experience and that a new experience or a new rational argument has the potential to change that belief. I may have a high confidence about some of my beliefs based on what I\u2019ve experienced, but I\u2019m always open to learning a different perspective even it that doesn\u2019t make sense to me at that time.\r\n\r\n         * Communication: I think it really goes both ways. This is the mental model that I want to keep in mind for myself:\r\n            * As a speaker, I try to express my needs trying my best not to hurt my partner.\r\n            * As a listener, I have to be ready to hear the hard stuff without taking it as a judgement about myself.\r\nBoth are hard and I know I\u2019ll fail a lot. But it\u2019s a kindness practice the same way I work on exercising my body. In the end, everything is negotiable.\r\nDating style\r\n\r\n\r\nIf we decide we might be a match, I'd prefer to do a brief video chat or a quick coffee date sooner rather than messaging back and forth. I'm sure you're great, but until I know you, I like to prioritize my little free time for my hobbies and with my real life communities. I\u2019m happy to answer anything specific that\u2019s missing here before we connect further.\r\nRelationship style\r\n            * I prefer monogamy, but as I said about anything within a relationship, this also falls under something that\u2019s negotiable.\r\n\r\n\r\n            * Sex is an important part of the relationship but all the values I think are important for a relationship as a whole are the important aspects here as well: Communicating needs, trying to listen without judgement, etc. GGG as the kids say.\r\n\r\n            * Intimacy: Physical touch, showing affection with touch and spending time together with non-sexual intimacy are also very important to me. I don\u2019t need all of these to be important to you as well, but if it\u2019s difficult for you to express through touch, I\u2019d miss that non-verbal communication.\r\nKids\r\n               * I don\u2019t have any kids yet. \r\n               * I love kids and I\u2019m good with kids. (I have volunteered, and still do, in programs with kids and also with kids/adults on the spectrum.)\r\n               * I\u2019m open to having kids.\r\n               1. If my partner is sure about not wanting kids, it\u2019d be far easier for me to choose that option.\r\n               2. I think planning to have kids is a promise to the life that you decide to bring into the world. I think it\u2019s a responsibility that you decide to take on as a couple very consciously when the relationship is in that place.\r\nHow to reach me?\r\nWrite to me \r\n               * if you think we might be a good match, or\r\n               * if something about my profile resonated with you and you\u2019d like to talk about it even if you don\u2019t think we\u2019re a good match.\r\n\r\n\r\nEmail: karthikeyan.rajendran@gmail.com\r\nText: 609 613 2710",
