    ProfileText: "\ufeffWELCOME TO MY DATE DOC!\r\nI made this mostly for fun and to meet new people, but if I happen to meet the right girl, I promise I will work to make you feel loved, appreciated, and happy. After all, isn't that what life is about?\r\n\r\n\r\nI'll try to update this document with any potential changes.\r\n\r\n\r\nStats: \r\nName: Kyron\r\n\r\n\r\nAge: 23\r\n\r\n\r\nEthnicity: Black/African-American\r\n\r\n\r\nLanguages: English (fluent), Spanish (very beginner but I REALLY want to learn)\r\n\r\n\r\nHeight: 5\u20194\r\n\r\n\r\nPersonality: Somewhat shy, but Also somewhat confident. Smart, sarcastic, but caring and kind. Introvert.\r\n\r\n\r\nBio:\r\nHi! My name is Kyron! I'm currently in Peoria, Illinois, but my family lives in Chicago. I am also looking for work in Chicago at the moment as well.\r\n\r\n\r\nI am a college graduate with a degree in Game Design (what a useful degree, I know). I have a fair amount of skills/hobbies: drawing, coding, skateboarding, and gaming to name a few.\r\n\r\n\r\nI'm generally pretty kind, thoughtful and some consider me funny, but some are probably wrong. I try my hardest to be very caring, but I'm also introverted and can occasionally slow down a bit due to low social battery. Hopefully anyone that would be interested can understand.\r\n\r\n\r\nWhat I'm Looking For:\r\nI'm searching for a 21 - 24yo female (Cis), with an open mind and a kind heart! I'm quite left-leaning politically, so I'd want a girl to be the same, although I'm open to different perspectives, to a point. \r\n\r\n\r\nI am dating with intention, but I also prefer a slower style of relationship building so I can see if things can really work out.\r\n\r\n\r\nLikes: \r\n* Skateboarding, drawing, coding, deep or political talks, cuddling, occasional silence, exploring, fun small dates (boba, coffee, libraries, bookstores, museums), music, video games, manga/anime (trying to get back into these)\r\n\r\n\r\nDislikes: \r\n* Overly loud people (occasionally this is fun, especially for a joke), unrealistic expectations, unclarity of intentions, hyper-aggression, bigotry, overly traditional roles, large parties or clubs\r\n\r\n\r\nDealbreakers (Absolutely Must NOT Have):\r\n* Super religious, sorry.\r\n* Right-leaning, or believe in racism, genocide, sexism, homophobia, Ect.\r\n* Smoker of any kind or Heavy drinker.\r\n* Aggressive, particularly enjoys fighting or arguing.\r\n* Unreasonability/No communication.\r\n\r\n\r\nPreferences (Nice to have, but not necessary):\r\n* Belief in communication to solve problems.\r\n* College education of some kind\r\n* Ethnicity different to mine (I really like learning about other cultures/people)\r\n* Knowing multiple languages\r\n* Likes cuddling/physical affection\r\n* Thinner-medium body types (No shame to bigger girls!)\r\n* Somewhat athletic\r\n\r\n\r\nFuture Plans:\r\nI generally go with the flow of life, but I do aim to work hard at being a software developer, preferably for video games. Things may be uncertain in the near future, but hopefully you will encourage me through it!\r\n\r\n\r\nOther things that may be important to you:\r\n\r\n\r\nI am all about transparency. So I will share some things about me that may be of importance.\r\n\r\n\r\n* I have an ex that I am still good friends with. I don't have any romantic feelings towards them anymore, something broke in me after we broke up and I just couldn't go back.\r\n\r\n\r\n* I do like sex, but I don\u2019t think this should be the basis of a relationship, merely an element of it. That said, if you're into something you feel is embarrassing or strange such as kinks or fetishes, please share it with me! I'm very open in this regard and not judgemental!\r\n\r\n\r\n* I do not like pressuring others into doing things. Please be upfront to me about what you want and what you don't. I want to have a functional and supportive relationship.\r\n\r\n\r\n* Kids. I'm not sure if I want kids just yet\u2026 But\u2026 I am open to the idea. The main issue is that I want to be able to provide for a family. I don't think it's right to bring a kid here, just to have it struggle. Ultimately, if you really want kids, I'll probably give them to you, just don't make this decision carelessly.\r\n\r\n\r\n* I've stated I'm introverted before. I think I should say that if I happen to randomly check out or dissociate, it's not me ignoring you, but rather I'm probably just a lil tired.\r\n\r\n\r\nContact:\r\n\r\n\r\nDiscord: kyron54 - primary messaging \r\nEmail: bluekeshon79@gmail.com \r\n\r\n\r\nPictures!",
