    ProfileText: "\ufeffDate me: Jacob\r\nHello! Here is a picture of me looking to the left of your screen. Position a bright light there if you want to bring the photo alive.\r\n  \r\n\r\nI\u2019ve put more pics at the bottom. Now for some words  \u2193 \u2193 \u2193\r\n(Did this guy really copy this over from a spreadsheet?)\r\n(This works better viewed landscape on phones)\r\n\r\n\r\nOk cool. Welcome to my document. Welcome to Zombo.com my date me.\r\n\r\n\r\n\tAge\r\n\t36 (Aug 1988)\r\n\tLocation\r\n\tHastings, UK (this is ~1h20 \u2013 2h from London by direct train)\r\n\tHeight\r\n\t178-179cm, depending what time you measure me. (We\u2019re taller in the mornings.)\r\n\tJob\r\n\tI'm a freelance web analytics consultant. I've been doing this for over five years (funnellmarketing.com).\r\n\tRelationship type\r\n\tMonogamy or monogamish fit me well.\r\n\r\n\r\nI've got experience in:\r\n- Long-term (up to 3 years+) monogamous\r\n- Long-term (3 years+) open relationship\r\n- Meaningful but non-exclusive connections with people who live a long way away; swapping visits\r\n- Steady friends with benefits\r\n- Mostly just friends unless we're feeling it\r\n\r\n\r\nI've never been married/engaged or done totally random hookups with someone I\u2019ve barely talked to. I need some sort of connection. \r\n\r\n\r\nIf I really fall for someone, then I lean heavily in a monogamous direction, especially romantically.\r\n\r\n\r\n\tMyers-Briggs (yes I'm aware this is probably more akin to astrology than science, but some people find it indicative :))\r\n\tINTJ (but this varies owing to its inherently low reliability). \r\n\tBig Five\r\n\tAccording to the scientific gold standard of \"random internet test\", I'm high for Openness to new experience and Agreeableness, and moderately high for Extraversion, Neuroticism, and Conscientiousness.\r\n\r\n\r\nSome of these are very mixed, however \u2013 I'm not prone to anxiety, but I do think quite a bit about the consequences of my actions. I take doing what I said seriously, and I\u2019ve owned literally all areas of my work life entirely alone for over 5 years, but I'm more inclined to be a little disorganized. \r\n\r\n\r\nExtraversion here is also covering the fact I am the classic \"best one to one/very small groups, likes time to recharge\" introvert. But at parties/conferences, I actively approach and talk to new people.\r\n\r\n\r\n\tInteresting link so even if you don\u2019t like this profile, you get something out of it\r\n\r\n\r\n\tEvery Noise at Once\r\n\tWhat I'm looking for\r\n\tI'd like to find a long-term partner, and that's my main goal and my main priority. I want something I can invest in over the long term.\r\n\r\n\r\nI'm also happy with just about any other kind of connection, including new friends. \r\n\r\n\r\nAs I live in Hastings, and most potential people live in London, I'd be happy to swap visits (I love showing Hastings to people) or meet halfway. \r\n\r\n\r\n\tKids\r\n\tGenerally lean towards wanting them. Not a deal breaker.\r\n\r\n\r\n\tThings I like to do\r\n\tI like:\r\n- Learning new things. I find so many things interesting it's hard to delimit it, but recurring themes are \r\ni) how and why do people do what they do? \r\nii) how did things and people come to be the way they are?\r\niii) what will the future look like?\r\n\r\n\r\nI also like taking an interest in things for the sake of it. Architecture, natural history, art, fossils etc etc. It doesn't have to be part of some grand narrative or project to understand the world. If I have a superpower, it\u2019s knowing something about a lot of things.\r\n\r\n\r\nSome books I\u2019ve liked: Superforecasting, Giovanni\u2019s Room, Science Fictions, Permutation City, The Grapes of Wrath, Being Mortal, The Precipice, Flights, The Book of Trespass, Radical Markets, How Music Works, The Gift of Fear, Deep Work, How Pleasure Works, Moral Tribes, Moral Origins, A Short History of Nearly Everything, Why Have There Been No Great Women Artists?, The Routledge Companion to Ethics, Stories of Your Life and Others, The Poetry of Sex, Wild Nights, Shroom, Intuition Pumps & Other Tools for Thinking, Writings on an Ethical Life, Three Men in a Boat\r\n\r\n\r\nSome podcasts I like: Astral Codex Ten, More or Less, Making Sense, Rationally Speaking (RIP), The Happiness Lab\r\n\r\n\r\n(Listing any of these does not imply a particular level of concordance with the conclusions of their authors/hosts.)\r\n\r\n\r\n- Hiking & wild camping. Every year I do one 1 week+ walk and I'll do numerous shorter self-guided walks with maps. I've got a knack for finding secret or little-visited places, even in the south-east of England. My longest so far was walking from Kosovo -> Montenegro -> Albania and back; I have a two week traverse of some islands in the Arctic Circle planned for 2024 [edit: done this! It was beautiful. And boggy], and another traverse of a mountain range in Spain. I take a lot of care to tailor what I do to my company, so don\u2019t fear if these sound intense. I can be very happy doing a shorter amble through the countryside.\r\n\r\n\r\n- Friends and family. This is one of the best things about my life. I\u2019ve developed a higher-than-average number of close friendships that I work actively to maintain, and I\u2019ve developed new close friendships right into my 30s. I have an exceptionally good & close relationship with my immediate family. My closest friends are all highly agreeable, intelligent and curious people.\r\n\r\n\r\n- Running. Trying to get my half-marathon time down. It\u2019s useful. You never know when you might need to run 20k to catch a bus.\r\n\r\n\r\n- Gigs and live music. I see a bunch of local/UK bands as well occasionally seeing something truly international. My taste is super broad but rock, metal, and folk would be my core genres.\r\n\r\n\r\n- Cooking. I make food from plants; I\u2019ve been mostly vegan for 6+ years. I have like 100+ ingredients, I enjoy trying things that take work to get the ingredients/recipes for (I\u2019ve translated a few). I like novelty.\r\n\r\n\r\n- Learning French. I got my B1 certificate ages ago, currently in the push to get to B2 and I want to pass the exam by the end of 2025. I\u2019m currently making every francophone I meet speak to me in French. So I\u2019ve got about 35% more misunderstandings happening in my life than usual right now, sacr\u00e9 bleu !\r\n\r\n\r\n- Learning more about myself. I\u2019m an analyst by trade. I collect data about myself every day, I journal, I try to improve and figure out my personal operating manual.\r\n\r\n\r\n\tEA and rationalism\r\n\tI've got a decent background in both worlds. I\u2019ve read a bunch of the core books, blogs and communities. I've been to multiple conferences and have a few friends in the space. My involvement peaked between 2015-2018 when I ran my local EA city group.\r\n\r\n\r\nI think \"EA adjacent\" best covers where I am now. I appreciate it a lot if people are interested in some of the core things that motivate these movements, even if they're not directly involved in them.\r\n\r\n\r\nOn the other hand, if EA/rationalist framings are your exclusive way of really encountering and thinking through things, I may not be what you're looking for. I am more fox than hedgehog.\r\n\r\n\r\n\tAbout you\r\n\tI find all of the following really attractive:\r\n- Curiosity. I mean a real ranging curiosity. The kind that stops you in your tracks, literally or figuratively. A sense that you really do just have to know more.\r\n- Independence. You have your own projects going on. You like to do your own things.\r\n- Playfulness. Silliness. The older I get the more value I put on this.\r\n- Rigour (when needed). Following a line of argument is really hot?\r\n- Intelligence.\r\n\r\n\r\nI'm looking for someone roughly between 26-42, although I'd consider people outside of this if it really made sense.\r\n\r\n\r\n\tHow to get in touch/ask questions etc\r\n\tDrop me a message! jacobREMOVETHISANTISPAMTEXTarthurfunnell@gmail.com\r\n\tMore pictures!  \r\n  \r\n\r\n\r\n\r\nAnd shameless pic with a dog:",
