    ProfileText: "\ufeffKyle West Date Me Doc\r\n  \r\n\r\nHello all! I\u2019m trying out this new approach to a dating profile in the hopes that it allows me to paint a fuller picture of who I am and what I\u2019m hoping to find in a girlfriend and, God willing, a future spouse. I\u2019ll leave my contact info below; if you think we might be a good match, please feel free to reach out. Alternatively, if you are reading this and think I might be a good fit for someone you know, I would appreciate it if you passed the doc on!\r\n\r\n\r\nA Bit About Me\r\nI\u2019m 32 and live in the greater DC area. In the past year I finished my Ph.D. in Ancient History and started a new job teaching Classics at my undergraduate alma mater, a small Christian liberal arts college. I love introducing my students to the fascinating other world that is ancient Greece and Rome (fair warning, I\u2019m told I can overshare a bit when it comes to the details of my favorite subjects. \ud83d\ude42) Contributing to college students\u2019 growth and success at this crucial stage in their lives is a major component of what drives me. I also have a strong desire to publish books that will advance scholarship in my field. My dissertation looked at ways that Romans thought about disability and incorporated (or failed to incorporate) people with disabilities into their society.\r\n\r\n\r\nI am a practicing Christian in the Lutheran Church Missouri Synod and, though not always perfectly, I try to make faith the bedrock of my life. I had a journey from a Baptist background in my childhood into the Lutheran tradition, and my commitment to that theology is important to me. However, it\u2019s certainly something I am happy to discuss as I get to know someone. I hope you find theology a stimulating discussion topic on dates! My hope for a partner is that we could build a family, including kids, that centers itself on Christian worship. This would shape many of the rhythms of our home life, and it would also mean putting down deep roots in the local congregation. If I had to pick the most important thing I am looking for in a spouse, it would be someone who also finds this vision compelling.\r\n\r\n\r\nOne last thing I think it is important to be upfront about; my interest in studying disability is rooted in personal experience. I was born with cerebral palsy, a physical disability that impacts my mobility and motor coordination. I use a mobility scooter to travel longer distances outdoors, and a cane off-and-on when I walk. I do have to adapt to some unique challenges, but with hard work, support from the ones I love, and the grace of God, I have built a life that I\u2019m very thankful for. One of the Biblical passages that holds the greatest meaning for me comes from John chapter nine. Jesus says about a man born blind that it was not because of \u201cthis man\u2019s sin or his parents\u2019, but that the works of God might be displayed in him.\u201d\r\n\r\n\r\nMom and Dad\r\n  \r\n\r\n\r\n\r\n\r\n\r\n    \r\n\r\n\r\nMy Interests\r\n* Classic literature\r\n* Fantasy and sci-fi (These first two items together make for fairly eclectic tastes. I\u2019m the sort of person who might simultaneously be reading a Star Wars Expanded Universe novel and Anna Karenina. \ud83d\ude1b\r\n* Games (almost any genre and format, board, video, party, take your pick)\r\n* Live theater (both attending and performing, especially Shakespeare)\r\n* Travel (especially to historically significant locations, and especially in Europe)\r\n* Movies and TV (Some favorites, It\u2019s a Wonderful Life, The Lord of the Rings, The Wind Rises, \u201cChuck,\u201d \u201cCommunity,\u201d \u201cStranger Things\u201d)\r\n* Dogs (specifically, wanting my own golden retriever since about the age of six is pretty much a core memory.)\r\n\r\n\r\nMy Strengths as a Partner\r\n* Strong Sense of Loyalty and Duty: This one is very much a value inherited from my Dad. If we are committed to each other, I will stick by you. This is true when it comes to my friends, but I\u2019m also confident it will be true towards my wife. And specifically in a marriage, I will strive to live by the knowledge that my calling is to lay down my life in service to you.\r\n* Unflagging Romanticism: If our relationship takes off, I will write you poetry at some point. \ud83d\ude42\r\n*  I Love Sharing What I Love: Basically, nothing makes me happy quite like helping others fall in love with things I think are awesome. My family pokes fun at me sometimes because of how much I like to watch people\u2019s reactions when I introduce them to things. And I make it a point to show that same enthusiasm when people I care about are sharing their interests. If we have the chance to date, I hope I\u2019ll experience something new thanks to you!\r\n* Intellectually Stimulating: If you value book smarts and good conversation, you could do worse. \ud83d\ude42\r\n\r\n\r\nWhat I\u2019m Looking For\r\n* Someone who will help me grow in my faith.\r\n* Values family; eager to have kids.\r\n* An empathetic and kind orientation towards others; practices hospitality, such that together we\u2019ll be able to be a blessing to my students and our community.\r\n* Intellectually Stimulating: My ideal romantic partner is also a partner in learning and conversation: we should help each other reach new heights intellectually as well as spiritually.\r\n\r\n\r\nIf you\u2019ve made it this far, thanks for giving my slightly long-winded thoughts your time. \ud83d\ude42 My email is kyle.west@wheehaa.com. If, perhaps, you are intrigued, I look forward to hearing from you!",
