    ProfileText: "\ufeffNice to meet you! I\u2019m Nita\r\n32 | female | 5\u20195\u201d | Atlanta, GA (location agnostic) | seeking camaraderie & companionship\r\n________________\r\n\r\n\r\nThe Essentials  \r\nOn a mission to build community with other open-minded, interesting individuals\r\n\r\n\r\nAlways asking questions, endlessly curious\r\n\r\n\r\nBeing resourceful and interdisciplinary, enjoy drawing from multiple domains to solve problems, embracing epistemic humility\r\n\r\n\r\nPrioritize considerations of harm/care above other moral foundations like ingroup, authority, or sanctity  \r\nPrefer people that are kind rather than nice. Nice is telling me what I want to hear; kind is telling me what I need to hear. The former prioritizes keeping the peace while the latter prioritizes growth and accountability.\r\n\r\n\r\nMore of a slow burner than a spark chaser. I like to establish a strong foundation of friendship and get to know someone well prior to anything else\r\n\r\n\r\nLove to laugh. My sense of humor can be characterized as witty, punny, and/or eccentric\r\n\r\n\r\nDetermined to reduce sentient suffering through chronic disease treatment and prevention, precision medicine, and microbiome research\r\n\r\n\r\nAlways up for good conversation, civil debate, or a walk in the park! Prefer experiences to things\r\nThe Nice-to-Haves  \r\nIntrigued by both the arts and sciences: Consilience is a personal life philosophy, along with Sagan\u2019s \u201cPale Blue Dot\u201d\r\n\r\n\r\nGrowth mindset: Person in progress, perpetually in beta, like to learn by trial and error, constantly iterating\r\n\r\n\r\nFinding common ground with people of all walks of life: I believe there is something to be learned from everyone we meet and want to avoid the trap of living in an echo chamber or falling prey to confirmation bias\r\n\r\n\r\nCook most meals at home, albeit to manage disease symptoms and with a limited repertoire\r\n\r\n\r\nDon\u2019t take myself seriously: Life is short, why waste valuable time on public opinion? But I still value constructive criticism!\r\n\r\n\r\nPassionate about minimalism, stoicism, and intentional living\r\nResilience would probably be my dominant trait; I\u2019ve endured more chronic illness suffering than most people see in a lifetime  \r\n\r\n\r\nEnjoy banter, improv comedy, DIY, Tiny Desk concerts, scicomm, podcasting, & trivia\r\n\r\n\r\nOpen to children and adoption, strong nurturing instincts\r\nThe \u201cNeeds Work\u201d\r\nAmbition outstrips physical limitations\r\n\r\n\r\nHealing from trauma related to medical gaslighting, neglect, & abuse\r\n\r\n\r\nPredominantly secure attachment style but can display anxious traits, such as trouble advocating for myself and voicing needs and limitations during bouts of severe illness\r\n \r\nNot too comfortable with large crowds on account of dysautonomia, potential for mast cell triggers, and the social isolation that accompanies chronic illness\r\n\r\n\r\nChronic illness affects my daily life in many ways. Most prominently, my energy is limited, I experience 24/7 pain, and maintain a somewhat small radius.\r\n\r\n\r\nWhile this may change in the future, I currently can\u2019t meet people for coffee or drinks and prefer walking through nature or doing something outdoors as alternatives.\r\nA Few Favorites\r\nBooks\r\nNonfiction\r\nConsilience, The Structure of Scientific Revolutions, Pale Blue Dot, Burn: The Misunderstood Science of Metabolism, Exercised, A Brief History of Time, The Rest is Noise, Thinking Fast and Slow, Attached, The Trouble with Passion, Getting Things Done, Nonviolent Communication\r\nFiction\r\nSix Degrees of Separation, The Sound and the Fury, To the Lighthouse, The Phantom Tollbooth, Tuck Everlasting, Invisible Man, Rosencrantz and Guildenstern are Dead, Waiting for Godot, Who's Afraid of Virginia Woolf, A Tree Grows in Brooklyn, Franny and Zooey, Frankie and Johnny in the Clair de Lune, Far from the Madding Crowd, Letters to a Young Poet, Calvin & Hobbes\r\nMovies (partial to coming-of-age stories and documentaries)\r\nAkeelah and the Bee, Jumanji, Dead Poets Society, Good Will Hunting, Back to the Future, The Sound of Music, The Rainmaker, A Few Good Men, The Shawshank Redemption, Matilda, Say Anything, The Illusionist, Stand and Deliver, Critical Thinking, School of Rock, Dangerous Minds, Freedom Writers, To Sir With Love, The Imitation Game, Theory of Everything, Pi, Hidden Figures, On the Basis of Sex, Queen of Katwe, Little Man Tate, The Hate U Give, The Color of Friendship, Hala, Coda\r\nMusic (will listen to nearly any genre or language)\r\nRosal\u00eda, Sad\u00e9, 112, New Edition, Jacob Collier, JoJo, M\u00fda, Chloe x Halle, Arooj Aftab, Fleetwood Mac, Ludovico Einaudi, Bond String Quartet, Maldita Nerea, Seal, Dave Koz, John Tesh, Vivaldi, Dave Matthews Band, U2, Sting, The Police, Sarah McLachlan, R.E.M., Duran Duran, Rolling Stones, Metallica, Nirvana, Pink Floyd, Death Cab for Cutie, Within Temptation, Regina Spektor, The Doors, Sara Bareilles, Simon & Garfunkel\r\nTelevision Series\r\nLessons in Chemistry, Dark Matter, Big Bang Theory, Young Sheldon, Good Trouble, The Chase, Cosmos: A Personal Voyage, Gentefied, Superstore, Speechless, Friends, Loot, Little Fires Everywhere, Little Voice, Swagger, Las Azules, Normal People, The Queen\u2019s Gambit, Jeopardy!, Whose Line Is It Anyway?\r\nPodcasts & YouTube Channels\r\n3blue1brown, Primer, Physionic, Veritasium, Kurzgesagt, Sabine Hossenfelder, Vox, More Perfect Union, Johnny Harris, Diary of a CEO, The Proof with Simon Hill, Elizabeth Filips, Jay Clouse, Big Think, Heidi Priebe, guitaro5000, The Well, What I\u2019ve Learned, Answer in Progress, Nick Norwitz\r\nSchools of Thought, Ideologies, Values, Interests (loosely held)\r\nAutodidacticism, minimalism, polymathy, multipotentiality, compatibilism, intersectional feminism, universal basic income, disability policy reform, patient advocacy, systems biology, network medicine, healthspan extension, 80,000 Hours\r\nJust for Fun\r\nParticipated in SSC\u2019s 2019 Annual Adversarial Collaboration Contest\r\n\r\n\r\nAttended in-person Jeopardy! auditions and met Sarah from the Clue Crew\r\n\r\n\r\nConsiderably double-jointed\r\n\r\n\r\nDropped out of college due to health challenges\r\n\r\n\r\nI don\u2019t put much stock in personality tests, but MBTI deems me an INTJ-turned-INFJ, Enneagram pegs me 4w5, analyst according to DiSC, and a questioner (someone who fulfills internal but not external expectations) in the four tendencies framework\r\n\r\n\r\nIf anything here resonates, I\u2019d love to get to know you! (Yes, I\u2019m one of those people who has a song for everything)\r\n\r\n\r\nLinkedIn | Substack | Email",
