    ProfileText: "\ufefff  \r\n\r\n\r\nHey, I\u2019m Ariane, a 43-year-old singer-songwriter and author. Don\u2019t get ideas, I\u2019m not swimming in a bath of cash like Taylor Swift and JK Rowling, though watch this space.\r\n\r\n\r\nI live in East London: breathtaking sights I have seen here include a man throwing up in a bin, and a grotty sofa which seems to have permanent residency, which I have dubbed the Sofa of Shame. I bet you can\u2019t wait to visit my area. This isn\u2019t a euphemism.\r\n\r\n\r\nI\u2019d like to date someone aged 35 to 55 who is kind, funny, honest, respectful, smart and communicative and doesn\u2019t throw up in bins.\r\n\r\n\r\nIt would be great if you\u2019re tolerant of grumpy teenagers, as my professionally sarcastic daughter turns 13 this year. She is currently majoring in eye rolls, sighs and slammed doors. She is also super-smart, hilarious and very sweet. I see her 50% of the time; the other 50% she\u2019s with her dad and stepmum.\r\n\r\n\r\nThings I enjoy: witty repartee, long conversations, jokes, reading the papers, reading fiction, self-development books, Apple Fitness+ and Apple products, tea in bed, walks, coffee shops, cinema, comedy gigs, interior design, meditation, hanging out with friends, and yoga (I have mastered the fine art of not farting during classes).\r\n\r\n\r\nAs you can see from the blurry photo below, taken today, I\u2019m currently slightly plus-size (yes, this is a nice way of saying fatty boom boom) though my New Year\u2019s resolution is to lose all the weight. In mitigation, I have a pretty face, which will look all sad if you don\u2019t want to date me because I\u2019m temporarily horizontally-challenged.\r\n\r\n\r\n  \r\n\r\n\r\n\r\nI\u2019m 5\u20192\u201d and mixed race (half-Persian, half-American). My daughter looks white, so I call her my Secret Asian. I\u2019m a Londoner but also hold US citizenship, so I get to vote against Trump this year, which will be the best vote I ever cast. I\u2019m monogamous. I\u2019m also cis (she/her), an atheist, liberal, and an LGBT+ ally. I have several amazingly kind and funny close friends, both female and male, and an exciting, busy and fulfilling life. I\u2019m just missing someone lovely to share it with.\r\n\r\n\r\nI\u2019m intelligent (Countdown champion and Brainteaser winner), amusing (if you don\u2019t think so by now, there is no hope for me!), creative, ambitious, and this all feels like blowing my own trumpet (speaking of which, I play five instruments but that isn\u2019t one of them). I have my own Wikipedia entry but still want to achieve much more, including a number 1 pop album under my artist name Ariane X. I\u2019m signed to a tiny record label and am releasing my debut album Better in July 2024. I absolutely can\u2019t wait as I\u2019ve wanted to be a pop star since I was 12 years old. Yes, I\u2019ve left it a bit late.\r\n\r\n\r\nI tend to like people who are thoughtful, creative, kind, funny, interesting and interested in others, good listeners but also willing to open up. Communication is really important to me - ideally we\u2019d text a lot, but I\u2019ll allow you breaks to go to the toilet. (This is a joke! Do not screenshot it and post it on Twitter with the red flag emoji.)\r\n\r\n\r\nOne of the nicest things about life is unexpected pleasant surprises, so if I intrigue you then do get in touch. I start my day by completing every single New York Times puzzle: maybe you\u2019d like to do them with me? \r\n\r\n\r\nariane.sherine@gmail.com / Twitter: @ArianeSherine",
