    ProfileText: "\ufeffBasics\r\nGender: M\r\nAge: 33\r\nLooking to Date: F\r\nOpen to: Long term, short term, friends\r\nLocation: San Francisco (south beach)\r\nHeight: 6\u2019\r\nThis Doc Created: Dec 30, 2023\r\nMe\r\n\r\n\r\n  \r\n  \r\n  \r\n  \r\n\r\n\r\n\r\nDate me doc that my ex made for me after we broke up about 1.5yr ago (she wants kids and I don\u2019t)\r\nLife\r\nI grew up in Berkeley, Ca, and if you listen very carefully you can still hear the granola crunch. Until recently, I\u2019ve always lived in co-ops and group houses (5+ people), and really love most things about group living. I recently moved to my own place, but still value this sort of community and try to stay involved with group houses where I\u2019ve lived in the past.\r\n\r\n\r\nI really like being active outdoors. In the past that\u2019s involved a lot of cycling, especially mountain biking. These days I still bike almost everywhere I go, but tennis is my go-to physical activity.\r\n\r\n\r\nI\u2019m vegetarian and reduce my consumption of animal products where convenient: I don\u2019t buy milk or eggs, but I don\u2019t worry about products that contain them (particularly with dairy), and do eat some cheese.\r\nWork\r\nCurrently, I work at an AI company because it seems like helping AI go well (or rather, helping it not go poorly) is potentially very impactful. I care a lot about my work because of this.\r\n\r\n\r\nHow I got here: I studied physics because it was interesting and I value humans understanding the world. In grad school I found out that doing good was so neglected that you could save a life for a few $k. I took a job with a highish ability to donate while figuring out what to do next. GPT-3/scaling-laws happened next, and I decided that\u2019s what I could be most useful doing.\r\nYou (long term partner)\r\nI\u2019m a rather rational, analytical person and I think I\u2019d like to find someone who is as well, but also someone who\u2019s kind and cares about the welfare of others.\r\nUs (long term partner)\r\nIn previous long-term relationships (most recently 6yr), I\u2019ve really enjoyed having someone to cook a quick meal with after work, then get outside with for a tennis match or bike ride, and finally cuddle up to half a movie, back rubs, or just reading and chatting. I\u2019m pretty affectionate, and physical contact and emotional warmth are important to me.\r\n\r\n\r\nEventually it\u2019d be amazing to face life as a team, optimizing jointly for what\u2019s best for both of us. We\u2019d support each-other\u2019s growth where wanted and work together towards being the people each of us wants to be and living the lives each of us wants to live.\r\nKids\r\nShort version: no kids\r\n\r\nLong Version: I don\u2019t want kids any time soon, and I\u2019m more comfortable committing to not having kids than to having them. The rest of this decade is potentially a particularly important and crazy time for the world, and I\u2019m not totally sure what my life or the world will look like afterwards. Depending on what the world looks like in ~2030 I\u2019m potentially open to kids then.\r\n(Non)-Monogamy\r\nI\u2019ve been in various mono/open relationships in the past and am open to most relationship types as long as there\u2019s clear and open communication about it. The important thing to me is finding the right person.\r\nContact\r\nI\u2019m <wampiter at gmail dot com> and facebook.com/wampiter",
