    ProfileText: "\ufeffDate Me | Puja Gandhi (last updated 12/2023)\r\n\r\n\r\nHi There!\r\n \r\nI\u2019m looking for a life partner, and decided to make this longer-style profile as a means to better articulate who I am, what I\u2019m looking for, and maybe I find my human along the way \ud83e\udd1e\r\n\r\n\r\n  \r\n   \r\n\r\n\r\nTLDR: Fairly traditional, 37 y/o female (5\u2019 2\u201d) looking for someone who is kind, family-oriented, prioritizes being outdoors/being active, who strives for balance in life while also being somewhat ambitious. I was born and raised in the US and am a US citizen. \r\n\r\nYou can find more photos of me and my highlight reel on my instagram (I\u2019m an infrequent user)\r\n\r\n\r\nMe\r\n\r\n\r\nI\u2019m a Texas Native currently \u2018living\u2019 in Seattle, Wa. I say \u2018living\u2019 because my mailing address and company I work for is based in Seattle, but I also live/work remotely from other locations. I\u2019m a bit of a minimalist in the sense that I live out of a carry-on and checked bag for the most part and keep my other things (think ski gear/tents/sleeping bag/etc) in storage. I have been living in short term rentals post-pandemic and I like the flexibility and cost-savings this lifestyle provides (for now, not forever). \r\n\r\n\r\nAs for education/career; I have a Master\u2019s degree in Analytical Chemistry (proud PhD dropout), and I no longer do anything chemistry related \u2013 I now work as a product/program manager for a remittance payments company. The work is meaningful to me and pays me enough to live a comfortable lifestyle that is flexible without an excessive amount of stress. I suppose you could say I \u2018designed\u2019 my career path to be this way (you can see about the unconventional path I took on my linkedin). I\u2019d eventually love to have children, and I\u2019d like to be a present/active mother, so I chose this career path to allow me more time to care for those close to me whom I love. \r\n\r\n\r\nOutside of work, I have so. many. hobbies. In the winters, I teach skiing at a local ski resort outside of Seattle. I don\u2019t mean the \u2018cool\u2019 downhill skiing, but I\u2019m talking about dorky Nordic, cross-country skiing. I love being outside, in nature, in the snow with friends and sharing my love of the outdoors with children. I also volunteer with Outdoors for all and teach skiing through that program as well. In the fairer seasons, you\u2019ll find me backpacking, hiking, and cycling. Prior to the pandemic, I purchased a Specialized Ruby Road bike, and have logged over 10K miles on it since then. I love road cycling, but would also love to dive into trying out a gravel-style bike as well!\r\n\r\n\r\nI love being outdoors, but I can also chill. When I\u2019m having a weekend indoors, you\u2019ll find me curled up with a cup of tea knitting sweaters, or taking on a design/woodworking project. One of my dreams is to have a woodworking shop, and to build a sauna in my backyard! \r\nSimple times spent cooking with friends/family, sharing new experiences with others, or enjoying a sunrise/sunset with others are what make me happiest. I have a website that I last updated in 2022 that can tell you a bit more if you\u2019re curious. \r\n\r\n\r\nWho you are:\r\n\r\n\r\nSomeone who is excited about finding a monogamous long term relationship leading to marriage/kids. You are family-oriented. \r\n\r\n\r\nSomeone who loves the outdoors and travel\r\n\r\n\r\nYou are intentional, sincere, and ready for a long term relationship\r\n\r\n\r\nAre open to living in a place where being surrounded by nature and outdoor activity is accessible and part of daily life\r\n\r\n\r\nYou love to challenge yourself and try new things.\r\n\r\n\r\n\r\n\r\nDealbreakers\r\n\r\n\r\nI\u2019m a vegetarian and have a strong preference for folks who are plant-based. If you are a carnivore or eat meat daily, this won\u2019t work. \r\n\r\n\r\nI\u2019d really like to have biological children of my own with someone who wishes to be a present parent.  If having children isn\u2019t your jam, this isn\u2019t going to be a fit. \r\n\r\n\r\n\r\n\r\nStill intrigued/think this is a fit?\r\n\r\n\r\nSend me a message at gandhi.pj@gmail.com, I\u2019d love to connect!",
