    ProfileText: "\ufeffHi there! I\u2019m Tejas. I\u2019m not very familiar with \u201cdate-me\u201d docs, and haven\u2019t read too many of them, but I thought I\u2019d write a brief one. I only recently decided to start looking for a relationship, and thought this was a reasonable place to start!\r\n\r\n\r\nIf you\u2019d be potentially interested at all, please feel free to shoot me an email (you can reach me at tejassubramaniam@gmail.com) or contact me via Facebook Messenger. Feel free to tell me a bit about yourself, but even just expressing possible interest works!\r\n\r\n\r\nAbout me\r\n\r\n\r\n* I\u2019m 22, and currently an undergraduate student at Stanford (studying economics). \r\n* For some simple demographics, I\u2019m South Asian, male, and a lacto-vegetarian. I\u2019m also bi and gray-ace/demisexual. Politically, I\u2019m centrist, or slightly left-of-center. I\u2019m an atheist. \r\n* I\u2019m broadly an effective altruist. I\u2019ve been torn about this label before. I\u2019m not too certain about my future plans; I think I will probably apply to masters programs, and then try to work at a research role at an EA org. I have fairly broad interests, so I could see myself working on animal welfare, AI policy/governance, or economic development. \r\n* I\u2019m a bit introverted, although I\u2019m working on being more social. In my spare time, I like reading nonfiction (and blog posts), playing chess online, and participating in competitive British Parliamentary debate (which is an activity I\u2019ve enjoyed a ton). \r\n* I\u2019m very intellectually curious and eager to learn things: I love having long conversations with people about random things I can learn a ton about, including things I know very little about. \r\n* I\u2019m very neat and organized (although I don\u2019t expect that from a partner necessarily). I\u2019m good at replying to texts and emails promptly. When I\u2019m especially interested in a project, I can be quite hardworking, but otherwise my work ethic is poorer than I\u2019d like (this is something I\u2019m working on myself). I don\u2019t have excellent emotional intelligence.\r\n\r\n\r\nWhat I\u2019m looking for\r\n\r\n\r\nI\u2019m looking for a long-term relationship, but would also love to go on a few dates. I\u2019m open to dating people of any gender. I\u2019d also be open to either monogamy or poly; I have no strong preference on this matter, and would be flexible according to my partner\u2019s preferences. \r\n\r\n\r\nI\u2019d especially value a partner who is interested in making the world a better place, interested in any one of economics/math/political science/statistics, nerdy, and loves long conversations about particular curiosities of theirs. Bonus points if we share hobbies (e.g., debate, playing online chess). I\u2019d also love to share some of our values (either on our political views or on effective altruism \u2013 not necessarily both!), but this is not a dealbreaker. \r\n\r\n\r\nSome of my preferences\r\n\r\n\r\n* I have a low sex drive, and don\u2019t experience a lot of sexual attraction. \r\n* I think it\u2019s unlikely that I will want kids.\r\n* I\u2019m fairly comfortable with long-distance, and I\u2019d be happy to meet/go on a date virtually. But I\u2019d love to meet in-person too. \r\n* I\u2019d want to date someone over 19 but under 30. \r\n\r\n\r\nPictures of me (descriptions below each picture)\r\n\r\n\r\n  \r\n\r\n\r\n\r\nI\u2019m on the left, and that\u2019s my uncle on the right. \r\n\r\n\r\n  \r\n\r\n\r\n\r\nStanding in front of a bookstore. \r\n\r\n\r\n  \r\n\r\n\r\n\r\nSpeaking at a debate tournament.",
