    ProfileText: "\ufeffThanks for dropping by\u2026\r\nHi, My name is Alice. My friends call me Lil\u2019 Miss Giggles or Legs.\r\n\r\n\r\nIf you think we might be a good match, please email me.\r\n________________\r\n\r\n\r\n  \r\n\r\nHello everyone, \r\n\r\nThank you for listening to my story.\r\n\r\nI am Leila, actively seeking for my Alex\u2026(You won\u2019t get this if you don\u2019t know the Hormozis. Please Google them\u2026)\r\n\r\n\r\nI want to connect with a man who shares the same values. I want to build a life, and an empire, with my best friend, who is driven, ambitious, kind, compassionate, caring, affectionate and self-aware.\r\n\r\nIf you are still reading, great. I\u2019ll tell you more about me and who I am looking for for a monogamous and loving relationship.\r\n\r\n\r\nSincerely,\r\n\r\nAlice, AKA Lil\u2019 Miss Giggles\r\n\r\n\r\nPS. I now live in Austin\r\n________________\r\n\r\n\r\n________________\r\nSummary of Alice\r\n(And yes, to be clear, my name is not Leila.)\r\n* 38 year old Taiwanese-Canadian real estate developer and Fractional COO (mainly tech, real estate and the latest - an influencer) who helps businesses scale and grow\r\n* Currently living in Montreal, but happy to live anywhere.\r\n* I\u2019ve lived in 8 countries across four continents in my adult life. All without a job or knowing anyone. I have a very curious mind and paired with a strong can-do attitude.\r\n* Love listening to podcasts, reading, listening to audiobooks and MasterClasses\r\n   * My First Million, where I found out about this\r\n   * All-In, some of my pictures below are from the 2023 All-In Summit\r\n   * Alex Hormozi\r\n   * Andrew Huberman\r\n   * Lex Fridman\r\n   * Joe Rogan\r\n   * Jordan Peterson\r\n   * Guy Raz, How I Built This\r\n   * Tom Bilyeu\r\n   * Tim Ferriss\r\n   * And a whole lot more..\r\n* Marriage is important to me and I would love to have children if I met the right person.  \r\n* Giving back to my community is important and I am big on community growing. Currently building a MFM Fan Club on Slack.\r\n* Some of my other hobbies include: Muay Thai, crochet (I go every Tuesday), cooking and volunteering.\r\n* FUN FACT: I took 2018 off to solo travel the world and train Muay Thai, including Ukraine, Poland, Romania, Hungary, Germany, UK, Thailand, Taiwan, US, Cuba\u2026and now, I shadowbox every morning outside my apartment. Really rewarding when I had young college students come up to me and tell me watching shadowbox inspired them to sign up for the gym.\r\n\r\n\r\n________________\r\nSummary of who I am looking for\r\n(And no, your name does not have to be Alex and you don\u2019t have to be as buff as Alex.)\r\n   * Ideally, between ages 33 - 43 (I am undecided on men with children from previous relationships. It could be a no.)\r\n   * Share the same ambition and drive, but also not driven by material possessions\r\n   * Excited about having a loving wife and having children in the future. A man\u2019s man who takes care of his woman and family.\r\n   * Someone sensitive and caring at home. Protective of his woman out. \r\n   * Compassionate and kind towards others.\r\n   * Values quality time (so someone who\u2019s glued to their phone is a no for me, thank you)\r\n   * Endless curiosity and can travel backpacking style, or luxury.\r\n   * Strong character and is always looking to improve himself and motivates me to be the best version of myself.\r\n   * Has a strong can-do attitude and understands that life isn\u2019t always going to be smooth, but we can get through anything together. \r\n   * Strong communicator and his eyes smile when I\u2019m around.\r\n   * Cheeky, fun and playful in a kind, compassionate way and not a sarcastic and insecure way.\r\n\r\n________________\r\n                              They say a photo is worth a thousand words\u2026\r\n________________\r\n  \r\n\r\nMy most prized possession in life\u2026",
