    ProfileText: "\ufeffA bit about me: I'm 33 years old, 6'3\", living in NYC (and a third-generation New Yorker). I work as an engineer at Meta on Reels and I love what I do! I'm kind, happy, curious, creative, and a major nerd. My aunt is certain that I'm \"quite a catch.\"\r\nA bit about who I'm looking for: I'm currently looking for a serious relationship with a woman who is at least not closed to the prospect of marriage and children at some point in their life (with the right person, of course). Ideally someone who can pivot seamlessly between silly and serious conversation, and who is a little weird but still normal enough to charm my parents.\r\nI think I relate best to people who are some kind of engineer/scientist/nerd, but who also have a keen interest in the humanities and are generally well-rounded.\r\nFitness and health: I go on a short run most days and do some gym exercise around every other day. That said, I'm much more likely to want to talk about the podcast I was listening to while exercising than the exercise itself. I drink, but only if someone else at the table already ordered a drink. I don't smoke or use any drugs but I support decriminalization.\r\nReligion: Although I'm generally very secular (and so is my family), my cultural heritage is Jewish and I consider it a part of my identity. I love my family's holiday traditions - including Jewish Christmas (the classic movie and Chinese food) - it's as real of a holiday as Christian Christmas!\r\nFavorite day trip: Take the train to Pelham Bay Park and work up an appetite by walking to Johnny's Reef on City Island, then spend a few hours indulging in their incredibly reasonably priced seafood.\r\nFavorite evening activity: Finding an unusual off-Broadway show and convincing my friends to go (half the fun is the post-show debrief to figure out what we just experienced).\r\nMost surreal childhood memory: Eating at Mars 2112 - an immersive Mars-themed restaurant set up to look like it was carved out of red rock! It had everything - people in alien costumes, a spaceship ride, and above-average chicken fingers. It was emblematic of the kind of early 2000s decadence that we may never see again.\r\nTV triumph that I most often think about: The series finale of Nathan for You.\r\nTV disappointment that I most often think about: The series finale of Lost.\r\nTop podcasts: Normal Gossip, Maintenance Phase, Criminal, You're Wrong About, 5-4, Serious Trouble.\r\nIf money were not a concern: When I first got into programming in high school it was because I wanted to make games, but it turns out that the game industry is horrible and abusive and pays terribly, so I'd much rather be ensconced in a cushy tech job\u2026 anyway all of that is to say that if I didn't have to worry about money then I'd totally start my own game studio (that pays people well and is not abusive).\r\nRelationship to games: I wish there was a word to describe someone who likes video games but whose life isn't spiraling out of control due to a video game addiction. In any case\u2026 that's me! I love games, and I love in particular thinking about what makes them tick. I prefer a broad mix of games and usually don't stick with one for long. Some of my favorites are Baba is You, Breath of the Wild, Oxygen Not Included, Disco Elysium, Inscription, Tunic, and Kentucky Route Zero.\r\n\"He sounds great but is he a crypto/NFT guy?\": Lol no.\r\n\"He sounds great but is he a fan of Joe Rogan or Andrew Tate or Elon Musk? Or is he some other kind of right-wing sicko?\": Absolutely not!\r\nContacts: hello.there.msh@gmail.com",
