    ProfileText: "\ufeffContestant #2718: Cristian Trout\r\n________________\r\n  \r\n  \r\n  \r\n\r\n________________\r\n  Basics:\r\n* Male, straight\r\n* 5\u201910\u201d\r\n* 28, looking for someone in the ~26-32 range.\r\n* Seeking primary, long-term partner.\r\n* Preference for monogamy mostly because I\u2019m pretty certain in a polyamorous relationship my attention would be spread too thin for me. However, I\u2019m not into possessive exclusivity (I don\u2019t get jealous and feel slightly uncomfortable with people who easily get jealous).\r\n* Aromantic (but happy to humor those who are into the romantic)\r\n* Sorta demisexual? Behaviourally for sure: in the realm of relationships \u201cI am slow-thinking and full of interior rules that act as brakes on my desires.\u201d It takes me a while to warm up to people, but once I do I\u2019m very loyal and cuddly.\r\n* Mix of intro- and extroverted. Medium-sized social battery? I like meeting new people occasionally, and love hosting or hanging with friends. But after e.g. a fun weekend of full-time social exposure, I need a day or two of quiet to recup.\r\n* Neither prioritizing nor avoiding having children in the future\r\n* Currently in Boston/Oxford but pretty flexible: could move to basically any major city in US or EU. Preference for East Coast of US, France or UK.\r\n* Fluent in English and French (would love it if you are too!)\r\n* Current work: AI policy researcher, artist (screenwriting and videography).\r\n* B.A. and M.A. in Philosophy\r\n* Vegetarian when I\u2019m ordering, flexitarian otherwise. (Would struggle to live as a vegan: cheese is a strong part of my identity. Could be swayed.)\r\n* Not religious\r\n* Non-smoker, glass of wine on occasions\r\nCharacter:\r\nSome sort of cross between French bourgeois, Midwestern son, and ironic Jew. An imposter among all except those who are equally culturally confused. Trained in philosophy, self-taught in everything else. Serious on the outside, goofy on the inside.\r\n\r\n\r\nFinds the unambitious, parochial life to be humble and beautiful. Finds the world too broken, and himself too privileged or hubristic to accept such a life for myself. Grinds and hustles against the hustle and grindset culture. Fascinated with engineering, tinkering, science, but is not a techno-optimist. Finds that small is beautiful.\r\n\r\n\r\nSometimes has \u201cone thought too many,\u201d a character flaw. Speaks mind when probably shouldn\u2019t more often than keeps quiet when probably should speak up. Can be quite direct at times \u2013 avoids sugar-coating things. Sets high expectations for self and others. Sometimes struggles to admit when wrong, but eventually does.\r\n\r\n\r\nLooking to share the ride with a life-long friend accomplice! Always striving to live more virtuously :)\r\n\r\n\r\nNB: Friends fear this dating profile is \u201ca bit too much.\u201d To which I respond: \u201cbut that\u2019s very like me!\u201d\r\nSeeking:\r\n* A co-conspirator. I wish to build beautiful things with my partner, at work and at home. I wish to be involved in my partner\u2019s career, and vice versa. I wish our talents and temperaments to complement each other so as to make us a dynamic duo, a force for good :) I\u2019m currently trying hard to help \u201cmake AI go well.\u201d\r\n* Someone who challenges me. Someone well-studied in their craft or a rigorous thinker. An interest in philosophy, economics, or art are pluses! (Trading in truisms and half-baked things quickly bores me.) But also\u2026\r\n* Someone who knows how and when to shove all that braininess to the side and run down a sand dune, pull a silly pose, bask in the moonlight, or cozy up with a warm cuppa.\r\n* Someone who knows Europe and or America: I\u2019m culturally confused enough as it is, and would rather not become more so... (Ideally looking for someone who understands what that\u2019s like, since it\u2019s a key aspect of my identity). I don\u2019t brag my privilege of being well-traveled, and I dislike what I call \u201ccultural tourism\u201d (treating culture like so many colors to embellish one\u2019s instagram feed; taking cultural diversity for granted; failing to care for, own up to, partake in, and embody one\u2019s own culture).\r\n\r\n\r\nSome things I love:\r\n* Cooking for/with friends, hosting dinner parties, board game nights!\r\n* Tinkering: DIY repair, optics, dance, music. Not good at any of these, love experimenting anyway :)\r\n* Hiking, being in nature\r\n* Reading a poem or watching a great film and then doing a deep dive discussion with others! Off-the-cuff sampling of works I love:\r\n   * Rashomon\r\n   * Parasite\r\n   * Lawrence of Arabia\r\n   * East of Eden\r\n   * Le Petit Prince\r\n   * Lord of the Flies\r\n   * Brave New World\r\n   * The Cosmicomics\r\n   * (poems by Robert Frost)\r\n   * Calvin and Hobbes\r\n   * Outer Wilds\r\n* Watching some classic Looney Toons or an old comedy (typically Jerry Lewis or Danny Kaye) with my family \u2764\r\n* Playing some silly couch multi-player games with friends or family (Nintendo boy here!) (\u2229^o^)\u2283\u2501\u2606\r\nHow to proceed:\r\nIf you think you\u2019d like to meet, or chat with, feel free to reach out at ctroutcsi@gmail.com, or here on messenger, or text me at seven eight one, five one eight, eight nine nine six! (I think messenger or text are more reliable, since emails will sometimes go to spam\u2026) If you\u2019d like to learn more about my work/hobbies, feel free to visit www.ctrout.art.\r\n\r\n\r\nI know it can be intimidating to reach out, but of course I made this doc to meet new people, so don\u2019t be shy :)\r\n\r\n\r\nMore Photos      \r\nDid we mention hubris?",
