    ProfileText: "Date Me\nRhys Lindmark\nAbout\nBook\nRoote\nSubstack\nPodcast\nPatreon\nDate Me\nMy proudest moment:\nRepotting my plant.\nChoose our first date:\nSample weird cocktails at a local bar\nSpend our allowance at the weekend farmer's market\nGo on a weekday hike and complain about work\nThis could be us:\nWhen Diego asks nicely, I let him be the little spoon.\nI'm looking for...\nA sharp, emotionally attuned woman who wants to build a life together with a playful, reliable, ambitious man.\nMy best blue steel\nTogether we could...\nCook a feast for friends \ud83e\udd57\nTry all the partner dances \ud83d\udc83\nPhilosophize under the stars \ud83c\udfd5\ufe0f\nDating me will look like:\nSelfies. Lots of selfies.\nThis year, I really want to...\nFinish the manuscript for my book.\nMe in the wild:\nI've done a lot of backpacking in my life. 500 miles in CO, 150 in Kenya, 100 in Nepal, 100 in China. A bit much tbh \ud83d\ude02\nThat one dance trend I nailed:\nThey call this one the \"white boy clap.\"\nDeets\nMale, Straight, Monogamous, Wants Kids, SF but flexible, born 1991, 6 ft\nReach Out!\nIf you think we might be a fit, please reach out.\nYou can DM me\non Twitter\nor send me an email at\nrhyslindmark@gmail.com\n. Feel free to just tell me about some part of this document that resonated with you.\nYou\u2019re also very welcome to introduce me to someone you think I\u2019d be compatible with.\nThank you for reading!\nWarmth,\nRhys \u2764\ufe0f\nMore\nIf you want to get a more holistic picture of me, you can see me \"in the wild\" with:\nMy school,\nRoote\nMy\nbook\n,\npodcast\n,\nGoodreads\n, or\nTwitter\nMy\nSpotify\n, or a dance I like to host\u2014\nErratic Dance\nPhoto books from backpacking in\nColorado\nor\nNepal\n(But mostly I'm excited to learn about you!)\nRhys Lindmark\n\u00a9 2025",
