    ProfileText: "\ufeffAntonia\u2019s Date Me Doc\r\n  \r\n  \r\n\r\nHi there! \r\n\r\n\r\nRead below for vibe-descriptions about myself and the relationship I\u2019m looking for. \r\n\r\n\r\n\r\n\r\nPhotos: 2023 (left & right)\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nBasics\r\n* Woman, straight, born 1995.\r\n* I live in Berlin. Other places I\u2019ve been living in >3 months: Hong Kong, London.\r\n* Available in English and German (native German but prefer English for dating).\r\n* 173 cm tall. Athletic build.\r\n* Finishing my Master\u2019s in Social Sciences and always busy with side projects/jobs.\r\n* Pretty neurotypical.\r\n* Looking for a committed primary / monogam-ish relationship with a man between 27-36 y/o.\r\n\r\n\r\n  \r\n  \r\n\r\n\r\n\r\n\r\n\r\nPhotos: 2023 (left & right)\r\n________________\r\nPhotos: 2023 (left), 2024 (middle), 2024 (right)      \r\n\r\n\r\nHobbies, Interests, and details\r\n\r\n\r\n* Community: Having a good community is super important to me and I invest significant time and energy into caring for my network of friends. I like to be proactive in organising and participating in social events, like to experiment with co-living, and learn about other ways to deepen relationships. Wholesome relationships deeply inspire me to become a better person and more engaged with life. \r\n* Doing Good: I care about the world and aspire to be altruistic and work towards reducing suffering. The EA philosophy resonates with me and I\u2019ve been involved in the community for some years, socially and via volunteering in various roles. Currently I\u2019m figuring out what\u2019s the best way for me to align my career with these values. \r\n* Veganism: I\u2019ve been vegan for >11 years and it\u2019s somewhat important to me that people that I date pursue a cruelty-free lifestyle.\r\n* Movement: I\u2019ve been physically active my whole life and I do something almost every day. Currently I do cycling (for transportation), yoga, olympic weightlifting, and crossfit regularly and do all sorts of other stuff occasionally (inline skating, powerlifting, calisthenics, trampoline, bouldering, dancing, tennis, snowboarding, skiing, obstacle mud races, \u2026). I\u2019m fascinated by learning new movements and sports and am always interested to try new things. \r\n* Meditation: I\u2019ve been meditating daily for some years now and it\u2019s become quite \u201cserious\u201d in the sense that it\u2019s not something I do instrumentally for any mental health, productivity, or whatever reasons but because the gravity of being alive is such a huge and fascinating thing to investigate that I have no choice but to look at it. It\u2019s changing me for the better in a conventional sense as well. Besides meditation I also occasionally explore my mind through other means, like dancing, heat/cold exposure and so on. \r\n\r\n\r\n* Other activities I enjoy: Long conversations, clubs/rave, costume parties, building events/art, Burner culture, spending passive time with friends, meeting people to explore relating techniques/ meditation/ movement/ whatever (\u201cworkshop culture\u201d), consuming content for entertainment, knowledge, and learning (books, audio), going for walks (more rarely: hiking), playing video games, drawing.\r\n* I\u2019m politically left (on the European spectrum), liberal, and a feminist. Intellectually I\u2019m somewhat post-rationalist. I\u2019m compatible with both rationalists and hippies. \r\n* I drink and smoke very rarely (both ~2-4 times a year). Other substances are more interesting to me (e.g. psychedelics). I\u2019m interested in drugs and read lots about it (history, current research, illegalisation and liberalisation, chemistry, etc.). I like intentional use and doing proper integration. \r\n  \r\n  \r\n\r\n  Photos: All 2024\r\n\r\n\r\n\r\n\r\n\r\n\r\nDating preferences\r\n\r\n\r\n* Style: I\u2019m looking for a nesting partner/life companion type relationship where the relationship between us is a clear priority. \r\nCould be either monogamous or a committed primary open relationship where there could be side romances but no relationships that would cause regular negotiation between us (i.e. it should be obvious that it\u2019s us going on holiday together, attending friends\u2019 weddings together, building a life together etc.)\r\n* Kids: I think I want kids eventually, not in the next 5 years but more likely after that (meaning it\u2019s a deal breaker if you\u2019re sure you don\u2019t want kids). I want to share  childcare equally with my partner, so I strongly prefer someone who is aware and willing to make the relationship and lifestyle adjustments that come with raising children. Ideally, you\u2019re excited about the prospect of being amazing co-parents one day. \r\n* Location: I\u2019m not into long-distance relationships so you have to live in Berlin or adjacent accessible regions. Once in a relationship, I can imagine moving elsewhere together, with a preference for European capitals.\r\n* Other preferences: Taller than me (this is actually quite important), non-smoker, no pets (negotiable), physically fit, kind, witty, self-aware, caring, wholesome, value-driven, somewhat eccentric, calm energy, curious.\r\n* What we could do together: \r\n   * Exchange physical affection (this is important to me)\r\n   * Exercise\r\n   * Have deep conversations  \r\n   * Problem-solve\r\n   * Work on a creative project together\r\n   * Meditate and share insights\r\n   * Dance to loud bass-heavy music\r\n   * Listen to podcasts or books, or even read to each other\r\n   * Explore food - cooking or eating out\r\n   * Host/attend events and parties\r\n   * Travel\r\n   * Go to burning man\r\n   * Psychonauting\r\n   * Appreciate art \r\n   * Relax and regenerate\r\n   * Generally I like to be supportive, affectionate, and nurturing. I\u2019ll probably remember your appointments, support you in life logistics and your larger goals, and think about your problems. I appreciate it when you are interested in and supportive towards my goals, if you\u2019re curious to meet my friends and family, and work to understand each others\u2019 worlds (that said, I obviously still appreciate certain individual boundaries and things in life that we do separately). \r\n\r\n\r\n\r\n\r\nContact \r\nReach me at @antoniabr on Telegram, antonia.82 on Signal, or email me at laremgruscht@live.de. \r\n\r\nWould be great if you include your own doc and/or some basic info about yourself plus some photos/links to socials :)",
