    ProfileText: "\ufeffOmair\u2019s Dating Doc\r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n________________\r\n\r\nShort version\r\nHi! I\u2019m Omair \u2013 pronounced mostly like it\u2019s spelt, but there\u2019s maybe a hint of nominative determinism in pointing out it\u2019s like \u201cohm-air\u201d since my background is in power/electrical engineering. I\u2019m 27 years old, live in Seattle, work at a company I co-founded that works in validating electronics for space radiation. I\u2019m looking for a probably monogamous relationship with a woman in the 24-30 y/o range.\r\nLong version\r\nPersonality Traits\r\n* Curious\r\n   * Curiosity is very important to me. I\u2019m interested in many things and I like to try and understand how everything around me works. It\u2019s especially important for me to try and understand things from the simplest building blocks. You don\u2019t have to be interested in what interests me, but I hope you\u2019re deeply curious about everything that interests you!\r\n* Ambitious\r\n   * I feel like this is most true in my work, but shows up in other places. I am pretty driven to try and grow and make a successful company. I find it really fun to try to solve problems and compete in a competitive space, and kinda like the stress. I think in school this trait manifested itself in my immersion in student clubs\r\n   * Sometimes I set weird goals for myself and try hard to accomplish them. One example is with athletic pursuits like \u201ceveresting\u201d from my previous house, or trying to climb Washington\u2019s bulger list \r\n* Reserved\r\n   * Lean introverted and not crazy social, but I can somewhat turn it on in some scenes where I\u2019m more comfortable. I don\u2019t seek out regular bustling events, but I do occasionally go with friends and enjoy myself.  \r\n* Independent\r\n   * I want to spend regular quality time with my partner, but I\u2019ll still want to spend a bit of time alone\r\n* Altruistic\r\n   * Let\u2019s just be good people\r\n\r\n\r\nStandard dating stuff\r\n* Religion\r\n   * I am atheist, but am open to someone who is lightly religious or holds certain spiritual ideals. Probably won\u2019t match well with someone who is very religious.\r\n* Kids\r\n   * Certainly not interested in the next 5 years, but more open to it down the road. I slightly lean against it right now, but really not sure how I\u2019ll feel about it in the future\r\n* Identity/preferences\r\n   * I identify as a cis male interested in a woman seeking a monogamous or primary partner. I don\u2019t think I\u2019m interested in a fully polyamorous relationship. I would be happy in a fully monogamous relationship, or with a primary partner who wanted some side romances\r\n* Education\r\n   * Undergraduate degree in mechanical engineering. Was a battery engineer at a few tech companies before moving to the radiation/space effects world.\r\n* \u201cVices\u201d\r\n   * Drink almost none day to day, but will occasionally drink socially\r\n   * Experimental with drugs for cognitive stimulation (caffeine/nicotine type), but honestly kinda scared so I\u2019m wary\r\n      * didn\u2019t even start drinking coffee regularly until 27 \ud83d\ude43\r\n   * Not into other drugs, but open to someone who is into certain other drugs\r\n   * I don\u2019t smoke\r\n* Physical\r\n   * 6\u2019 tall\r\n      * 6\u20194\u201d wingspan+disproportionately long legs, which isn\u2019t important in any way besides being kinda neat I guess\r\n   * ~145lbs\r\n   * I do almost no strength training besides indoor climbing ~weekly (aspirations to increase this), but do a fair bit of aerobic activity mostly outside\r\nHobbies and Interests\r\n* Reading\r\n   * Day to day I read a fair bit online. Mostly things like substacks, opinions, and some tech/world news. Sometimes even just wikipedia rabbit holes. I especially like reading books when traveling (which I do a fair bit for work). I feel like I\u2019ve done a really bad job at reading fiction as I\u2019ve gotten older, but I do like sci-fi. \r\n* Outdoor adventures\r\n   * I ski, run, bike, and climb. I really enjoy my time in the mountains and it\u2019s an important part of my life. That said, I think my friends assume this is a much bigger part of my life than I feel. I think this is maybe because I do more \u201cintense\u201d things than average. In reality, I like to do big day trips in the mountains just to enjoy the time far from my house in the city, lost in thought in a pretty place\r\n   * All this to say, it\u2019s important that my partner is happy with me disappearing for 1-2 days in the mountains occasionally, but doesn\u2019t need to share these hobbies.\r\n* Riddles/puzzles/crosswords\r\n   * Enjoy them more than I am good at them\r\n* Making food\r\n   * I used to very much not do this. Then, I lost a bet and had to make dinner for my house everyday for a month. I tried to do a different cuisine for as many of the days as possible. Now I like to dabble with cooking and baking \r\n   * Proof:\r\n  \r\n  \r\n\r\n  \r\n  \r\n\r\nqed?\r\n* New things!\r\n   * I may not share your hobbies, but I\u2019m happy to try (and possibly suck at) them\r\nInterested?\r\nNot convinced by dating docs yet, but they seem to be the best online method. I feel like these docs are still kinda weird and awkward, but they seem to be moving in a direction I like over match.com type apps. Standard disclaimer about how (online? all?) dating is scary and err towards messaging if you think we might get along. Get in touch by text at",
