    ProfileText: "\ufeffDate Me Doc                                                                         Last edited: 2023-09-17\r\n\r\n\r\n\r\n\r\nHey, I\u2019m Ross Mazur!\r\nWelcome to the doc - feel free to skim the bold and read deeper as fit. Photos are at the bottom.\r\n\r\n\r\nQuick Stats\r\n* Male\r\n* 31 years old (Taurus)\r\n* 6\u2019-0\u201d tall\r\n* Grew up in central NJ \u2192 4 yr in Upstate NY \u2192 2 yr in IA \u2192 3 yr in WA \u2192 3 yr in CO \u2192 WA\r\n* Work in Mukilteo (30 min N of Seattle)\r\n* Vegetarian for >10 yrs  - considering broadening my horizons\r\n* Raised Jewish, don\u2019t currently associate with or practice religion\r\n* Liberal but also free-thinking and respect folks with other ideologies\r\n* Open to kids\r\n\r\n\r\nIn short, I\u2019m looking for\r\nA female monogamous life partner, who lives in, or frequents the Seattle area.\r\n\r\n\r\n________________\r\nAbout You\r\nThis isn\u2019t so much about me as it is you :) \r\nBelow are some ideas, not criteria.\r\n\r\n\r\nYou feel a responsibility to make the world a better place socially or environmentally. Whether that be through application of business to tackle a problem, or are in policy, or at a non-profit, or through volunteerism, or are in the process of developing a plan to do so (I get that some folks want financial independence before dedicating themselves to the cause). This motivation is a key driver for you, and something that you consider often.\r\n\r\n\r\nYou are self-aware and are comfortable talking about your feelings and communicating generally. Down to shoot me straight and provide feedback before something becomes a problem.\r\n\r\n\r\nYou like to cuddle. You are OK without significant PDA.\r\n\r\n\r\nYou are active and think about health. You feel similarly that outdoor time and exercise are mentally grounding, and do these reguarly. You like to eat your veggies, and sometimes like to eat your wheaties (high-energy foods).\r\n\r\n\r\nYou know what makes you happy, and pursue that. You can take genuine interest in a wide range of topics.\r\n\r\n\r\nYou are a free-thinker, and have the ability to pull personal biases to the side to logically assess a perspective or situation.\r\n\r\n\r\n________________\r\nAbout Me\r\nThe world is a beautiful place, and I want to learn how every aspect of it works.\r\n\r\n\r\nSince middle school, I have been passionate about addressing environmental and ecological problems. My perspective on these problems and means of addressing them has evolved significantly over the past 15+ years.\r\n\r\n\r\nI spend a lot of time in motion outside, it is meditative / grounding / calming. Also like to push myself physically.\r\n\r\n\r\nI do enjoy planning, but often have analysis paralysis, so can be an inefficient decision maker. That said, I love tackling small challenges. For example: We\u2019re about to have 20 people show up for this event in 2 hours but don\u2019t any theme-relevant decorations, hors d'oeuvres, or any chairs for them to sit in.\r\n\r\n\r\nWear a bunch of hats at work - on paper am a program manager, but also a process engineer, construction PM, life-cycle assessment practitioner, manufacturing facility maintenance manager, site safety lead, and financial planner. Master of none. Sometimes struggle with work-life balance.\r\n\r\n\r\nFor many years I had legit hobbies: involvement the world of traditional teas, gardening and CSAs, permaculture, fruit tree and orchard management, gleaning, foraging and fruit exploring, but slowed these the past few years. I am in the process of re-exploring these and new ones, particularly with a service component.\r\n\r\n\r\nBenefits of dating me\r\n* Emotionally available\r\n* Honest and upfront\r\n* Love to cook and clean\r\n* Will take interest in your hobbies\r\n* Have a lot of love to give\r\n* Like doing gross chores - happy to pull goop out of strainer, roto-root scuzz out of sink drain, and clean the toilet.\r\n* Will catch your spiders and bring them outside\r\n* Will bring snacks\r\n* I will tear it up on the dance floor with you\r\n\r\n\r\nWhat you\u2019ll be putting up with\r\n* Someone who gets ants in their pants and needs to go outside or on a walk/bike/jog\r\n* Often overly logical - some things in life just don\u2019t benefit from having logic applied to them\r\n* Good at thinking one step ahead - bad at thinking 2+ steps ahead\r\n* I\u2019m better at giving than receiving\r\n* I eat a lot\r\n* Although I love cleaning, I tend to wait until there will be physical accomplishment from doing a cleaning activity\r\n* I may go too hard on the dancefloor\r\n________________\r\nPhotos\r\n  \r\n\r\nI love toasting - it\u2019s a great challenge to concisely say something moving\r\n  \r\n\r\nHello! Yes, I snot in the winter months like a normal human\r\n\r\n\r\n  \r\n\r\nFood is only waste if we waste it\r\n  \r\n\r\nAlpaca farm near Loveland, CO\r\n  \r\n\r\nYes, I still have T-shirts from high-school hippie days\r\n\r\n\r\n  \r\n\r\nLook, there\u2019s another\r\n  \r\n\r\nMy sister and I at Mt. Adams - we both spend a lot of time hiking\r\n  \r\n\r\nNext door neighbors and my family at my childhood best friend-Nikki\u2019s 8th Bday\r\n  \r\n\r\nAt potlucks, I often have some form of veggies :)\r\n  \r\n\r\nI do own a suit!\r\n\r\n\r\n\r\n\r\n\r\n\r\nInterested?\r\n Tell me about yourself at ross.mazur1@gmail.com or Instagram\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\nCredits\r\nThis date me doc was inspired by\r\n   * Julia\u2019s date me doc\r\n   * Anne\u2019s date me ppt\r\n   * Jake Gloudemans\u2019 date me Notion\r\n   * Lawrence\u2019s date me Notion\r\n   * Molly\u2019s date me doc",
