    ProfileText: "\ufeffI am 24 years old, cis female, 5\u20196\u201d and 145 pounds.\r\n\r\n\r\nI am looking for a relationship with deep emotional intimacy, lots of time spent together, and a view to living together and spending years in a committed relationship. I am open to such a relationship having romantic and/or sexual elements; however, I don\u2019t really experience sexual and romantic attraction, at least in the way it has been described to me by others. I do find some people more physically attractive than others and am more open to having romantic or sexual relationships with those people, but sex and romance are optional for me and I don\u2019t experience anything like crushes or a sex drive. Relatedly, I have pretty restrictive boundaries around sexual activities in particular and typically want to do them infrequently. I\u2019m not going to give more details on my preferences here just to avoid a TMI situation, but if this might be a deal breaker for you feel free to ask me about it whenever you feel comfortable doing so.\r\n\r\n\r\nGiven my ace/aro spectrum status, and the fact that I experience next to no romantic jealousy, I would be happy for my partner to have other romantic and sexual relationships. \r\n\r\n\r\nActivities I would enjoy doing with you include dancing, singing, cuddling, improv comedy, deep conversations on philosophy and psychology, watching crime dramas and sitcoms (My favorites are Community and Better Call Saul), going for nature walks, going camping, going to the beach, traveling in India or Europe, and trying new and unusual things.\r\n\r\n\r\nI have taken the Giving What We Can pledge and I currently help organize the local Portland EA and rationality group which I founded back in 2015. I am currently unemployed but would like to work in animal welfare in some capacity once my mental health and motivation improve.\r\n\r\n\r\nI suffer from mild anxiety, low motivation (and occasionally other depressive symptoms for months at a time), and addictive tendencies (I am currently trying to get clean from kratom but am struggling and have repeatedly relapsed). I am on the autism spectrum (have you noticed?). I am extroverted, agreeable, and tend to have very low-conflict relationships. I have only ever been in one long term relationship which was very fulfilling and ended agreeably due to mental health issues on the part of my partner.\r\n\r\n\r\nI enjoy having conversations on politics and philosophy. My politics are fairly centrist with some left-wing and some right-wing opinions on individual issues. I am very open to having relationships with people that have very different political opinions to me. My moral philosophy is something like moral anti-realist utilitarianism with an acknowledgement that my true values (as revealed by my actions) are many and my moral intuitions will never fully conform to an internally consistent system.\r\n\r\n\r\nI am not particularly interested in marriage as I see a lifetime commitment as being unrealistic. I would however be open to having children together a little ways down the line, especially if you can support me taking 5+ years off of work to care for them. If we did have children I would want to make a strong commitment to staying together as long as doing so would be better for the children than splitting up, and if marriage is important to you as a symbol of that commitment I would be open to it. I am also open to not having children.\r\n\r\n\r\nI am open to starting with a long distance relationship while I\u2019m in Portland and would consider moving to nearly any large city, assuming I am able to work remotely (bay area would be preferable if I can\u2019t). I would greatly prefer one with an active EA community, but would consider a place without one for the right person. I would enjoy living alone with my partner or in a group house with likeminded people.\r\n\r\n\r\nI think I would benefit a lot from being in a relationship with someone more conscientious than me who could encourage me to develop a greater sense of responsibility and work ethic. I like to be pushed a bit towards greater commitment to my long term goals, as long as the encouragement is positive and not shame-based.\r\n\r\n\r\nI am open to a relationship with someone of any gender, up to 45 years old but prefer someone closer to my age (24). \r\n\r\n\r\nContact me on facebook if you\u2019re interested.",
