    ProfileText: "\ufeffFeb 5, 2024 12:30\u202fPM\r\nHi,\r\n\r\n\r\nAs I write this, I am listening Western Klassical Music Appreciation Project (weaklap) on Twitch. The piece currently playing is Jean-Philippe Rameau - Suite in A minor/major. I don't enjoy the Baroque period too much, I feel that I am more Classical and Romantic. Modern is good but it goes too crazy sometimes. I've been learning a lot about the different eras of classical music through this project, you can check it out and notice that it is a tool for naive listeners. Thus, no, I am not a musician but I had a deep appreciation for classical music. I'm 40 years old and I'm comfortable in my own skin. \r\n\r\n\r\nMy native language is Portuguese, Brazilian portuguese. I started learning French on Duolingo for fun (387 days streak) however, Je ne parle pas fran\u00e7ais. I can understand Spanish but not talk. I am not a very talkative person.\r\nI actively participate in social dances including Zouk and Forro (my culture) and more recently in Contact Improvisation and Comtemporary dance. I am interested in Microfuzion but haven't tried yet. Connecting with my own or another body is a delightful experience for me. Dance is transformative. However, no, I am not a professional dancer.\r\n\r\n\r\nI spent a significant amount of my time developing computational approaches to analyse biological data. More specifically, studying the relatioships of epigenetic modifications and psychedelics. The goal is to discover novel plasticity mechanisms and understand how they coordinate the overall large-scale neural plasticity. Oftentimes it is challenging but also fun.\r\n\r\n\r\nI am very curious and moved by an existential disquiet. \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n  \r\n\r\n\t  \r\n  \r\n\r\n\t  \r\n\r\n  \r\n\r\n\t\r\n\r\n\r\n\r\nI live in El Cerrito, CA.\r\nThe best way to reach me out is by texting me at Instagram @marcos_abraao_art or Facebook",
