    LastUpdated: "2023-09-14",
    ProfileText: "\ufeffAs of Feb 2024\u2013 Thank you for stopping by, but I\u2019m currently dating someone! I\u2019ve dropped this doc in multiple places, so this seems the easiest way to update all interested visitors. Best of luck to you!\r\n\r\n\r\nHi, I\u2019m Nancy. 32/F/NYC (but remote friendly)\r\n  \r\n  \r\n\r\n\r\n\r\nOne of my lifelong goals is to become more of myself every single year. It is the most meaningful act of creation (rather than discovery) I can do, and I want to do it at an intensity that I\u2019m slightly embarrassed of the person I was the year before. I try hard to create my own sense of consciousness rather than inherit it, so oftentimes I oscillate between existential angst and actively white-knuckling figuring\u2014 often with a bleeding heart. I question the status quo, search for greater meaning, and try to discover alternative ways of being.\r\n\r\n\r\nThe more deeply I\u2019m connected with myself, the more I can truly connect with others, without my projections, expectations, and dependencies. I\u2019m looking for a partner similar committed to self-awareness, with the eventual goal of healthy interdependency. That takes seeing each other for who we are, and creating space for both of those people and iterations of those selves.\r\n\r\n\r\nGeneral attitude\r\n\r\n\r\n\"Life shrinks or expands in proportion to one's courage.\u201d\u2014 Ana\u00efs Nin\r\n* My default replies are: \u201cwhy not\u201d \u201cyes, and\u201d \"can we!!!\"\r\n* Variety is the spice of life\r\n* Courage the Cowardly Dog is my spirit animal\r\n* \u201cWe\u2019ll figure it out\u201d/good enough \r\n  \r\n  \r\n       \r\n\r\n\r\n\r\n\r\nNon-professional Resume\r\n* Frequent solo traveler\r\n* Intl digital nomad for three years\r\n* Sabbatical was backpacking thru South America for 6 months\r\n* Fundraiser for grassroots nonprofit for working class Asian Americans\r\n* Built a community of Asian American progressive women to pass a NYC Resolution with City Council\r\n* Multi-day hiking treks in Chilean Patagonia, Peruvian Andes, and throughout Mallorca\r\n* Lived in a co-living community\r\n* 2 Half Marathons\r\n* Burner\r\n* Have guided 6 friends into therapy/helped them find their therapist\r\n* Have extracted myself from an enmeshed familial dynamic and have healthier relationship with parents (WIP)\r\n* Take pride in often being mistaken as my friends\u2019 partners (public acknowledgement that depth of intimacy is not reserved for romantic relationships!)\r\n* Can karaoke sober for hours  \r\n\r\n\r\nI don\u2019t expect you to have a similar history\u2014 in fact, it would be great if we could introduce each other to new interests! Hope you are interested in exploring some of these though because it would be fun to continue onward deepening these interests together.\r\n\r\n\r\n\r\n\r\nOn Relationships\r\n\r\n\r\nI value and invest a lot in my friendships, they are the grounding forces in my life that enable me to go far and wide in the world alone. My friendships abroad simultaneously make the world smaller and expand my horizons. We heal and grow in the spaces between us. I love people, caring for them, learning about them, being close to them, advocating for more adult sleepovers, extended living with one another, building lives in community.\r\n\r\n\r\nI define love as a verb, a practice that you commit to, daily fidelity over grand proofs of love, demonstrations of care, prioritization of each other. What that looks like is an extension of oneself to nurture another\u2019s mind, body, spiritual growth. As James Baldwin said, loving anybody and being loved by anybody is a tremendous danger, a tremendous responsibility.\r\n\r\n\r\nThat being said, being committed to each other also means being committed to growth, individually and as a team. It could mean that our lives will be a little unconventional, or the distance between us ebbs and flows, or that we'll have chapters of navigating trying times. Hope you're up for lots of intentional check-ins, and being really accountable to yourself for ourselves.\r\n\r\n\r\nLoving someone requires seeing people for who they are, outside of their relationship to you, and letting them be who they are. You can feel connected and invest in someone, but it doesn\u2019t mean feeling entitled to control them or making them your personal projects. I\u2019m looking for a kind of love/life that\u2019s triangular: an orientation beyond our love for each other, towards external elements in life \u2014 which is to say, life itself.\r\n\r\n\r\n\r\n\r\nA few tweets of mine\r\n   * https://twitter.com/nanseaful/status/1637917957329133568\r\n   * https://twitter.com/nanseaful/status/1633708623024074757\r\n   * https://twitter.com/nanseaful/status/1654829322807521282\r\n\r\n\r\nThings I like\r\n* Good food & cooking & sharing food esp desserts\r\n* Live music\r\n* Dancing harddddd\r\n* Learning at workshops, panels, author talks, book festivals, immersive theater, scavenger hunts, escape rooms\r\n* Hosting powerpoint parties, death parties, murder mystery parties, food tours\r\n* Commitment, follow through, trust\r\n* Deep conversations & probing questions\r\n\r\n\r\n\r\n\r\nThings I\u2019m trying to get better at\r\n* Meditation\r\n* Patience with myself and life\r\n* Yielding control\r\n* Consistency\r\n* Resting\r\n* Forgiving others\r\n* Tennis\r\n* Surfing\r\n* Writing\r\n\r\n\r\nPeople things have said about me\r\n* High agency character\r\n* Energizer bunny\r\n* Impressive rate of follow-through\r\n* Community builder\r\n* Very creative thinker\r\n* Kindest listener \r\n* \u201cBeing loved by you feels like the warmth of the sun on both sides\u201d\r\n* \u201cYou taught me what friendship is\u201d\r\nWhy I will contribute to our arguments\r\n* I am a litte impatient (overbearing)\r\n* I am intense (tiring)\r\n* I am insatiable (unfocused & restless)\r\n* I overthink (anxious)\r\n* I bruise easily (see forgiving bullet)\r\n* I run late a lot (annoying)\r\n* I get lost a lot (annoying)\r\n* I lose things a lot (annoying & expensive)\r\n* I can be notoriously inattentive (see last three bullet points)\r\n* I sleep too little and late (worrisome)\r\nWays I like to be relation with my partner\r\n* Our relationship is our priority\r\n* Not necessarily similarity, but compatibility\r\n* Lots of physical affection\r\n* Info dumping\r\n* Conspiring to take fun very seriously\r\n* Creating our own world of joy > pleasure, soul > gold, creative work > business, meandering > perfection; impractical, local, small > capitalism, soft tenderness > control; going together > going far\r\nDealbreakers\r\n* Apolitical people - the choice to be \u201capolitical\u201d is usually just an endorsement of the status quo and the unexamined life. Also, I am the proud daughter of Vietnamese immigrants, so know that conversations about race relations (in the world, between us) will come up in the meta, value-driven way, but also the personal lived ways (cultural traditions & how we spend time with my family & create our own). My closest friends are LGBTQ. Our performed gender roles will affect what we expect from and how we relate to each other. We also live on this same overheated Earth lol.\r\n* Neoliberalism - bro it just doesn\u2019t work like that\r\n* Prefer petless partners, but this is negotiable\r\n\r\n\r\n\r\n\r\nWhat I\u2019d like to know about you\r\nReach out to me responding to one of these questions:\r\n* What\u2019s the last thing you learned about yourself?\r\n* What\u2019s a lesson you keep having to learn, and why?\r\n\r\n\r\n\r\n\r\n\r\n\r\nIf you\u2019re interested, write to me at nancyjnguyen@gmail.com.",
