    ProfileText: "\ufeffHello,  Thanks for visiting this page. I\u2019m Sohit and I\u2019d love to tell you a few things about me!\r\n \r\n  \r\n   \r\n^ me with my cat on the left. Me in London on the right. \r\n\r\n\r\nBasics:\r\n* I live in Princeton, NJ with my cat, Bella. You will find me in NYC every weekend.\r\n* I am 6\u20193\u201d. I am 26 years old.\r\n* I\u2019m currently pursuing my PhD in Computational Biology at Princeton University.\r\n   * I work on simulating proteins to understand their behavior better, especially for drug-docking and enhancing drug efficacy.\r\n* I\u2019m a straight guy and I\u2019m attracted to women.\r\n* Kindness and care will melt my heart. I believe in respect and consideration for everyone around me. I also have a strong respect for knowledge and books.\r\n* My love language is bear hugs, cooking for people, and writing postcards.\r\n\r\n\r\nHobbies: \r\n* I love theater. I was in my school theater club for 10 years. While I no longer perform, I love seeing creative theater and regularly go to shows in NYC.\r\n* I love to read non-fiction, creative stories, professional development, and personal development books. \r\n* I also love writing:\r\n   * My blog is here: https://medium.com/@sohitmiglani/ \r\n* Traveling to learn about the world and all kinds of people! I\u2019ve been to 32 countries so far and hoping to keep the momentum going.\r\n* Biking, Knitting, and Arts and Crafts\r\n* I like to have open spaces to show my creativity and I always try to find art events.\r\nPersonal Traits:\r\n* I am a very low maintenance person and very calm. I am a good listener. I have worked a lot on myself, especially this past year, and learned to handle my anxious brain.\r\n* I try my best to be kind to the people around me and be inclusive of everyone.\r\n* I am a bit goofy and love playing around. \r\n* I love hosting people and cooking for them / hosting a game night.\r\n* I\u2019m somewhat introverted so I usually spend at least 1 day a week to recharge and drink a lot of chai. \r\n\r\n\r\n  \r\n   \r\n\r\n\r\nI\u2019m hoping you:        \r\n* Are silly/ goofy and somewhat weird in a good way.\r\n* Are career-driven and you have a positive outlook on life, and see us as a couple who will support each other in the positive and not-so-positive times.\r\n* Believe in mental health and therapy. (deal breaker)\r\n* Don\u2019t do drugs (deal breaker). Drinking is fine. \r\n* Love hugs (because bear hugs are <3 )\r\n\r\n\r\nIf I sound like someone you\u2019d like to talk to, you can email me at sohitmiglani@gmail.com .",
