    ProfileText: "\ufeffLet\u2019s go on a date!\r\nHi, I\u2019m John! Email me at johnrwoolley0@gmail.com\r\nGeneral Me stuff\r\nI\u2019m a textbook nerd in a lot of ways: I like sci-fi, video games and programming, and I sometimes get fixated on niche topics like the history of earth\u2019s climate or Sumerian civilisation. I am always excited by the complexity of the world, and driven to understand whatever I can of it. I love the rush that comes from figuring out something complicated. If you\u2019re into something I\u2019ll enjoy learning about it from you!\r\nI get a lot out of creating things. It scratches a deep itch in my soul to make a piece of software, a story, a work presentation, or even a Minecraft build.\r\nI am quite independent-minded and happy spending time by myself (only child thing?). I\u2019m a \u2018small group of close friends\u2019 person. I sometimes have to persuade myself to go and meet new people, but I generally enjoy it when I do, and I\u2019m able to find something in common with whoever I meet.\r\nLast year I signed the Giving What We Can pledge to give 10% of my income to charity over my lifetime, and I get a lot of satisfaction and well-being from helping to solve the world\u2019s problems in whatever small way I can. I\u2019ve been meditating daily for a few years and it\u2019s been hugely influential on my life/ethical philosophy, as well as helping with my tendency to overthink and get anxious.      \r\n  \r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n________________\r\n\r\nShorter points\r\n* I\u2019m 30 and I live in Manchester, UK. My degree was in mathematics and physics.\r\n* I\u2019m a software engineer. I\u2019m currently on a machine learning project (I promise to shut up about it if that bores you!).\r\n* I like reading books of all kinds (I read slowly but I get there!). I\u2019ve also written two (bad) sci-fi novels and I\u2019m trying to finish my third.\r\n* I exercise most days, though I\u2019m not a particularly sporty or outdoorsy person.\r\n* I used to play electronic keyboard a lot, I occasionally still do.\r\n* I\u2019m generally organised and tidy, with both physical possessions and general life admin.\r\n* I almost never do alcohol/drugs (except caffeine; I drink unreasonable amounts of tea).\r\n* I\u2019m open to either a mono or poly relationship.\r\n* I haven\u2019t thought a lot about having children but I believe I could be happy with or without them.\r\nYou\r\nI\u2019m looking for someone to have a long-term relationship with, maybe marriage, kids etc. I don\u2019t have a lot of dating experience, so I am generally open-minded about the whole thing. That said, I am attracted to femininity in its many forms (sorry gents, I\u2019m straight as they come). If you\u2019re aged 25-35, and living (at least partly!) in the UK, let\u2019s chat!\r\nBonus points if you live near to Manchester, have an intellectual curiosity, and would be up to playing video or board games together.\r\nTrivia\r\n* My best ever reddit post is a cool fact I learned about prehistoric humans. Other highlights include one of my minecraft builds and this thread I started just before Russia invaded Ukraine.\r\n* I\u2019m a bit of a picky eater (I lived off huel for a while) but I do occasionally like making shortbread or cheesecake to share with people.\r\n* I\u2019ve been collecting houseplants recently. Three and a half out of four are still alive, which I consider a great success!\r\n\r\n\r\nEmail me at: johnrwoolley0@gmail.com",
