    ProfileText: "\ufeffBasic stats:\r\nAge: 32\r\nHeight: 5\u2019 5\u201d\r\nLocation: London (but I\u2019m American).  Theoretically open to a LDR, and geographically mobile, but the barrier to not-Home Counties is higher.\r\nLooking for: LTR, and yes, marriage.  Also monogamous af.  Sorry.\r\n\r\n\r\nI absolutely do not want kids, ever.\r\nSexuality: Bisexual, but lean strongly towards men.\r\nContact: lagilbert@gmail.com\r\n\r\n\r\n  \r\n  \r\n  \r\n  \r\n  \r\n\r\nWhat I Want\r\n\r\n\r\nHonestly, the primary trait I want in a partner is intellectual curiosity.  I really don\u2019t care what you look like as long as you\u2019re interesting.  At work, I think about humans trying to maximize health and income, but I think I maximize on learning things.  I might be an information monster.  I just really, really love to learn stuff, and I really want a partner who shares this with me.  And I am looking for a partner - preferably for the rest of our lives.\r\n\r\n\r\n(Also, I never shut up about the things I am thinking about, so if you don\u2019t want to hear about everything from neutrinos to genocide scholarship, you aren\u2019t going to like me very much.)\r\n\r\n\r\nLogistics note: I\u2019m immunocompromised.  This means I still mask indoors; I don\u2019t eat or drink indoors, and I try to avoid indoor crowds.  I like to think that this affects my life pretty minimally; I just eat outdoors, and I\u2019m happy to wear a mask.  But I do still take precautions, and likely always will; if this bothers you, we are not a fit.\r\nAbout Me\r\n\r\n\r\nMy day job is as a research fellow for Open Philanthropy, on the global health and well-being side of the organization.  I research anything and everything that might cost-effectively improve people\u2019s lives, largely in the developing world.  I really care about this; I largely agree with Max Roser that \u201cthe world is awful, the world is much better, the world could (and should) be much better\u201d.\r\n\r\n\r\nIn my copious spare time, I\u2019m a QI elf[1] (yes, really) and an analyst for Geoquant.  In my further spare time, I am a Tarbell fellow and do some public facing writing on global development (see this essay in Works in Progress).  I am not not a workaholic, but you don\u2019t need to be; I care that my partner is passionate about something but not particularly if that something is a job, a hobby, or a dream.\r\n\r\n\r\nOtherwise (as per my website bio), I am being bullied by my cat, Lyra.  She is half my heart, and also very fluffy, so if you are allergic to cats, probably give us a miss.\r\n\r\n\r\n  \r\n\r\n\r\n\r\n\r\n\r\nSome more bio stuff: Words are very important to me; I write a lot, am Extremely Online (basically exclusively on Twitter) and I feel like writing is an important part of the base case of Lauren.  I can\u2019t not write.\r\n\r\n\r\nDespite this, my background is in STEM.  From ages 9-27, all I could imagine was being a physicist; I have a BS in physics from Caltech and did half a PhD in neutrino astrophysics at UCSD.  I then ran away and did another half a PhD in political science (really, applied microeconomics but in a poli sci department).  I interned at Open Phil and then just stayed.\r\n\r\n\r\nI am not not an effective altruist; I don\u2019t identify as an one - for reasons I can elaborate on - but I spend a lot of social time around effective altruists and will probably take the Giving What We Can pledge in the future.  That being said, I am an AI risk skeptic, and not open to dating rationalists.\r\n\r\n\r\nI care very deeply about politics, and I don\u2019t think I could date someone I substantially disagreed with about politics.  I\u2019m a YIMBY progressive, a feminist, and I think about policy like an economist.  I vote in every election - even the primaries, even down ballot.  Also, trans rights are human rights.  (I can\u2019t vote in the UK, but would be a Labour voter.)\r\n\r\n\r\nI love to travel, ideally off the beaten track.  It is important to me that I share this with a partner.  One of my favorite places I\u2019ve ever been is Georgia (the country) and Uzbekistan is probably next on my list.  Since I\u2019m permanently remote, I occasionally work from random places (Greece and Mexico in the last year).  I also go to SF once a quarter and am back and forth to the States on a semi-regular basis.\r\n\r\n\r\nMusic is also very important to me.  I love pop music, and I will not listen to takes that pop music is dumb and simple.  My favorite artists are Taylor Swift (I will see the Eras tour at least four times), Carly Rae Jepsen, and MUNA.\r\ntldr:\r\n\r\n\r\nGiven all this, I feel like the pros of dating me are pretty obvious.  I am always interesting; I am very smart and very funny.  (Indeed, one of the first pieces of feedback I got from a friend on this doc was that it doesn\u2019t show how funny I am!)  I am strong and independent, but also try to be kind and take care of the people I love.\r\n\r\n\r\nThe cons are also obvious: I do not try very hard to be conventionally attractive; I will show up to things with wet hair and I don\u2019t wear makeup; the immunocompromised thing is mildly annoying; I am blunt and sharp and I am not going to parent you.  I\u2019m kind of A Lot and I have no intention of changing that.\r\n\r\n\r\nI am basically seeking a partner that makes me feel like the Run Away With Me music video.  If this is intriguing to you, we could maybe turn the world to gold?\r\n________________\r\n[1] For the Americans: I write @qikipedia on Twitter a couple days a week.",
