    ProfileText: "\ufeffHello.\r\n\r\n\r\nMy name is Jeff.\r\n\r\n\r\n  \r\n   \r\n\r\n\r\nI make electronic music as JC++.\r\nI also throw parties every year or so.\r\nMy other two websites serve different purposes (comedic relief, spiritual relief).\r\n\r\n\r\nI\u2019m into computers and music and stuff.\r\n\r\n\r\nIf I could choose my last meal, it would be: a steaming bowl of ramen \ud83c\udf5c, a side of sushi \ud83c\udf63, two eggs \ud83e\udd5a, a fresh avocado \ud83e\udd51, and some coconut milk ice cream to top it off \ud83c\udf68.\r\n\r\n\r\nI\u2019ve gone to EDC 13 times and Burning Man 8 times (and counting). EDC wins out\u2026 slightly.\r\n\r\n\r\nI\u2019m looking for someone who is sweet, petite, and shares curiosity about the universe: life as we understand it, and our role to play in it. I really value physical fitness, mental health, and self-improvement \u2013 and I hope you do too.\r\n\r\n\r\nMy favorite TV shows:\r\n* The Simpsons (seasons 1-9 aka the golden years)\r\n* Breaking Bad + Better Call Saul + El Camino, together as one story\r\n* Mr. Robot\r\n\r\n\r\nMy favorite authors:\r\n* Stephen King\r\n* Haruki Murakami\r\n* Ted Chiang\r\n\r\n\r\n  \r\n\r\n\r\n\r\nWe will get along if you\u2019ve ever gazed at the starry night, or The Starry Night, and wondered if it was real... \ud83c\udf0c\r\n\r\n\r\nI am an emoji aficionado. In fact I\u2019m a proud sponsor of the control knobs emoji via the Unicode Consortium.\r\n\r\n\r\nI\u2019ve lived in Chicago, Boston, San Francisco, and New York City throughout different periods of my life. Guess which is my favorite. \u30c4\r\n\r\n\r\nI\u2019m a math and science nerd at heart (always will be), but in recent years I\u2019ve begun to more fully embrace my artistic/creative side. \u262f\ufe0f\r\n\r\n\r\n  \r\n\r\n\r\n\r\nThat\u2019s all for now. Reach out if you like what you see.\r\n\r\n\r\n__\r\njeffchang@gmail.com",
