    ProfileText: "\ufeffNice to meet you! I am a 38 year-old man living in middle Tennessee and looking for a monogamous relationship with a woman. Like most folks, I\u2019d love to find someone nearby but I am not opposed to long-distance either with the intention of joining forces one day. I\u2019m not interested in having kids and while I\u2019m an atheist, I don\u2019t mind it if you have other religious views.\r\n\r\n\r\nI\u2019m a thinly-built white guy who tends to straddle the line between introversion and extravert; I do normally score an INFJ on the Myers-Briggs personality test and am comfortable with labeling myself an \u201cAdvocate.\u201d That speaks to my nature of always wanting to be helpful and try to improve things for those around me and afar via art, work, or just being a friend.\r\n\r\n\r\n  \r\n    \r\n        Getting fancy! \ud83d\ude42                                         Standard-issue Jeremy\r\n  \r\n\r\nI found my current part-time role in marketing during the pandemic and enjoy what I do - especially since it is a non-profit. I have been in marketing for over a decade and found the scripting, planning, and development of campaigns very interesting. However, I recently got the itch to focus more of my time in the arts so I also spend half my time in my studio drawing, crafting the next big Halloween costume, or writing. I\u2019m thankful I can support my financial goals through work and still find the means to get into my passion projects. I\u2019m moving slowly into the publication space - children\u2019s books and comics - and couldn\u2019t be more excited about it!\r\n\r\n\r\n  \r\n  \r\n\r\nOtters - pencil drawing                                              Fancy Octopus costume\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n  \r\n\r\nAside from art-making, I am big into running as my main form of exercise. Hiking or walks through new areas are great and I am considering bird-watching in the future. I\u2019m a competitive person so board games and some casual video gaming are high on the list of ways to bond with other folks while also keeping the mind sharp. The Frist is among my favorite places to visit and sketch. I wouldn\u2019t mind some more traveling in the future, especially with a special someone by my side.\r\n\r\n\r\n  \r\n\r\nThe Parthenon - another great place to visit in Nashville; this is one of my favorite drawings in my portfolio\r\n\r\n\r\n  \r\n\r\nIf you are an ambitious and/or creative person, I bet we\u2019ll get along well! I really admire those who set out and actually make an attempt at accomplishing their dreams, regardless of the outcome. My ideal match also values staying healthy, honesty, integrity, and patience.\r\n\r\n\r\nI\u2019m at a stage in life where I wouldn\u2019t mind finding my life-long partner though I feel there is still time to let things unfold naturally. Part of the fun in dating is getting to know someone so if I seem like a potential good fit for you, send me an email at heyitsmrj2@gmail.com and use \u201cDate Me\u201d in your subject line. \r\n\r\n\r\nI hope you have a wonderful day and wish you the best,\r\nJeremy",
