    ProfileText: "\ufeffLast Endorsed: 10 September, 2024\r\nKey Stats\r\n* Name: Charles R.-W.\r\n* Gender: Male\r\n* Age: 25\r\n* Height: 5\u2019 9\u201d\r\n* Pictures: at the bottom so those who want to read unbiased by looks may do so\r\n* Education: BSc Mechanical Engineering, MSc Applied Physics, MSc Sustainable Energy Technology\r\n* Current Job: Operations Director at family bakery\r\n* Kids: Have none, do not want\r\n* Current Location: New Jersey, USA (near Philadelphia)\r\n* Religion: Atheist\r\n\r\n\r\nWhat I am looking for in a putative romantic partner\r\nSome concrete specs - to be a good fit, you should:\r\n* Be female\r\n* Be interested in a long-term monogamous romantic relationship, eventually with sexual intimacy\r\n* Not want children (ever)\r\n* Be roughly within the age-bracket of 20-30\r\n* Be located in the Philadelphia area, or open to a long-distance relationship, at least for the short-term; longer-term, who knows :\u2019)  I don\u2019t substantially disprefer long-distance relationships.\r\n\r\n\r\nDesirable characteristics:\r\n* You have a good idea of who you want to be - I like to say that my favorite thing about myself is that, of all the people in the world, I\u2019m the most like the person I want to be\r\n* Intellectually interesting - whether that be by having a great breadth or depth of knowledge, argumentative skill, or a love of learning.  Anyone with interests as broad as those I list below and of a vaguely similar-ish flavor is welcome.\r\n\r\n\r\nRelationship Dynamics:\r\n* I value friendship a lot, and think that a romantic relationship can\u2019t but be built on friendship.  At the same time, I\u2019m uncomfortable having to guess if a relationship is platonic or not - on such guesses, I have a miserable Brier score of >0.5. I think intimacy is best cultivated intentionally and with care, so unless/until otherwise explicitly stated, I\u2019ll assume anyone contacting me with reference to this doc is at least tentatively interested in a romantic relationship.\r\n* To my estimation, I think any relationship is like a tree - it has to be planted in a soil of at least minimal suitability, but after that, it grows based on how you care for it.\r\n________________\r\n\r\n\r\n\u2014--------------------------------------------Further Information about me\u2014--------------------------------------\r\n\r\n\r\nMy interests\r\n* Math, Physics, CS: These are the core of my intellectual life; I would prefer a potential partner to be familiar enough with math that we can use mathematical analogies comfortably in conversation.  I thank god every day that I know about eigenvectors.\r\n* History: I mostly read narrative histories (of the \u2018one damn thing after another variety\u2019), especially about the Roman Republic, the Byzantine Empire, post-Renaissance Europe, and Qing to modern China.  Lately, I've been trying a different approach, aiming to get a more in-depth understanding of the Versailles treaty and 1919 specifically.\r\n* Debate: I\u2019ve spent a few years as a pretty active member (and eventually president) of my university debate team.  I love the sport, but haven\u2019t been able to stay involved post graduation.  I\u2019ve inherited a residual passion, though, for analytical philosophy and sytstematic argumentation as a tool for learning.\r\n* Language Learning (the useless kind): I spent half a year teaching myself to read and write Latin.  I can read Caesar, and am working on the Aeneid - this is an achievement I\u2019m super proud of!  I translated the pilot episode of Evangelion into Latin as an engagement present for a friend.  I would love to practice speaking it if I can manage to talk someone into learning it ;)  Similarly, I\u2019m more recently learning Ancient Greek with similar aims.  I did eventually stop resisting the pull of my heart and learn toki pona (a kinda silly but super fun microlanguage); after Greek, I fantasize about doing Esperanto but maybe I\u2019ll develop the self-control to stop myself by then haha.\r\n* Chinese (not as useless, plus way harder, so gets its own entry!): I\u2019m studying Chinese now, with the aim of reading Lu Xun and eventually some more modern literature.  I can read vocab-annotated editions of some real Chinese books, so I\u2019m on my way!  I can read pretty well but my listening/speaking abilities are way way lower for now.  As above, the ability to practice with a potential partner (either as a native speaker or fellow learner) would be super fun!\r\n* Rationality-EA Memeplex: I enjoy reading and taking inspiration from everything in this corner of the world, but try to keep some distance to leave room for the cultivation of other interests.\r\n* Exercise/Health - I really like exercising!  I haven\u2019t missed a day in ~ 5 years.  I\u2019m planning to run in the Montreal Marathon, and then in a few months to run the OG Marathon in Greece (from the battle site at Marathon!)!\r\n        \r\nOther pertinent information\r\n* Right now I work as the \u2018Operations Director\u2019 at my family\u2019s bakery, mostly to get some real-world experience after spending a long time in school.  I\u2019m fairly-seriously considering a PhD in physics, but am pretty sure I want to move on to something more technical and aligned with my abilities.\r\n* I am gluten-free (due to Celiac disease).  More generally, I find my energy depends on my diet much more than most  - I basically always cook for myself, and don\u2019t put more energy into cooking than necessary for a healthy-if-bland outcome, but cooking with a partner could well be fun and I\u2019m open to it!\r\n* In the past I was pretty (clinically) depressed (mostly because of the Celiac disease mentioned above), but this has improved a lot over the past 5 years as I\u2019ve taken charge of my health extremely seriously; this is relevant in that it shaped me a lot, not because I anticipate being depressed again; I\u2019m doing consistently very good now and definitely expect that to remain the case!  I have a residual passion for pharmacology and neuroscience to boot!\r\n* I do not ever drink alcohol (by choice)\r\n* I exercise daily - typically running in the morning, and tai qi in the evening\r\n* In demeanor, I\u2019m a superposition of \u201ctrying to be like Cicero\u201d and \u201cmaking fun of someone trying to be like Cicero\u201d - not easily categorized as \u2018serious\u2019 or \u2018silly\u2019, but a delight nonetheless, I\u2019m sure.\r\n* I\u2019ve never been on a date or romantically involved before - I\u2019m pretty sure this is because I don\u2019t understand how dating is supposed to work and not because I\u2019m generally awful, but hey, caveat emptor I guess :\u2019)\r\n\r\n\r\nContact\r\nIf you\u2019re interested, you can contact me by email: [Given name] [Two Initials of family name, no hyphen] at protonmail dot com\r\n\r\n\r\n\u2014-----------------------------------------------------Pictures below\u2014------------------------------------------------\r\nI promise I can make other facial expressions, just not for pictures :\u2019)\r\n________________\r\n  \r\n\r\nA photo of me casting a die as the plane flies over the rubicon river (\u2018the die is cast\u2019)\r\n\r\n\r\n\r\n\r\n  \r\n\r\nSimilarly, 3D printed elephants coming with me across the alps - so that I can truthfully say \u201cI have led war elephants across the alps\u201d :::::::::::)))))))))))\r\n\r\n\r\n\r\n\r\n  \r\n\r\nTrying to cultivate my Caesarian facial expressions\r\n\r\n\r\n\r\n\r\n  \r\n\r\nManaging a game of diplomacy (the thermos is coffee and yes I drink that much every day :D)\r\n\r\n\r\n\r\n\r\n  \r\n  \r\n  \r\n  \r\n\r\nMiscellaneous ones that I think look fun/funny, but the resolution is too trash to make them any clearer lol sorry.",
