    ProfileText: "\ufeffHello!  My name is Rico.  I\u2019m now 29.  I\u2019m 6\u20190\u201d, and I\u2019m also autistic.  However, there\u2019s more to me than meets the eye.  I currently live in the greater Green Bay, WI area.  (Go, Pack Go!)\r\n\r\n\r\nI\u2019m heteroromantic and on the asexual spectrum.  Specifically, I\u2019m cupiosexual (Someone who doesn\u2019t experience sexual attraction but still desires a sexual relationship).  That said, I believe sex doesn\u2019t make or break a relationship, and I would be open to dating someone who doesn\u2019t want sex.  I\u2019m also a Christian, and my faith is very important to me.  I would prefer to date someone who shares my faith, but it\u2019s not required.\r\n\r\n\r\nI graduated from Northeast Wisconsin Technical College in 2017 from the Digital Media Technology program.  I am still searching for a job in my area, preferably in a video production type of role.  I\u2019m a very creative person.  I run a few YouTube channels and a podcast, and I recently wrote a feature-length screenplay.  I\u2019m a musician as well.  I write my own songs and recently started a music project with an internet friend.  I\u2019m also very computer-savvy, having created a few Hackintoshes in the past.  I\u2019m not really a coder or developer, but I wouldn\u2019t mind learning one day.  I\u2019m very much someone who likes to continue to learn new things.\r\n\r\n\r\nTopics of interest include:\r\n* Autism/Neurodivergent Rights\r\n* Theoretical physics\r\n* Lost media\r\n* Copyright law (reform/abolition)\r\n* Anything Disney\r\n* Music, especially:\r\n   * Owl City\r\n   * Coldplay\r\n   * Twenty One Pilots\r\n   * Imogen Heap\r\n   * Taylor Swift\r\n   * Sophia Fracassi\r\n   * Victoria Duffield\r\n   * Anything Pop/Top 40\r\n   * (I\u2019ll listen to nearly anything)\r\n* TV Shows, especially:\r\n   * Doctor Who\r\n   * House of Anubis\r\n   * Thomas the Tank Engine\r\n   * Castle\r\n   * General Hospital\r\n   * Ghostwriter (1992 PBS show and Apple TV+ Reboot)\r\n* Theatre\r\n* Writing\r\n\r\n\r\nMy love languages are quality time, words of affirmation, and physical touch.  In terms of what I look for in a partner, I\u2019d like someone I can form a genuine connection with who can take me on their next adventure.  I would like to try to get out of my small bubble and see what else is out there.  I also wouldn\u2019t mind working on a creative project together with my significant other.  My ideal partner currently doesn\u2019t have kids, but I would be open to starting a family one day.  I\u2019m monogamous and would prefer to date someone close to me, but I am open to long-distance relationships.\r\n\r\n\r\nI\u2019m sorry if this is all over the place; I generally suck at bios.  If I sound interesting to you and you want to get in touch, please email me at ricojrobbins@gmail.com.  Remember that you don\u2019t have to check every box I laid out.  I hope to hear from you soon!  I\u2019ll leave you with a few pictures of me:\r\n  \r\n   \r\n  \r\n\r\n\r\n\r\n  \r\n\r\n^^  Me doing a show on my college radio station\r\n\r\n\r\n  \r\n\r\n^^ Me with a friend I did a YouTube reaction video series with\r\n\r\n\r\n  \r\n\r\n  \r\n\r\n^^ Me meeting two Internet friends from Orlando, FL\r\n  \r\n\r\n  \r\n\r\n^^ Me meeting pop artist Daya at a concert\r\n  \r\n\r\n  \r\n\r\n^^ Me at play rehearsal for 12 Angry Jurors\r\n  \r\n\r\n  \r\n\r\n^^ My Halloween costume from 2024\u2026 Ask me about the character it\u2019s based on!",
