    ProfileText: "\ufeffCory Hinkle\r\nBrookville, Indiana 47012\r\nTwitter: @coryclauz, IG- caboose2233\r\nMy Date Me Doc\r\n\r\n\r\nAbout Myself\r\nHey there!  My name is Cory Hinkle and I am 26 and am based in Brookville, IN.  I am 5\u20198\u201d and am a Christian.  I\u2019ve worked in non profit retail at Goodwill for 3 1/2 years and counting.  I enjoy my job, coworkers and the donors I get to help out every day.  Some qualities I believe describe myself are family-oriented, hard working, honest, shy, introverted nerd with a big heart for the people he cares about.  I am looking for a serious, monogamous relationship with a female around the 23-29 age range, preferably Christian.  I\u2019m open to having kids in the long-term, but not interested currently as I help raise my niece already.  She means the world to me and fills that role at the moment.  \r\nHobbies/Interests\r\n* Church\r\n* Video games\r\n* Walking \r\n                  * Archery\r\n                  * Hanging with Family and Friends\r\n                  * WWE & AEW\r\n                  * Shopping, Swimming, Bowling\r\n                  * Alternative Rock\r\n\r\n\r\n\r\n\r\nHonest Fact about myself:\r\nI just want to be open with whoever reads this and is interested in getting to know me.  I'm usually shy and keep to myself. People that are close to me have always said that I\u2019m quiet at first, but can talk your head off once I warm up to you and get to know you better.  I\u2019m looking for a girl who isn\u2019t afraid of being her honest self with me and is looking for the same in her partner.  I'd love to spend time together getting to know one another and small things like sharing how each other's days went.  I like who I am and God\u2019s blessed me beyond what I could ever write down in this document.\r\nConclusion\r\nI hope if you are interested in getting to know one another better, you can dm me at my Twitter handle @coryclauz, or caboose2233 on my Instagram.  I am open to traveling around the Southeastern Indiana and Southwestern Ohio area if you are close and want to meet and go on a date together if we hit it off.  I am open to going to church together, walking, gaming together or whatever idea you have that sounds like fun.  I hope you have a great day either way if you took the time to read all of this!  Thank you!",
