    ProfileText: "\ufeffHow to Date me  \r\nStats\r\nAge: 42 (I have that Asian gene that makes me look 10 years younger).\r\nEthnicity: Asian \r\nHeight:  160cm\r\nLocation: Currently based in Incheon/Seoul, South Korea, open to long-distance or relocating.\r\nJob: Currently I am working as a consultant in the field of international development.\r\nPoly: Mostly monogamous but open to poly under the condition of well-defined terms and understanding\r\nSexuality: Straight\r\nReligion: Agnostic, I like the concept of Buddhism and its practicality. \r\nWant kids?: Yes (more info. below) \r\nWants to be stay-at-home-parent?: Possible. Always up for negotiation \r\nPersonability type: MBTI: ENTP/ENFP/ENTJ (I am multilingual and multi-personified)\r\nWhat I\u2019m looking for: Primarily a long term committed partner to build a life together (although open to short term things)\r\nWhere to find me online: seminshim on IG\r\nWhere I am coming from\r\n* Matters of the heart/passion: My first love was architecture. I loved it. I loved reading it, looking at it, learning about it, drawing it, imagining it, and bringing it to life. But, I was worn down by the sexist culture (at least in the architecture industry in South Korea 20 years ago) and no sight of work-life-balance). So, I decided that even if I loved it, I wouldn\u2019t marry it. I generally believe in the power of how humans have settled and constructed cities on the planet. I am a feminist who seeks to address the various injustices occurring in my home country, South Korea. While I may not possess extensive knowledge of feminism, I possess a keen sense of injustice and am passionate about gender equality. \r\n* Matters of work: I have been involved in the field of international development for over a decade. I pursued a master\u2019s degree in urban development with a focus on developing countries. Throughout my career, I have worked for international organizations, including the United Nations. Currently, I am based in South Korea, working as a consultant for governments and NGOs. I value the experiences I have gained from living and working in three different continents and seven countries - Cameroon, Senegal, Chad, Paraguay, Germany, Italy, and Belgium. Thanks to these experiences and my love of language, I am fluent in English, French, and Spanish, in addition to my mother tongue, Korean, and I understand German and speak very expressive Italian hand-gestures. \r\n* Matters of human connections: \"Lacan on Love\" by Bruce Fink was insightful in that it helped me understand and rationalize my own attachment style. I have also been persuaded by Dr. Helen Fisher's work on human mating and relationships. Alain de Botton's books, including \u201cOn Love\u201d and \u201cThe Course of Love,\u201d have helped me see what is actually going on when I fall in love, enter a relationship, and fall out of love. And his NYT piece, titled \"Why You Will Marry the Wrong Person,\" was a chance to reevaluate my own perspectives on love and its complexities (as much as 500 Days of Summer did). Of course, I get excited, feeling jittery, and more deeply connected to one person than  another, but I do value skills to love, and believe we can all grow those skills. \r\n* Matters of living: For over a decade, I\u2019ve been part of an online support group. We\u2019re a fabulous foursome, sharing our aspirations, goals, areas for improvement, and achievements. We support each other, find the best ways to reach our objectives, and celebrate progress. Thanks to these amazing individuals scattered around the world, I\u2019ve become a better version of myself - a more productive, positive, and a better functioning adult. \r\n* Matters of marriage, having a family and all that jazz: When I was 21 years old, I decided not to procreate, due to my aversion to too much emphasis on nuclear families in South Korea. I was also concerned about global overpopulation. But, the events of 2020, particularly the pandemic, prompted a shift in my perspective. I now desire marriage or a long-term commitment and a family. To ensure this works harmoniously with my concerns about climate change, I endeavoured  to work on addressing climate change - currently working on a decarbonization project for port cities, and I had my eggs frozen. \r\n* Matters of perspectives: I'm a growth-mindset person. My life's mission is to adapt to a goal-oriented society while savouring the process and, if possible, becoming a force for change. I thrive on challenges that push me to learn and grow. Maintaining both physical and mental health is important to me, so I try to avoid excess while still retaining a childlike sense of wonder and fun. I am open to exploring polyamorous relationships as they provide opportunities for self-discovery, understanding the other partner better, and exploring possibilities beyond societal norms. We will definitely talk about intentions, the inevitable presence of jealousy, self-doubt, self-worth, entitlement, as well as the importance of kindness and compassion among all individuals involved in such relationships.\r\n* Random things about me: In my 20s, I wanted to switch my career to become a journalist after leaving the architecture industry I mentioned above. Before making a decision, I went on a backpacking trip across China, Tibet, Nepal, India, and Thailand for two months to see if I was cut out for it. During my time in Nepal, I shared a trekking path with a WFP staffer, with whom I shared the ritual of having warmed rum and honey under the starry sky of Poon Hill, nourishing our tired legs and souls.I wrongly romanticised this experience, which subsequently laid the foundation for my journey into the field of international development. Additionally, I am in possession of the first printed edition of Joan Didion's \"Play It as It Lays,\" which is currently being auctioned at a price of $1,000.\r\nWho might be a good fit\r\nSome words that jump to mind\r\n* Open-minded to new experiences \r\n* Know how to cherish the moment and life in general \r\n* Intelligent\r\n* Love reading and discussing it\r\n* Kind and compassionate \r\n* Patient \r\n* Enjoy dancing; no need to be good at it.  \r\n* Maybe a bit weird (to zig to my zag)\r\n\r\n\r\nWhat can I offer as a date/partner/friend/brainstormer? \r\n\r\n\r\nWhat next? \r\n\r\n\r\nIf any of this sounds good, reach out! Email: semin.shim at gmail dot com",
