    ProfileText: "\ufeffTamera\u2019s dating doc\r\nStill endorsed as of Sep 21, 2023 (I\u2019ll try to update at least every two weeks ensure freshness)\r\n\r\n\r\n  \r\n  \r\n  \r\n\r\n  \r\n  \r\n  \r\n  \r\n\r\nIn brief\r\nHello! My name is Tamera, pronounced like \u201ccamera\u201d (\ud83d\udcf7) but with a T at the start. I\u2019m a 28-year-old woman (she / her pronouns) who works as an AI alignment researcher and lives in Berkeley, CA. I\u2019m looking for a man, aged ~24-34, who lives in the Bay Area and is looking for a primary, monogam-ish, or monogamous partner.\r\nAbout me\r\nPersonality\r\nTalking about one\u2019s own personality is always kind of a strange thing to do, but despite that I\u2019ll try to give you some flavor for what I\u2019m like!\r\n\r\n\r\n* Curious - I think the world is very strange and interesting, and I like to try to figure out what\u2019s going on. I see interesting questions everywhere and I am rarely satisfied with surface-level answers. Although I love to figure things out, I\u2019m relatively less interested in knowing things, except insofar as they\u2019re instrumentally useful to figuring things out (my favorite thing).\r\n* Silly - I like to laugh, joke, and communicate through humor. I get along best with people who like to banter and lean into the absurd.\r\n* Caring - I care deeply for the people around me, and I love to find ways to make their lives better. I enjoy being cared for in return!\r\n* Quick - I like to think on my feet and have high-bandwidth conversations. I like to be put in unfamiliar environments and figure things out on the fly.\r\n* Weird - Sometimes it takes my friends a long time to figure this out about me (since I\u2019m doing a great job of coming off like a normal person!) but I think the way I approach the world is at core very different from many people. This can be hard to articulate exactly so I suggest that you keep a eye out to try to catch a glimpse of what I mean here.\r\n\r\n\r\nOther adjectives that might be used to describe me include enthusiastic, extroverted, analytical, opinionated, novelty-seeking, and joyful.\r\nCommunity and culture\r\nI\u2019m very much a part of the EA / rationalist culture and most of my friends would identify similarly. I live in a group house with a bunch of people in this community, and it is quite central in my life. It\u2019s great if you\u2019re a part of this world too, but also totally fine if you aren\u2019t!\r\nActivities I enjoy\r\nGenerally an ideal weekday evening for me involves a good conversation with a few friends, or some kind of chill communal activity like a game or film.\r\n\r\n\r\nI also enjoy a constantly-rotating selection of hobbies. Some examples include:\r\n* Hiking / camping / backpacking\r\n* Many different crafts, including woodworking, bookbinding, and making my own backpacking gear\r\n* Plein air watercolor\r\n* Crosswords and other word games\r\n* Playing ukulele (although I am not very good at it)\r\n* Social dance, mostly contra but I\u2019m getting into west coast swing\r\n* Cooking (I used to do this a lot more)\r\n* Silly little home improvement and home automation projects\r\n* All sorts of trips and adventures with friends\r\n\r\n\r\nMany weekend evenings you can find me at some Bay Area house party chatting with a bunch of other AI weirdos like myself. \r\nRomance-specific details\r\n\r\n\r\n* Relationship style - I\u2019ve only ever been in monogamous partnerships, and I have been very happy with that in the past. I\u2019ve never had a serious polyamorous relationship; I\u2019m in the midst of exploring the idea now. I think the ideal for me is probably a deeply loving primary partnership with the freedom for other little flings and romances on the side.\r\n* Kids? - I\u2019m something like 60/40 against. I really like children but I\u2019m not wild about babies, and pregnancy truly freaks me out. I could be down but it\u2019d have to be under the right circumstances. I can honestly see it going either way!\r\n* Religion - I\u2019m not religious but I was raised Jewish. In my own calculus this doesn\u2019t matter much, but maybe to you it does!\r\nThe logistics\r\n\r\n\r\nI know it can be scary to reach out, but I wrote this dating doc because I want to find someone! So I\u2019d encourage you not to filter yourself out if you think there\u2019s a chance we could be a good match. (I am also likely being contacted much less often than you might think!)\r\n\r\n\r\nAlso, before we proceed, I\u2019d like you to be aware that it usually takes me a while to warm up to someone. I often don\u2019t feel comfortable with someone until I\u2019ve seen them in a number of different contexts and known them for a few weeks at least. If I\u2019m not all-in at first blush, don\u2019t worry, I might just need some time. In the interim I\u2019m likely to casually invite you to various parties and events so I can observe you in the wild so we can get to know each other without too much relationship-escalation pressure. :)\r\n\r\n\r\nThe best way to reach out is by texting me at: (\u202asix two eight) three three three - four seven two seven. Please send me some info about yourself, and we can find a time for a call or casual date. I look forward to hearing from you!",
