    ProfileText: "\ufeffThese laundry-list profiles are, in my view, totally beside the point and do not necessarily make for a lasting and fulfilling relationship. What I think does, and what I\u2019d like, is someone who\u2019d like to begin by just entering into a conversation, without a checklist of match-up criteria, just to see what might happen. I\u2019m interested in the person\u2019s mind, how their mind works, what they have to say, what interests them and above all what they say or don\u2019t say in the moment. The thing below is an example of what I had to say at a particular moment, an hour or so ago on August 18, 2023, on a morning when... Which would then segue into whatever was going on in my life and/or mind at that moment that I felt like writing about. I\u2019d like someone else to do the same, and then just maybe there might be a basis for something \u2013 indefinable because whatever it is, will evolve and be created by how we interact, the extent to which we trust each other and sense that each other\u2019s well being is important to us. I know this sounds kind of namby-pamby and vague, but talking about which composers I like or which books I read or what I do in my leisure time and my various careers: would that really tell anyone what they need to know? I suppose you could begin by asking yourself, What do I need to know about this person who\u2019s posted this bizarre, possibly unreadable, probably self indulgent, surely stonewalling, and far too long poor excuse for a profile? I mean: what do I need to know in order to have a conversation with him? Or should I just take the plunge and begin talking to him and see what happens?\r\n\r\n\r\nResponse to someone else\u2019s profile: \r\n\r\n\r\nI liked your profile, as profiles go. Meaning I could never write one like that, and I've been thinking a lot about what I could write, and when I have a moment and am in deep enough despair (just kidding, sort of), I might actually write and post one. But I don't really believe in them. I think people should just do what they would normally do if they met at a party or bar or wherever: Just begin talking and see what happens, which is what I hereby invite you to do. Via email at first, and then if it seems right/appropriate and the like, we can talk via a screen or you can board a plane and take a vacation in Budapest, where I live in a mega leafy neighborhood, magnificent view of the whole city from the terrace, beautiful walks and an interesting building (long story).\r\n\r\n\r\nI am of course kidding about the vacation in Budapest, but, well, you know, you never know. And again, in my experience writing into a vacuum as I am now doing (okay, your photos, which are lovely, and the profile, which I liked) doesn't hold a candle to actual communication. One thing we could try is emailing in real time, as opposed to using a chat platform. Or we could do google meet without the screen, which I find distracting, so it would be a free phone call. Or anything else you'd like to suggest. I do have other suggestions, but I've already said enough, probably too much, being brief isn't exactly my strong point.\r\nAnd as you can see there's very little profile-ish here, about my external life, because as I said, I think people should just write or say whatever they feel like writing/saying as in real life. And I really do invite you to do the same, without worrying about the impression it makes or anything like that. I've actually thought about starting a dating app which, like google docs albeit with a various differences, would encourage and enable people looking for a partner to do just that: just talk to each other, but within a particular structure that I'll elaborate on some other time, if we do end up talking to each other which I hope we do. If you have questions, you can ask, but here's what really interests me about anyone I meet, regardless of gender: how their mind works, what they think about, how interested they are in communicating, I mean passionately interested, and in communicating outside the envelope, if you see what I mean. Okay you don't: I mean just trying forms of communication other than the usual getting to know you sort of thing, to which I admit I'm kind of allergic. For example: sitting in silence (could be done on google meet as well, with or without a screen) and then just saying a few words now and then, but allowing the silence to dominate. That can be very powerful. Or deciding to free associate on any word, concept, name, really could be anything, and deciding on that would in and of itself make for an interesting dialogue. Or asking each other questions, but responding with only one or two words, or with a sound, or with silence (you'd say: silence, and then not answer). All this in the interest of getting beyond and underneath the superficial level of things, which when lived in the States, drove me A. crazy and B. into relative social isolation, apart from contacts through work and a relationship now and then, and that is a very long story for another time, or perhaps for never.\r\nSo I hope to hear from you. I do of course have a smartphone (just got it, didn't have one before two days ago), and the landline number is below.\r\nIphone: +36305676368. It's not on all the time because the battery isn't in great shape, so if you want to call, call the landline (+ 36 1 395 8751) and just tell me to switch it on and I will.",
