    ProfileText: "\ufeffHi there, I'm Eduardo!\r\nI'm a 27-year-old man doing my PhD in Astrophysics. Yup, I love the stars, but don't worry, I won't bore you with space facts unless you're really into that. \r\n\r\n\r\n  \r\n\r\n  \r\n\r\n\r\n\r\nA few things about me:\r\n\r\n\r\n* I'm Latino, and stand at about 1.73 meters ( 5'8\").\r\n* I don't drink, smoke, or do drugs. I've got no issues if you like a drink now and then, though.\r\n* I'm mostly a pescatarian, but I also enjoy eating chicken occasionally; I cut out red meat a long time ago.\r\n* I\u2019m looking for a genuine, monogamous connection with a woman.\r\n\r\n\r\nWhat I\u2019m into:\r\n\r\n\r\n* I care about social and climate justice, and I\u2019m especially passionate about helping students from underrepresented backgrounds in STEM.\r\n* Environmentally conscious: I do not own a car, so I always bike to places. I try to conserve water and electricity, and I've taken a recent liking to train travels.\r\n* Outdoors is my jam: hiking, kayaking, zip-lining\u2014you name it!\r\n  \r\n\r\n\r\n\r\nHobbies:\r\n\r\n\r\n* Swimming\u2014it's my go-to relaxation.\r\n* Playing the guitar.\r\n* Cooking and experimenting with recipes.\r\n* Hiking and exploring trails.\r\n* Always up to try different cuisines!\r\n  \r\n\r\n  \r\n\r\n\r\n\r\nWhat I appreciate in a partner:\r\nI value intelligence, kindness, and someone supportive. Not looking for academic accolades, just someone who's passionate about their work, has a good laugh, and genuinely enjoys helping others and making a positive impact on the planet.\r\n\r\n\r\nJust so you know:\r\nIf we hit it off and decide to meet, maybe we could have a fun story for how we met? Something other than \"online\" \u2014 like meeting at a crowded library while reaching for the same book on quantum mechanics. But hey, that's just a thought!\r\nFeel free to shoot me an email at elihumunguia7@gmail.com",
