    ProfileText: "\ufeffHi  :) !!! \r\n\r\n\r\n\r\n\r\nDear you, \r\n\r\n\r\nThanks for checking my date-me-doc-profile, I hope that you can find yourself liking what you are reading and will hopefully reach out to me at ritasabri00@gmail.com \r\nRemember, you do not need to meet 100% the \u201crequirements\u201d and  you hopefully think that I do not need to meet yours by 100% either, I truly believe in getting to know each other, being flexible with one another, making some changes to adapt for the best :)  \r\n\r\n\r\n\r\n\r\nWho Am I ?\r\n* On resume :  I am Rita, a 23 years old girl living in Nova ( DC ). I will graduated from the University of Pennsylvania with a master in Computer Science, I have previously attended a liberal art college for my Bachelor. I am not working at a Startup where I manage aviation-related data. \r\n\r\n\r\n* Background : I am Moroccan, hence I am from a warm culture if one must say. I am family-oriented and care about traditional values, I would love to have kids in the future. I am not religious. I admire cultures from around the world, my favorite exhibitions are on the second floor of the American Museum & Natural History in New York. You can download the map here to see what I am talking about. \r\n\r\n\r\n* Off-resume: I love traveling and discovering new places, I do enjoy interacting with locals a lot, and I use Couchsurfing for that. It is very important for someone to try and see what is out there, or try to be curious about what the state of the world is right now - and by that I mean its people. I will not understand someone who is not inquisitive about discovering new landscapes, people, cultures. \r\n\r\n\r\n* Personality: I am versatile. A perfect weekend for me would be biking around the city, walking around a park, watching movies, and choosing a particularly complicated recipe to make. I am someone that enjoys the little things in life, who enjoys being in one company and I do think \u2013 to a certain extent and with some exceptions\u2013 that happiness is a choice, and I always try to be happy. I am someone who can see beauty in everything, who is amazed very easily, who would genuinely be marveled by anything related to science and nature and I love being in this constant state of wonder, it is just who I am. \r\n\r\n\r\n* In a relationship: I am genuinely looking for a serious relationship, I like being taken care of and I do take care of my partner.  I like to think that I bring joy with my energy and happiness. I have a tremendous sense of empathy and I am great at communicating. I would like to believe that I eloquently share my feelings and that I will both push us to be the best of us. \r\n\r\n\r\nWho Are You ?\r\n* On resume :  You are a straight man who is 27 years old or older, you are above or 5\u20199, you are monogamous and you do not have kids.\r\n\r\n\r\n* Personality: You are a genuinely good person, you are emotionally intelligent, you are open to the idea of changing and evolving with your partner, you like taking care of your partner, you think life is beautiful, you are a bit traditional, you are empathic and caring, you like cuddling, walking and walking. You have a good credit score lol :)",
