    ProfileText: "\ufeffHi, I\u2019m Nate! I\u2019m 23, straight, and male. I\u2019m excited about finding an in-person community of people similarly enthusiastic about intellectual exploration. I love talking, hanging out in groups, and coordinating outings. Favorite activities include meeting friends at the park to invent random games involving tennis balls and frisbees, LAN parties, and foraging for wild foods. I just finished school, and I\u2019m very location-agnostic. I\u2019ll likely prioritize learning instead of full time work for the next year or two, although I\u2019m open to reconsidering in order to date someone in an expensive area. Longevity is on my mind a lot, and I\u2019ll probably end up in the field or earning to give to it. I\u2019m currently unsure about having kids. However, I definitely want rationalism and my weird little culture to spread. \r\n\r\n\r\nI was brought up as an atheist and ancap, though I\u2019m pretty agnostic about political philosophy now. Metaethics is a different story: I scrapped the remnants of deontology that I inherited, and I\u2019m now a staunch non-cognitivist. However, I still feel an aversion to coercion. Separating children from their mothers and preventing them from spending most of their day playing outside and otherwise doing whatever they find interesting seems pretty horrific to me. I\u2019m very inclined toward unschooling and aristocratic tutoring. \r\n\r\n\r\nI\u2019m open to polyamory and experimental relationship structures. I\u2019m not a jealous person anyway, but I\u2019m interested in seeing how novel situations affect me emotionally. I think about the evolution of emotions a lot, though that\u2019s one of the many areas where I get caught in analysis loops and should be more empirical! On that note, I\u2019m open to all sorts of lifestyle experiments. I\u2019m big on Crocker\u2019s rules, but I\u2019ve become very interested in discussing emotions in recent years. I\u2019m prone to existential melancholy and can be a bit dramatic, but I\u2019m not proud of it, and I\u2019m getting better at staying in a good mood consistently. I like snuggling. I haven\u2019t been big on gift-giving or unsolicited acts of service in the past, but I want to improve if that\u2019s your thing!  \r\n\r\n\r\nBesides cold, dry air-induced asthma and mild pet allergies, I\u2019m healthy as a horse. I\u2019m neurotypical but get along well with certain brands of autists. I love outdoor activities and playing sports, though you don\u2019t have to.\r\n\r\n\r\nYou can contact me at natestrum@rocketmail.com\r\n\r\n\r\nHere are some recent pics:",
