    ProfileText: "Date Me \u2013 Lulie\nSkip to content\nLulie\n.co.uk\nMenu\nOpen Problems / Questions\nDate Me\nAbout Me\nDate Me\nHi! I\u2019m Lulie, you can find out more about me below, or much more on my\nabout\npage.\nFill out this form\nif you\u2019re interested! I love people and I\u2019d love to hear from you even if you don\u2019t fit everything listed below \u2013 please don\u2019t be shy. \ud83d\ude0a\nAge: 35\nLocation: Oxford, UK\n\ud83c\uddec\ud83c\udde7\nMonogamous\nNever been married, want to\nDon\u2019t have kids, want 1-2\nPhilosophy Twitter:\n@reasonisfun\n~\u00a0 Social Twitter:\n@metaLulie\nMe\nEnthusiastic, driven to understand the fundamentals/first principles behind stuff, outgoing introvert, playful (but still British), introspective and self-aware, caring.\n\ud83c\udfa5\nHere\u2019s a\nvideo\nshowing my playful side, and\nhere\u2019s one\n(old) that\u2019s more intellectual.\nWorld views:\nI\u2019m a very open-minded classical liberal / Old Whig. I think people should have freedom, but I believe in morality (i.e. that some things are a bad idea). I value tradition as a good starting point, but I believe strongly in the advance of human progress.\nThings I\u2019m good at:\nJoyful, driven optimism. Explaining complicated/technical things in simple/understandable ways. Writing. Recognising the difference between substance and form, and the difference between meta and on-topic. Maintaining a childlike spirit. Irrepressible curiosity. Seeing things from another\u2019s point of view. Connecting people, creating/running communities. Using search engines to find the answers to stuff I don\u2019t know. Ten-finger typing (~100 WPM). Listening to audio at x3 speed. Learning how to learn. Art theory.\nInfluences:\nKarl Popper, David Deutsch, Richard Feynman, William Godwin, Thomas Szasz, Ayn Rand, Lewis Carroll, David Chapman.\nIf you\u2019re into Popper/Deutsch, stop reading here and\njust message me already\n. \ud83e\udd70\nLately, I\u2019ve enjoyed the work of\nJoe Hudson\n(emotions, connection),\nTiago Forte\n(productivity),\nDavid Perell\n(taking ideas seriously),\nMichael Ashcroft\nand\nPeter Nobes\n(Alexander Technique), and\nFrank Anderson\n(Internal Family Systems).\nRelationship style\nI\u2019m looking to date towards a somewhat traditional, long-term relationship, ultimately leading to marriage & children. I\u2019m a devoted partner, and I like pursuing my own interests and projects (if that\u2019s with my partner that\u2019s even better, but I\u2019m happy having alone time too).\nI want a masculine partner to complement my feminine wiles, but I\u2019d like us able to explore any way of relating! Relationships can have\nmore\nvibrancy and creativity when monogamous (and certainly more depth) than what\u2019s possible otherwise. I dig this line from Peterson,\n\u201cI\u2019ve slept with hundreds of women, and they were all my wife\u201d\n: an individual is so varied that you can have an infinite number of experiences with one person.\nI\u2019m a big romantic. \u2764\ufe0f\u00a0 (And recovering edgelord.)\nYou\nMy ideal partner is someone\ndeeply curious\nabout the world so we can explore it together,\nopen-minded\nso we can talk about anything,\nsocially skilled\nso we can go anywhere and interact with anyone,\nintellectually sharp\nso we can challenge each other,\nempathetic\nso the relationship is deeply caring and understanding without needing words for everything, and\nshares values\nwith me so we can be a well-functioning team. A bit of Feynmanian mischievousness doesn\u2019t hurt either. \ud83d\ude01\nLooking for someone in his 30s (or 29-43).\nI\u2019d like to connect over shared interests! Ideally one or more of my main interests:\n\u272c\nPhilosophy\nEpistemology, morality, consciousness, political & aesthetic philosophy\n\u272c\nArt\nClassical painting, concept art, manga, comics, caricature, editorial cartoons\n\u272c\nPsychology\nHow the mind works, therapy, mental health, personal development & productivity\nI have no height preferences, but if you work out that\u2019s a big plus.\nFamily\nI was home-educated and raised under\nTaking Children Seriously\n\u2013 a philosophy that aims to respect and help children by their own lights.\nMy life plan is to work on that philosophy, make it practical and accessible, and develop the movement. Figuring out how to create happy families and not break the spirits of children (and still have them function in the world) is, IMO, one of the most important things we can do upstream to facilitate human flourishing.\nI\u2019d like to find a partner willing to raise children with compassion, care and a profound respect for their autonomy.\n\ud83d\udc9b\nPhotos\nCopyright 2025 \u00a9 Lulie Tanett",
