    ProfileText: "\ufeffHi potentially future boyfriend!\r\n\r\n\r\nMy name is Nicole! If you have somehow stumbled upon this google doc through the interwebs, I\u2019m happy you\u2019re here. I\u2019m gonna go full listicle on you for this but I promise I can hold non-bulleted conversations \ud83d\ude05\r\n  \r\n\r\n\r\n\r\nMy ~vibe~\r\n* I smile and laugh a lot! I love doing silly things and going down rabbit hole conversations with strangers or friends \r\n   * Ex: I go to adult summer camps and my dream life would basically be having summer camp all year \ud83d\ude05\r\n* I\u2019m crafty! I can sew, knit, draw, paint, doodle, you name it. My love language is being able to sew buttons back on your shirt for you \ud83d\ude18 \r\n   * Ex: I\u2019m a full time artist and I make watercolor art about climate change. \r\n* In the words of the wise Nick Miller, \u201cI just want to live a weird and wonderful life together.\u201d \r\n   * Ex: I once hosted a peanut butter tasting to determine what brand is the best. Email me to find out \ud83d\ude09 \r\n\r\n\r\nSome things I value \r\n* Curiosity and creativity- I want a partner who follows their curiosity and likes to make things. That could be art, programming, music, whatever \u201cmaking\u201d means to you.\r\n* Silliness- I want someone to laugh with. \r\n* Nerdiness- Whatever you love, I love to hear about. I love a right brain/left brain combo.\r\n* Empathy and kindness- Looking for someone who is kind to the people in their life and feels warm and fuzzy to be around. \r\n* Community minded- I love gathering friends and being a part of intentional communities. Looking for someone who wants to create shared experiences with people we love. \r\n* Exploring- I\u2019ve traveled a lot in the past and love the mindset of adventure. Right now I\u2019m more interested in domestic travel and finding ways to explore my own city. I love weird art events, comedy shows, and getting out of the city on weekends.\r\n* Grounding energy- I\u2019m very creative and can float off into my own ideas. Having a grounding presence in a partner would be a nice balance. \r\n* Healthy- I love cooking, meditating, and swimming. Physical and mental health is really important to me! \r\n\r\n\r\nIn terms of my work life, I\u2019ve always cared a lot about what I do and want to work in fields that I think are making a positive impact in the world:\r\n* I started my first business when I was in my college dorm room. It was a handbag brand and I taught myself how to sew. I got hooked on entrepreneurship when I was 18.\r\n* I worked for a digital nomad company called Hacker Paradise my last semester of college and traveled through Southeast Asia and Europe\r\n* After graduation, I moved to NY and co-founded a kids coding program. We sold that in 2019.  \r\n* I pivoted to working in climate tech. For fun, I decided to paint a watercolor a day for 100 days and it went viral. I quit my job after 4 months of painting and now make art about climate change full time! \r\n* I make custom watercolor infographics for climate organizations like the Department of Energy, Harvard, Sunrun, and Project Drawdown. I published a coloring book about clean energy. I love what I do so much! \r\n\r\n\r\nYou\u2019re also probably wondering about the facts you normally get on a dating app:\r\n   * I\u2019m 31 and 5\u20196\u201d and looking for a monogamous relationship with a man. \r\n   * I don\u2019t know if I want kids. I may be open to adopting, fostering, or having my own if it feels right down the road with the right person.\r\n   * I\u2019m vegetarian and don\u2019t drink or do drugs.\r\n   * I\u2019m Jewish but don\u2019t actively practice.\r\n   * I live in NYC but don\u2019t plan to forever. I\u2019d love to live by a beach or lake in the future.\r\n\r\n\r\nGreen flags\r\n   * You make a clear plan with time/location and check in the same day to confirm\r\n   * You love what you do for work or have a hobby you love \r\n\r\n\r\nSay hi!\r\nIf you want to say hi, just shoot me an email at nicolek13@gmail.com. Tell me a bit about yourself and send over a photo! I have a preference to meet folks who live in NYC but I\u2019m open to other cities.",
