    ProfileText: "\ufeffKNOW SOMEONE WITH WHOM I\u2019D BE A GREAT MATCH?\r\n  \r\n\r\n\r\n\r\nContact details:\r\n* tyronebarugh+dating@gmail.com\r\n* Twitter DM to @barughtyrone\r\n\r\n\r\nWhat I am looking for:\r\nI am looking for a relationship with a woman between 25ish and 35ish who:\r\n* is high-energy, agentic, altruistic, humorous, passionate, and smart;\r\n* wants two (or more) children, the first in the next 2-3 years;\r\nThis doesn\u2019t mean I would expect my partner to be the primary caregiver. I\u2019d happily take on - or share - that role, especially if my partner\u2019s career was a big focus at that time.\r\n* has a secure or anxious attachment style;\r\nI think the attachment style concept is probably only directionally correct, and wouldn\u2019t superficially rule someone out on the basis of some avoidant traits. Equally, I think that something approximating the \u201canxious-avoidant trap\u201d is a pretty likely failure mode for my romantic relationships and I\u2019m fairly keen to avoid that.\r\n   * wants a monogamous relationship; and\r\n   * ideally wants to live most of the time in New Zealand or Australia (although I am flexible on location, and regular visits to New Zealand could also work!)\r\n\r\n\r\nHere is a bit more about me:\r\n   * I\u2019m a 29 year old cisgender man. For our present purposes, I\u2019m basically straight (I think I\u2019m mostly heteroromantic but bisexual).\r\n   * I\u2019m from Wellington, New Zealand, and am about to return (mid January) after spending half of 2022 living nomadically.\r\n   * I am a lawyer, but might not practice law indefinitely. I\u2019m motivated by the principles of \u2018effective altruism\u2019 (a social movement that encourages using reason, evidence, and an \u2018expected value\u2019 mindset to do the most social good we can).\r\n   * Until recently, this mainly caused me to secularly tithe 10% of my income to effective charities (I\u2019ve taken the \u2018Giving What We Can\u2019 pledge), although more recently I\u2019ve also joined the increasing number of effective altruists making changes to their career plans to increase their impact. Right now, I\u2019m trying to ensure that effective altruism organisations spot and manage legal risks that could limit their impact.\r\n   * As a partner, I\u2019m very dedicated and put lots of effort into the relationship. A flipside of this is that I can be quite emotionally needy - while I take responsibility for my emotional wellbeing, I expect to rely on my partner a lot for reassurance and to feel safe. I think I\u2019d be a good fit for someone who wants a really close, serious partner - and a bad fit for someone who wants an element of casualness long-term.\r\n   * Running hurts my knees, but I love cycling. I\u2019m really into skiing, and never grew out of going ten pin bowling. Day hikes are great, although I really like going on a multi-day hike with someone close and having a chance to have long form, meandering conversations over a few days. I\u2019ve recently bought a VR headset, and playing fitness games like \u2018Beat Saber\u2019 increased how active I am on rainy days a lot.\r\n   * A major hobby of mine is \u2018law as performance art:\r\n   *  I garnered the support of multiple legal academics in my bid to become the sole legal seller of cow\u2019s milk in Wellington, New Zealand in reliance on a long forgotten law from 1919.\r\nhttps://www.rnz.co.nz/national/programmes/thepanel/audio/2018836032/the-pre-panel-with-scott-campbell-and-sarah-sparks \r\n   * My \u201ccredentials and\u2026 enthusiasm to practise in the field of Pitcairn Law\u201d were described as \u201cimpressive\u201d by the Chief Justice of Pitcairn Island, who proceeded to decline my bid to be enrolled as a Pitcairn Island lawyer.\r\n   * I successfully fought to be naked in my passport photo.\r\n   * I like informative podcasts and videos. I like to know a little bit about everything, and would really value a partner who shares a curiosity about nearly everything. An exception to this is stuff that requires strong spatial awareness - e.g. learning how machinery works. I really struggle with this, and don\u2019t find it very interesting.\r\n   * I am trying to think more quantitatively and more clearly - I am interested in the \u2018rationality\u2019 project popularised in places like Lesswrong, but think \u201caspiring rationalist\u201d would be a fairer label than \u201crationalist\u201d.. \r\n   * I\u2019m perpetually confused by my personality, but the formulation a psychologist gave is that most things can be explained by the value I put on my close relationships - and also, I suspect, the universality with which I project that onto other people. I have a deep well of feelings in this regard. I bawled at age 11 watching the romantic comedy \u201c50 First Dates\u201d, and I\u2019ve been unable to bring myself to watch the movie \u201cLion\u201d (about an Indian boy adopted into an Australian family who goes to find his birth family and culture) because the trailer made me too sad. \r\n   * People usually think I\u2019m jovial, or even flippant - I was described by another lawyer once as \u201cvexatious\u201d, but that was more a function of his need to touch grass than my personality. In contrast to that external presentation, I quickly dial that down when someone needs support, or when there is serious work to be done.\r\n   * Big 5 personality test results:\r\n   * 96 on extraversion\r\n   * 96 on openness to experience\r\n   * 87 on agreeableness\r\n   * 85 on neuroticism (trying strategies to reduce this)\r\n   * 64 on conscientiousness (ADHD diagnosis, although I think fairly well managed)\r\n   * I am concerned about animal welfare and factory farming. May go vegetarian or vegan in the future, but currently instead choose to offset my moral harms by donating to highly effective farmed animal welfare charities.\r\n   * I have well controlled eczema. The way I keep this controlled, however, is semi unpleasant. I cover my entire body in emulsifying ointment before bed, which means I can be a bit sticky right afterwards. I wear long pyjamas, but nice linen will still get ruined pretty quick. My partner will inevitably be exposed to second-hand moisturiser. I do expect this to improve in the future; my dermatologist says that biologic drugs are available now and improve things heaps, but I don\u2019t meet the current funding criteria for them in New Zealand. Once this becomes widely available, I\u2019ll be less sticky - and, crucially, I\u2019ll be able to surf and swim as much as I like!\r\n   * I was previously obese (around 125-130kg), and am now overweight (98kg). My weight has been trending down fairly consistently, and I expect that it will plateau around 90kg.\r\n   * I\u2019ve got pretty powerful legs, probably from carrying around a big load for a while. (I love hiking now, because it\u2019s like I\u2019ve lost more than an entire hiking pack\u2019s worth of effort.) I have heterochromia in one eye, which I reckon looks pretty cool. And an extra vertebra!\r\n\r\n\r\n\r\n\r\nPhotos:\r\n\r\n\r\n  \r\n\r\n\tI use this photo for Linkedin, for work Slack channels, and as social proof that I can be serious in professional contexts if I really have to.\r\n\t  \r\n\r\n\tThis is one version of the good life - blue skies, a freshly stained deck, and a flourishing veggie garden in my suburban NZ backyard. I\u2019m not necessarily wedded to this version of the good life, and would love to know how my weekends might be different with you.\r\n\t  \r\n\r\n\tI don\u2019t take many photos, so haven\u2019t got a snap of my favourite suit. But a colleague did, and included it in my farewell card from my old job.\r\n\t  \r\n\r\n\tI like diving, skiing, cycling, and hiking.\r\n\t  \r\n\r\n\tFair warning - my hair might end up like this again some day!\r\n\t  \r\n  \r\n\r\n\tI love any opportunity to poke fun at the silly implications of things I sincerely believe. This year\u2019s halloween costume was \u2018rats on heroin\u2019, one implication of my belief that we should reduce suffering.",
