    ProfileText: "\ufeffIntellectual, sporty & conscious hedonist\r\n\r\n\r\nMy name is Juma, born in 1985, based in Berlin/Germany and I have a daughter (born in 2016). I founded a board game publishing company called Karma Games and still do that. So I wear many hats like designing board games, art direction, project management, marketing, sales etc. and I like it a lot.  \r\n  \r\n\r\n  \r\n\r\n\r\n\r\nMore pics: https://photos.app.goo.gl/s5u2hHTJ29c89ZpE8\r\n\r\n\r\n+ Addicted to bouldering, I go 2-3 times a week\r\n+ into dances like contact tango, lindy hop and contemporary\r\n+ non-fiction books about personal development, psychology, natural science and entrepreneurship\r\n+ radical honesty & non-violent communication\r\n+ board games, both party and strategic ones; I got more than 150 board games :)\r\n+ playing the piano\r\n+ I love singing, I was in several choirs for years and enjoy performing karaoke\r\n+ meditation\r\n+ cooking (vegan)\r\n+ Health nut, I don\u2019t do any drugs \r\n+ Sustainability & effective altruism\r\n\r\n\r\nI have both experience with long-term monogamist and poly relationships, and I am open to both or a \u201cpoly-light\u201d relationship.\r\n\r\n\r\nIt is important to me that you are sporty and political. If you are into board games, that would be a huge plus! \r\n\r\nMy daughter is with me 50% of the time, hence I will stay in Berlin/Germany for the next years at least :) My daughter and I speak German with each other. I tend not to have more children, but I am also not completely opposed to it if it clicks. \r\n\r\n\r\n\ud83d\udead\u265f\ud83d\udeb4\u200d\u2640\ufe0f\ud83e\udde0\ud83c\udfa4\r\n\r\n\r\nPersonality (ENTP-A Debater)\r\nDepending on the setting, you can experience me as rather introvert or extremely outgoing. I do enjoy me-time and at the same time I haven\u2019t hesitated to do karaoke in front of thousands of people (literally)! I am very curious, so I love to read about new scientific findings, but I also like to enlarge my own comfort zone by trying new and crazy things. Like I am often the first one to dance at a party as if no one is watching (while being completely sober). \r\n\r\n\r\n\r\n\r\n\r\n\r\nEN DE FR\r\n\r\n\r\nEmail: juma.aljoujou@gmail.com\r\nTelegram: @Innovatormentor\r\nFB: https://www.facebook.com/juma.aljoujou/",
