    ProfileText: "\ufeffDating me\r\nI guess I\u2019ll do it myself\r\n* I am agentic. I make my life how I want it to be\r\n* I am social. I have 50-100 friends, more than almost anyone I know. I like people, parties and conversation\r\n* I am earnest, trying to make the world better\r\n* I am well-described by ADHD, I am distracted, but I\u2019m trying to improve\r\nStats\r\nAge: 30. Yeah my hair greyed early.\r\nHeight: 6\u20194\u201d (1.94m).\r\nLocation: London, very happy to travel in the UK, long-distance is okay\r\nJob: I run a web development team of 3.\r\nPoly?: Yes, but my main focus is having a primary partner and I\u2019d try being monogamous for the right person[1]\r\nSexuality: Straightish\r\nWants kids?: Yes\r\nWants to be stay-at-home-parent?: A genuine possibility \r\nWhat I\u2019m looking for: Primarily a long term partner to have kids with (although open to short term things)\r\nWhere to find me online: Twitter - for my sins\r\nPhotos\r\n            \r\n\r\n\r\nDistinctive things\r\nGrey hair\r\nYes. It\u2019s grey. It has been since I was 13. I like to see this as a feature - you can experience the social opprobrium of dating an older man, without me being tied down by things like a house or a sports car.\r\nCharisma\r\nI don\u2019t know how one writes about this in a way that doesn\u2019t come across as obnoxious. People say I\u2019m charismatic.\r\n\r\n\r\nI\u2019ve hosted like 20 dinners.\r\nI did a rap on a train once.\r\nI started a project that got on wikipedia\r\nBlunt\r\nI\u2019m working on this, but I am blunt and spiky at times. Accuracy is very important to me and I\u2019m frank about money, sex, ambition, feelings. Some people really dislike this.\r\nLoquacious\r\nI love to have conversations. I text. A lot. I will definitely call you back first. I may be cycling at the time[2].  Hopefully you\u2019ll find this touching rather than annoying. But if you don\u2019t like being bothered.. \r\n\r\n\r\nI dated someone once who could spend the whole evening in silence. Reader, I did not marry her.\r\n\r\n\r\nThings I like to talk about:\r\n* Nothing. I like shit chat. I like blanket statements, pillow talk and complicated wordplay. I like to take dad jokes and push them father. My aim is not to be very funny on average, but to be very funny on aggregate.    \r\n* Feelings. I like to process how I have felt. About conversations and plans. I want to hear how you feel and what you want. I want to know you and be known by you. My sense is that fact is more interesting than fiction and that humans are more interesting when they are less mysterious. I know few people I don\u2019t like and with almost everyone I can find something fascinating.\r\n* Everything. I like talking about policy, effective altruism, forecasting. How to run the country, how to run the dishwasher, how to run away from this strange man who won\u2019t stop talking. It\u2019s all good stuff\r\n* You. If we were to date I would want to make you more like you want to be. I\u2019m pretty intense but if that\u2019s your thing then I want to be on your time. I want to help you in your job, your art, your mental health, your relationships with friends and if you want, lovers. \r\n\r\n\r\nI struggle to stay focused on one thing. If you want that. I\u2019m not for you.\r\nFriends and relationships \r\nI used to be an evangelical Christian and in the last few years have got really into effective altruism and forecasting. It\u2019s quite a switcheroo and I have a wide range of friends with a variety of worldviews as a result. I love community - I think and talk about rationalism, EA, neoliberalism, whatever tv show I\u2019m watching.\r\n\r\n\r\nIn general, I have lots of friends and move in a wide circle of people - I\u2019m often going to parties or visiting Durham for a week etc. etc. I\u2019d love for you to come with me but if that\u2019s not what you want then if it\u2019s a good match in other ways, I imagine we can figure something out\r\n\r\n\r\nMy default would be monogamish/an open relationship but I\u2019m open to discussing. I want to have a life partner but be able to connect with others occasionally. Integrity is really important to me and I have had trouble in the past with guilt around being flirtatious. I don\u2019t want that. I\u2019ll be honest and I\u2019m willing to be flexible, but I also want to be kind to myself. \r\nWho might be a good fit\r\nSome words that jump to mind\r\n* Curious\r\n* Playful\r\n* Honest\r\n* Intelligent\r\n* Kind\r\n* Patient\r\nFor balance\r\nI am very biased[3]. Some of my exes had a great time dating me, a couple did not. If you know any of my female friends, feel free to ask them for the details. I don\u2019t want to paint an overly rosy account.\r\nWhat next?\r\nIf any of this sounds good, reach out!\r\n\r\n\r\nOr share with a friend. I think I make clear the kind of person who would be a good fit and those who wouldn\u2019t.\r\n\r\n\r\nDM me on twitter or email me at nathanpmyoung@gmail.com \r\n\r\n\r\nIf something I could change turned you off, I\u2019d appreciate anonymous feedback at https://www.admonymous.co/nathanpmyoung \r\n\r\n\r\nIf you want a song that feels like dating me: https://www.youtube.com/watch?v=yc3Jo65Lct4 \r\n\r\n\r\n________________\r\n[1] I am also, not like all the other girls. I have a NSFW blog, which you can ask for by messaging me including the word gubernatorial or like, figuring out how to find it \r\n[2] This is probably the most stupid thing I do\r\n[3] Based?",
