    ProfileText: "Date Me | danwahl.net\ndanwahl.net\nMerch\nAbout\nDate Me\nEdit 2023-05-07: New pics!\nEdit 2022-09-22: Like me, this profile is a work in progress.\nOkCupid used to be pretty great, right? Back in 2012 or so? Instead of swiping you could\nsearch\n. The compatibility score\nmeant something\n. You could just\nsend people messages\n(ok maybe that part wasn\u2019t so great for everybody).\nThen\nsomething(s) happened\nand online dating stopped working.\nOne of those \u201csomethings\u201d was that we got older. Older and somewhat jaded, in my case. And if not exactly less attractive, then at least more of an acquired taste.\nAlso there was the rise of the Tinder Clones (of which OKC is now one of the worst). Also Instagram filters and Snapchat lenses. Also, you know, a pandemic.\nAnd so here we are a decade later writing bespoke \u201cDate Me\u201d docs, God help us. Somebody please,\nplease\nfix this.\n@okcupid\ncould do the dating world an enormous favor by simply bringing back their original interface circa 2012 (and leaving it be).\n\u2014 Dan Wahl (@fakedrwahl)\nMay 26, 2022\nIn the meantime, let\u2019s get back to basics.\nProfile\nMy self-summary\nWhat I\u2019m doing with my life\nI\u2019m really good at\nI\u2019m really bad at\nFavorite books, movies, shows, music, and food\nBooks\nMovies\nShows\nMusic\nFood\nThe six things I could never do without\nI spend a lot of time thinking about\nOn a typical Friday night I am\nYou should message me if\nYou shouldn\u2019t message me if\nPhotos\nProfile\nTrying on my soon-to-be new glasses at Warby Parker. More photos\nbelow\n.\nMy self-summary\nHi, I\u2019m Dan. Some stats:\n~40 years old\nBased in Chicago (Lincoln Sq)\nIn Denver regularly for work\nFrom Rochester, NY (most of my family still lives there)\nVegan since ~2016\nEasygoing\nrelationship anarchist\nCis, straight\nDemisexual maybe? Or at least sometimes slow to warm up\nOCD-ish (especially the \u201cO\u201d), but currently well-maintained via meds/therapy\n5\u20199\u201d (176 cm)\n~150 lbs (~68 kg)\nMS from University of Michigan (2007)\nBS from SUNY Buffalo (2006)\nPolitically liberal (more libertarian than leftist)\nAspiring\nEffective Altruist\nWhat I\u2019m doing with my life\nEngineering robots for a living (I run my own consultancy)\nSee my\nAbout\npage for some videos\nBoard member-ing at\nLEEP\nMaking things\nsuch as:\nA portable CO\n2\nmeter\nA Twitter bot for prediction markets\nAn automated ACX podcast\netc.\nBouldering and (e-)biking around Chicago\nI\u2019m really good at\nSports that involve balls\nFun fact: \u201cball\u201d was my first word\nFixing your bike\nFixing your computer\nCat whispering\n\u01a8\u027fo\u027f\u027fim ni \u01a8\u03f1ni\u029c\u0248 \u03f1nib\u0252\u0258\u042f\nI\u2019m really bad at\nPicturing things in my head\nChess (probably related)\nSwimming (though I did recently\ntake lessons\n)\nSinging harmony\nI\u2019m just ok at dancing.\nFavorite books, movies, shows, music, and food\nBooks\nOne Hundred Years of Solitude\nA Confederacy of Dunces\nThe Lathe of Heaven\nAlso the Hanish Cycle\n1950s Science Fiction\nEverything by Vonnegut and DFW\nSee\nmy Goodreads profile\nfor more.\nMovies\nPseudo-intellectual sci-fi movies involving time loops (it\u2019s a Netflix genre).\nI also have a special place for low-key romcoms like:\nJust Like Heaven\nHow Do You Know?\nReturn To Me\nUnder the Tuscan Sun\nSleepless in Seattle\nYou\u2019ve Got Mail\nThe Holiday\nAmerican Ultra(?)\nAn American President\nDave\nThe Little Hours\nBlast from the Past\nShows\nI watch\na lot\nof TV, but mostly in the background while working. I have probably seen\nthat show\nbut only faintly remember details about the characters/plot.\nMusic\nBeck\nBelle & Sebastian\nBon Iver\nFleet Foxes\nJacob Collier\n(holy shit right?)\nKendrick Lamar\nMy Bloody Valentine\nRadiohead\nSharon Van Etten\nSufjan Stevens\nWilco\nFood\nMy diet mostly consists of:\nBlueberry bagels and Tofutti cream cheese\nMorningStar Chick\u2019n patties\nChai lattes (oat milk)\nSoylent (Mint Chocolate or Strawberry)\nI\nwill\neat all of your snacks though.\nThe six things I could never do without\nCarbon\nHydrogen\nNitrogen\nOxygen\nPhosphorus\nSulfur\nI spend a lot of time thinking about\nHow strange it is to be anything at all.\nAlso:\nIs my head moving faster than my feet?\nReally though, what the hell\nis\nmoney?\nOn a typical Friday night I am\n[THIS PROMPT INTENTIONALLY LEFT BLANK]\nYou should message me if\nIn the short-term, I\u2019m open to connections of all varieties, but am especially looking for in-person dates with women 25 to 45 years old, who are smart, attractive, and kind (or at least 2/3).\nIn the medium-term, I\u2019d like to find one or more new romantic partners that I see with some regularity. For reference, I currently have a long-distance partner of 5+ years.\nIn the long-term, I\u2019m not sure! I\u2019ve recently gone from being a \u201cno thanks\u201d to a \u201cmaybe?\u201d on having kids (though it\u2019s still hard to imagine\nintentionally\nseeking them out). I\u2019m historically not much for cohabitation, and value my independence (and my partner\u2019s too).\nYou shouldn\u2019t message me if\nYou\u2019re exclusively looking for a monogamous partner\nYou want to have kids\nsoon\nYou don\u2019t like truth-seeking conversational norms\nYou\u2019re not willing to eat vegan around me (within reason)\nBut if you\u2019re on the fence, you might as well just say\nhi\n!\nPhotos\nGetting back into climbing after a ~10 year broken-hand hiatus.\nAt Buzz Mill in Austin, a 24 hour coffee shop/bar, which is the best kind of bar (and coffee shop).\nHowever, I do not mix well with caffeine.\n\u2026\nDream, baby.\ndanwahl.net\nDan Wahl\nhi@danwahl.net\ndanwahl\nfakedrwahl\nmaking things (better)",
