    ProfileText: "\ufeffDate or befriend me?\r\nAs described in The Guardian and The New York Times\r\nFeel free (encouraged even!) to share!\r\n\r\n\r\nAbout me\r\n36-year-old female living in London (but might move to the Cotswolds next year). A mix of creativity, spirituality, and grounded practicality, I\u2019m seeking someone who values meaningful connections and shares my values of ethical living and personal growth\r\n* A mix of introverted and extraverted tendencies, I enjoy a balance of socialising and quiet time. I prefer small gatherings or one-on-one conversations over large group discussions\r\n* Vegetarian, I eat 95% vegan, with the occasional vegetarian meal/snack when abroad/visiting\r\n* Somewhat frugal, partly wanting to save money (and perhaps retire early), partly because I value simplicity\r\n* I care about my impact on the world and moral implications of my actions\r\n* My main love language is physical touch and I\u2019m curious about exploring Tantra more\r\n\r\n\r\nThings I do/like\r\n* Go to self-developmental/spiritual workshops/events and embodiment practices like Moving Connections/Contact Improvisation or occasionally ecstatic dance. \r\n* Organise and facilitate meditation groups and retreats\r\n* Learn about psychology and understanding human nature\r\n* Hike in nature; I also walk a lot around the city, everything within an hour I\u2019d call easily walkable \ud83d\ude42\r\n* I like animals and enjoy pet sitting which I do as a side hustle (my main job is data analyst)\r\n* I used to travel quite a bit pre-pandemic, however these days I value more building community where I live\r\n* Draw, craft and/or paint portraits of my friend\u2019s pets \ud83d\ude42\r\n* Read books, both fiction and non-fiction\r\n\r\n\r\nThings I don\u2019t often do\r\n* I\u2019m not much of a foodie - I batch cook and don\u2019t mind eating the same thing for number of days; I usually prefer to spend my time, money and energy on other things\r\n* Sporty things - I enjoy gentle activities like hiking, cycling, and swimming, but I\u2019m more focused on the experience rather than athletic achievement\r\n* I rarely drink alcohol and don\u2019t watch streaming services much\r\n\r\n\r\nLife ideas:\r\n* I would like to have 1-3 kids, ideally starting within the next 2.5 years\r\n* I\u2019d prefer to move out of London to a more nature-connected or communal environment to raise a family\r\n\r\n\r\nWhat I\u2019m looking for\r\n* Someone emotionally available and responsible, who values transparency, open communication, and believes that love is both a feeling and a choice\r\n* Spiritual yet grounded and rational\r\n* Playful/compatible sense of humour\r\n* I appreciate partner who is mindful of my ethical choices and would be open not to eat meat and fishes in front of me; I feel the need to disengage emotionally in these situations and I wouldn't want to be disengaged emotionally around my partner\r\n* Open to having child(ren) within the next 2.5 years\r\n\r\n\r\nA few caveats\r\n* It might take me some time to get used to someone and build trust. It is important to me that a relationship starts from the place of friendship and respect\r\n* I\u2019m primarily seeking a long-term connection, but if we get along really well I might be open to short-term too\r\n* Similarly, while I\u2019m primarily looking for monogamy, I\u2019m open to exploring ethical non-monogamy with the right person - someone experienced and responsible in navigating such dynamics\r\n* I\u2019d rather meet in person to see how we get on than keep texting - but please do share why you think we might be compatible\r\nWhat next?\r\nIf this resonates, I\u2019d love to hear from you (perhaps by email at jekot.agnieszka@gmail.com)",
