    ProfileText: "\ufeffAs of early 2024, I\u2019m currently in a stable committed relationship and am not looking for a new partner.     \r\n\r\n\r\nHi! I\u2019m Meredith. \r\n\r\n\r\nAbout me:\r\n* I\u2019m a 34, straight, monogamous woman living in Oakland\r\n* I drink socially; I don\u2019t smoke; I don\u2019t do drugs.\r\n* I\u2019m somewhere between 5ft 6in and 5ft 7in tall.\r\n* Descriptive words: bubbly, passionate, smart, kind, fun, confident, friendly\r\n* I want biological kids. Note that I\u2019m a carrier for cystic fibrosis, so bonus points if you know you\u2019re not a carrier. \r\n* I\u2019m comfortably liberal, particularly in the classical sense of that word. I often find I\u2019m arguing the conservative position in the Bay Area, and the liberal position elsewhere. I read Matt Iglesaias, Astral Codex Ten, the NYT (sorry Scott), and The Dispatch. I also listen to approximately one bajillion podcasts. \r\n* Enneagram 2\r\n* Meyers-Briggs ENFJ \r\n* According to my unprofessional self-assessment of the Big Five: I\u2019m high in conscientiousness and agreeableness; and moderate in openness and extraversion. I\u2019m probably also moderate in neuroticism (I tend to run anxious, but have it well managed at the moment.)\r\n* A deeply committed Christian only looking to date other Christians. (Wish me luck!)\r\n\r\n\r\nHobbies: I love reading, and probably read a book a week on a wide range of topics from sci-fi/fantasy to pop science to women\u2019s literature. I enjoy cooking and good food, and like to make delicious healthy meals on the weekends to have leftovers all week. I try to stay active, and enjoy hikes / the outdoors; morning jogs; and Zumba or Yoga classes. I\u2019ve been teaching myself how to play the guitar (fingerpicking style) for a bit over two years. I still identify as a beginner, but I am having a great time and have made a lot of progress. I bought a condo last year, and practicing hospitality is an important part of my life. I enjoy trying new things and special events; for example, I just signed up for a glass flameworking class at the Crucible, and regularly go to Broadway musicals at the Orpheum with a grad school friend. I got scuba certified earlier this year, and love being underwater; I\u2019d like to plan my next trip to go diving! \r\n\r\n\r\nI try to give back as an expression of gratitude. I tithe and also give on top of that, as I like the ideas of effective altruism (although a lot of effective altruists would probably disagree with my priorities as they\u2019re biased by my faith). In addition to money, I try to also be generous with my time; I make space for volunteering both in and outside of my church. For me, gratitude is the appropriate response for the privileges I have received in life (spiritually, monetarily, personally); and the manifestation of gratitude is generosity. I believe, and experience, that a life lived generously leads to joy. I seek out joy in my day-to-day decisions and circumstances! \r\n\r\n\r\nProfessionally: I got my PhD in Chemistry at Berkeley, and now work as a project manager at Genentech. I love my job, as it\u2019s a great combination of helping people work together better and learning more about how biology works \u2013 and developing the next generation of medicines to help patients. I\u2019m currently working on how I can grow in supporting community-owned solutions to challenges (rather than pushing through a solution that works best for me), and that is a satisfying self-improvement endeavor. My career is very important to me, although I\u2019m typically the kind of person who leaves work at work. I believe in work-life balance.\r\n\r\n\r\nTheology: I am Protestant, reformed, egalitarian, mostly conservative/orthodox in my views (of note, including around issues of sexuality). My favorite theologian is NT Wright; I also respect Tim Keller and CS Lewis. I enjoy debating theology, and don\u2019t need to have complete theological alignment with a partner; but I do need mutual respect, and openness to female leadership in the church (because I\u2019m open to a call to be an elder, etc, in my future; and I don\u2019t want to get in a place of needing to choose between my spouse and a call from God). Outside of that practical matter, I remind myself that we\u2019re saved by Christ, and not the correctness of our theology. Various prayer practices and time spent in Scripture are an important part of my faith. I believe that faith should be put into action through both holiness and service. \r\n\r\n\r\nYou: I\u2019m looking for a smart, attractive, fun, Christian man who is confident enough to stand up for what he believes; humble enough to change his mind; and comfortable in his own masculinity. The ideal man for me would be self-aware, compassionate, and striving to be more like Christ. I want a partner in life \u2013 the kind of person who makes me better, and who is better because of his relationship with me; and the kind of person who is a great friend, present for the big and small moments of life. Mutual attraction and physical affection are also important to me. \r\n\r\n\r\nSend me a note if you\u2019d like to connect!\r\n\r\n\r\n\r\n\r\n  \r\n\r\n  \r\n\r\nTop: Diving in the Maldives\r\nBottom: Me with my sister in a hot air balloon",
