    ProfileText: "Home\nSearch this site\nEmbedded Files\nSkip to main content\nSkip to navigation\nGraham Bessellieu's\nDating Profile\nThanks for stopping by! This site is the result of wanting to take a much more raw, direct and public approach to seeking a life partner. If anything here resonates with you, feel free to\nreach out\n. :-)\nKey\nAge: 33\nSex: Male\nLocation: Currently Ewing, NJ but my work is remote and am open to travel/relocation.\nBody: 5ft 10in. 140lbs. Working to improve gym habits.\nMonogamy: I'm interested in romantic commitment to one person, as I feel this leads to greater depth/growth/profundity. (This is not a unilateral critique of poly, just a personal preference.)\nChildren: None, currently. Family is not a requirement, a strong and meaningful relationship is the most important, but I think it would mean a lot to me. I'm open to either adoption or biological kids. I subscribe to the philosophy of t\naking children seriously\nand believe in cultivating an environment of love, care, play, learning and creativity. <3\nJoy, Creativity & Progress!\nI believe it's incredibly important, given our limited time on this earth, to follow what genuinely sparks joy, instead of limiting or self-coercing into a more narrow path of least resistance. To embrace one's passions, interests and what's fun (in the Richard Feynman sense). I find inspiration in David Deutsch's notion of\noptimism\n: that all goals are either impossible (due to laws of physics) or achievable given the right knowledge. And therefore that every moment is an opportunity for learning and growth, even amidst failure and setback. That creativity is our greatest, most precious asset and the bedrock to an infinite potential for progress.\nAnd so, I'm looking for partner to make progress with! To cultivate a life long relationship to be deeply proud of and moved by.\n///\nPhilosophy/Values\nMy core interests are philosophy, science & technology, and the arts.\nI value philosophy, science and technology generally as I find them one of the best tools for guiding and refining our thinking, promoting the growth of knowledge, and shaping cultural progress.\nThe arts, however, are closest to my heart. I believe they have an immense potential for promoting joy, connection, reflection, novelty, fun, empathy and expression.\nWhile the others are primarily laymen/outsider interests that I am not an expert in, I do have an art school background (BFA).\nI live for finding and cultivating beauty, celebrating the joy and precious idiosyncrasy of others, reducing suffering, improving flourishing and leaving an impact wholly true and distinct to yourself.\nTo know my work, whether it be humanitarian or artistic: a portrait, a piece of writing, a film, song, or game could live on for others to cherish is a beautiful and precious opportunity.\nWork/Projects\nI currently work as a freelance video editor and creative professional. I try and align to clients that match my values and ideals.\nOutside of freelance, I have a passion project developing an all-ages adventure game fable (as a tribute to\nMiyazaki\nand what I view as the immense artistic potential the medium holds.) Given the complexity of this project, however, this is something I imagine working on gradually throughout my life.\nI also have a YouTube\nchannel\nwhere I occasionally develop video essays.\nMy studio practice is important to me. I believe one's life is an art work and of developing a body of work you're proud of. :-)\nRelationship Style\nI'm seeking a thoughtful, creative relationship where we can bounce ideas off each other, have compelling conversations, share, critique and support each other's work. To collaborate, challenge each other, develop and strengthen shared values and make progress together!\nLet's make art, music, write and play games together. :D\nI've come to realize I have a much more romantic orientation overall, built on love and shared values. Sexuality, passion and intimacy is nice, but genuine care and connection is far more important.\nI'm a big fan of sincerity and transparency and dislike small talk and sarcasm. I believe in commitment to sharing each other's problem situation out of love and respect.\nGender/Aesthetics\nI tend to think people are complex and can't be put in stereotypical boxes. There are characteristics of both masculinity and femininity that I respect and find worth cultivating. I tend to dress in a more masculine fashion, though I also want to start building a more vibrant and fun fashion sense.\nI am attracted to a more feminine aesthetic, have only dated women to this date and am primarily sexually attracted to women. That said, I am open to dating other sexes. More-so than anything, genuine connection and shared values seem to be a key factor for attraction greater than sexuality. In this sense, you could call me a romantic.\nEthics\nI went vegan after watching the documentary \"Earthlings\" and Peter Singer lectures, and now work on a vegan ethics podcast called \"\nSentientist Conversations\n\" which focus is:\nevidence, reason and compassion for all sentience\n.\nI'm not opposed to dating a non-vegan, as I myself was one and I recognize it is quite a novel movement historically speaking and not a cultural norm, but it is important to me and I do believe it represents moral progress.\nInfluences\nI have a soft spot for the beauty of\nArt Nouveau\n, the fun of\nadventure games\n, the rich imagination of\nStudio Ghibli\n, and the bold unwavering optimism of\nStar Trek: The Next Generation\n. ;-)\nGoogle Sites\nReport abuse\nPage details\nPage updated\nGoogle Sites\nReport abuse",
