    ProfileText: "\ufeff@rmushkatblat / Robert Mushkatblat\r\nEmail: bobert.mushky@gmail.com\r\n  \r\n  \r\n  \r\n\r\n\r\n\r\nVery Short Summary\r\nChild of Soviet Jewish immigrants, software guy, calm.  70% predictable from archetypes.\r\nA Little Less Short\r\nOccupation: lesswrong.com\r\nOrientation: Straight / Monogamous\r\nTraits poorly predicted by archetypes:\r\n* I show up to things on time, don\u2019t miss appointments, and file personal taxes well before the deadline.\r\n* I appreciate fine dining and tea (as artforms, not merely as hedonism, though that\u2019s good too).\r\n* I drink infrequently (maybe 5 times in the last year?).\r\n* I dance (international latin ballroom).\r\nPersonality: Most comfortable in groups of 2 - 6, care a lot about those things that I focus on (ethics and aesthetics both); have sometimes been called a snob (affectionately).  Not a huge fan of super loud events, though I like the occasional prog metal concert.  I like to share my joy in food with friends & partners, and figure out what they like well enough to remove the need for them to exert any sort of mental effort on making decisions in that domain if they want.  (Food is not the only thing, just a good example of how I relate to people.)\r\n\r\n\r\nWhat I\u2019m Looking For\r\nPersonality:\r\nDespite my archetype (high-decoupling nerd male software engineer), most of my closest friendships rest more on personality fit and mutual openness + support, rather than shared careers, interests, or hobbies (excepting rationalism).  Which is to say I spend some time talking about software or x-risk with friends when off the clock, but not most of it.  I probably would not have predicted those particular friendships ahead of time.\r\n\r\n\r\nIn retrospect, important components have been:\r\n* Ability and willingness to discriminate between factual disagreements and values differences.  See: high-decoupling.\r\n* At the same time, not being strongly focused on contentious but intractable domains, like mainstream politics\r\n* Having an even temper.  Many other personality traits have been highly variable; e.g. I have quite a bit of practice supporting people through bouts of imposter syndrome.\r\n* Actually deeply giving a shit about something.  I\u2019m not sure if this is causal but it sure has been a common thread.  That something is not always something I personally care about a ton, but it\u2019s generally intelligible to me.  Examples: the flourishing of the local community one grew up in, exploring the limits of communication styles & bandwidth for another\u2026\r\n\r\n\r\nSocialization:\r\nI like small things more than big things.  My tolerance for size increases when I know more of the people.  Quieter is better than louder.  Unstructured is better than structured - I\u2019m not big on board games or movie nights (\ud83d\ude2c) but do like spontaneously-occurring pockets of discussion.  These are derived from how I\u2019ve felt across many different events, activities, and relationships, and exceptions certainly exist.  Of course, the kind of relationship I expect to be healthy anticipates occasions where we meet halfway and and those were we fly solo, depending on context.\r\n\r\n\r\nI am basically happy to pack my calendar full of socialization, obligations permitting - I\u2019ve yet to run into situations where I was turning down opportunities to socialize because I\u2019d had enough rather than because I didn\u2019t have the time, or because I didn\u2019t expect to enjoy myself doing that particular thing.  However, I wouldn\u2019t feel particularly bereft if I spent a week at home, if I was doing something useful with that time.\r\n\r\n\r\nChildren:\r\nAt least one, and would want to see how the first one goes before deciding on more.  Pessimistic about traditional education, mostly due to personal experience, and would pretty strongly prefer defaulting to homeschooling or thoughtful co-op arrangements.  Ultimately, though, would want to defer to whatever actually worked best for the kid, as the person with the most introspective access relevant to the situation.\r\n\r\n\r\nMaintenance:\r\nI take care of myself reasonably well and happily outsource other things (e.g. house cleaning).  I do have aesthetic preferences about my living spaces but put a pretty heavy penalty on things that add significant overhead in terms of time and attention.  I find doing tasks in this category much easier with another person than doing them alone, but don\u2019t want to over-promise.\r\nInteresting things I\u2019ve done (or have happened to me):\r\n* I wrote the first long-form HP/f!TMR[a][b] fanfic (it\u2019s not actually great, but it is completed)\r\n* Got as far as \u201cfinished MVP and launched\u201d with a startup while working full-time\r\n* Have been stung by jellyfish three (3) times and lived to tell the tale\r\n* No longer keep track of how many times someone has said \"this is the best thing I've ever tasted\" or similar after taking them somewhere new\r\n* Speak mother tongue near fluently (\u0440\u0443\u0441\u0441\u043a\u0438\u0439)\r\n* Flexible enough to do things too disturbing impressive to be written down\r\n\r\n\r\nHobbies (and how to get to know me):\r\n* Ballroom dance (international latin ballroom, could use a partner)\r\n* Choir\r\n* Tea (currently exploring aged whites)\r\n* Run LA rat meetup (I continue to be semi-active in the Discord server)\r\n* Food (my FTC profile, for my writing in a totally different social context)\r\n* Glowfic\r\n* Used to spend time helping people get better jobs (mostly software)[c]\r\n[a]love you for saying this / admitting that you write fanfic <3\r\n[b]<3  it was a big part of my life!\r\n[c]how's this working out now?",
